var hlp_h_swsh01="<body bgColor=#0099cc><P><font size=4><B>Hjälp för trådlös användning</B></font></P><P><B>Obs!</B> Det är viktigt att driftläge och region är korrekt inställda så att alla föreskrifter efterlevs och kompatibilitet råder mellan liknande produkter i ditt område . <A name=region></A><P><B>Placering av routern för optimal trådlös anslutning</B></P><P>Driftavståndet eller räckvidden för den trådlösa anslutningen kan variera stort baserat på den fysiska placeringen av routern. Bäst resultat får du om du placerar den trådlösa routern:<UL><LI>Nära mitten av det område där din dator står.<LI>På en upphöjd plats, till exempel en hög hylla.<LI>På avstånd från möjliga störningskällor som datorer, mikrovågsugnar och trådlösa telefoner.<LI>På avstånd från stora metallytor. </LI></UL></P><P><B>Obs!</B> Om du inte följer riktlinjerna kan du få betydande prestandaminskning eller så går det inte att ansluta till routern trådlöst.</P><HR><A name=network></A><P><B>Trådlöst nätverk</B></P><P>Aktivera trådlös isolering</P><P>Om du markerar det här alternativet kommer den trådlösa klienten med aktuellt SSID endast att ha åtkomst till internet, och inte till andra trådlösa klienter ens om de har samma SSID, Ethernet-klienter eller den här enheten. Andra klienter har inte heller åtkomst till den här trådlösa klienten.</P><P>Aktivera samexistens vid 20/40 MHz</P><P>Om du inaktiverar det här alternativet kan trådlöst 2,4 GHz användas med maximal hastighet hela tiden. Om du aktiverar det här alternativet kan den maximala hastigheten för trådlöst 2,4 GHz sjunka till hälften om ett annat trådlöst nätverk identifieras, detta för att undvika störningar mellan trådlösa nätverk och för att kunna samexistera i befintlig miljö.</P><P>Namn (SSID).</P><P>Ange ett värde på upp till 32 alfanumeriska tecken. Samma namn (SSID) måste tilldelas till alla trådlösa enheter i nätverket. Det standardinställda SSID:t är NETGEAR, men NETGEAR rekommenderar starkt att du ändrar nätverkets namn (SSID) till ett annat värde. Det här värdet är skiftlägeskänsligt. Exempelvis är NETGEAR inte samma som NETGEAr.</P><P>Region</P><P>Välj din region från listrutan. I det här fältet visas för vilken region det trådlösa gränssnittet är avsett. Det kan vara olagligt att använda routern i vissa regioner som inte står med i den här listan. Om ditt land eller din region inte står med bör du kontakta en lokal myndighet eller läsa på NETGEARs webbplats där det finns mer information om vilka kanaler som kan användas.</P><P>Kanal</P><P>Det här fältet visar vilken frekvensområde som kommer att användas. Du ska inte behöva ändra den trådlösa kanalen såvida inte störningar uppstår p.g.a. en närliggande kopplingspunkt.</P>";
var hlp_h_swsh04="<P>Läge<P>Välj det trådlösa läge du vill använda. Alternativen är:<UL><LI>Upp till 54 Mbit/s - Äldre läge med maxhastigheten 54 Mbit/s för b/g-nätverk.<LI>Upp till 300 Mbit/s - Omgivningsvänligt läge, med maxhastigheten 300 Mbit/s när det finns angränsande trådlösa nätverk.<LI>Upp till 867 Mbit/s - Prestandaläge - Maxhastighet för Wireless-N på upp till 867 Mbit/s. </LI></UL><P>Standardvärdet för 2,4 GHz (b/g/n) är <b>Upp till 300 Mbit/s</b>, som fungerar med alla trådlösa stationer av typerna 11b, 11g och 11n. Standardvärdet för 5 GHz (a/n) är <b>Upp till 867 Mbit/s</b>, som fungerar med alla trådlösa stationer av typerna 11a och 11n. </P>";
var hlp_h_swsh03="<HR><A name=security></A><p><B>Säkerhetsalternativ</B></p><UL><LI>Ingen - ingen datakryptering<LI>WEP - Wired Equivalent Privacy, använd WEP 64- eller 128-bitars datakryptering<BR><B>Obs!</B>&nbsp;WPS-funktionen (Wi-Fi Protected Setup) är avaktiverad när säkerhetsinställningen är Autentisering med delad nyckel<LI>WPA2-PSK [AES] - (Wi-Fi Protected Access version 2 med Pre-Shared Key), använd WPA2-PSK-standardkryptering med AES-krypteringstyp<LI>WPA-PSK [TKIP] + WPA2-PSK [AES] - Tillåter klienterna att använda antingen WPA-PSK [TKIP] eller WPA2-PSK [AES]<LI>WPA/WPA2 för företag - Det finns funktioner för 802.1x-autentisering, inte för hemmabruk, du måste ha en RADIUS-server i nätverket.</LI></UL><p>För att du ska få bästa prestanda med trådlösa 11N-adaptrar i ett robust säkerhetsnätverk rekommenderar NETGEAR att du ändrar säkerhetsalternativet för ditt nätverk till WPA2-PSK.</p><HR><A name=wep></A><p><B>Säkerhetskryptering (WEP) </B></p><P>Autentiseringstyp </P><p>I normala fall kan du använda standardvärdet Automatisk för det här alternativet. Då kan adaptrar använda antingen Öppet system eller Delad nyckel som autentiseringstyp. Om du vill ha bättre och säkrare autentisering kan du välja Delad nyckel, så kan dina trådlösa adaptrar endast använda Delad nyckel för anslutning till det här nätverket.</P><p>Krypteringsstyrka </P><p>Välj WEP-krypteringsnivå: <UL><LI>64-bitars kryptering (ibland kallad 40-bitars) <LI>128-bitars kryptering </LI></UL><HR><A name=wepkey></A></P><p><B>Nyckel för säkerhetskryptering (WEP)</B></p><p>Om WEP är aktiverat kan du välja på att programmera de fyra datakrypteringsnycklarna manuellt eller automatiskt. Dessa värden måste vara identiska på alla datorer och kopplingspunkter i nätverket. </P><p>Manuellt inmatningsläge </P><p>Välj vilken av de fyra nycklarna som kommer att användas och ange matchande uppgifter om WEP-nyckel för ditt nätverk i det valda nyckelfältet. </P><p>För 64-bitars WEP anger du tio hexadecimalsiffror (valfri kombination av 0-9, A-F). </P><p>För 128-bitars WEP anger du tjugosex hexadecimalsiffror (valfri kombination av 0-9, A-F). </P><p>Se till att du klickar på Tillämpa för att spara inställningarna på den här menyn.</P><HR><A name=wpa2-psk></A><p><B>Säkerhetskryptering (WPA2-PSK)</B></p><p>WPA2 är en nyare version av WPA. Välj bara det här alternativet om alla trådlösa klienter i ditt nätverk stöder WPA2. Om det här alternativet är valt måste du använda AES-kryptering och ange WPA-lösenordsfrasen (nätverksnyckeln). Ange ett ord eller en grupp utskrivbara tecken i rutan Lösenordsfras. Lösenordsfrasen måste bestå av mellan 8 och 63 ASCII-tecken eller exakt 64 hexadecimala siffror. En hexadecimal siffra är något av följande tecken: <BR>0, 1, 2, ..., 8, 9, A, B, C, D, E eller F. </p><HR><A name=wpa-psk+wpa2-psk></A><p><B>Säkerhetskryptering (WPA-PSK + WPA2-PSK) </B></p><p>Med det här alternativet kan klienterna använda antingen WPA (med TKIP, Sändarpaket använder också TKIP) eller WPA2 (med AES). Om det här alternativet är valt måste krypteringen vara TKIP + AES. WPA-lösenordsfrasen (nätverksnyckeln) måste också anges. För högsta trådlösa prestanda måste 11N-klienter ansluta till den här routern med hjälp av WPA2-PSK (med AES). För klienter som ansluter i WPA-PSK (med TKIP) är den högsta trådlösa hastigheten vid 802.11g. Ange ett ord eller en grupp utskrivbara tecken i rutan Lösenordsfras. Lösenordsfrasen måste bestå av mellan 8 och 63 ASCII-tecken eller exakt 64 hexadecimala siffror. En hexadecimal siffra är något av följande tecken: <BR>0, 1, 2, ..., 8, 9, A, B, C, D, E eller F. </p><HR><A name=wpawpa2></a><p><B>Säkerhetskryptering (WPA/WPA2 för företag)</B></p><p>Det finns funktioner för 802.1x-autentisering, inte för hemmabruk, du måste ha en RADIUS-server i nätverket. I <B>WPA-läge</B> ingår WPA [TKIP], WPA2 [AES] och WPA [TKIP] + WPA2 [AES] (standardvärdet). <B>RADIUS-serverns IP-adress</B> är IP-adressen till RADIUS-servern (autentiseringsservern) som INTE får vara samma som IP-adressen till den router som användaren konfigurerar. Den här autentiseringsservern kan finnas på både WAN- och LAN-sidan. Värdeintervallet för <B>RADIUS-serverport</B> är mellan <B>1 och 65535</B>, och standardvärdet är 1812. Värdet för <B>RADIUS-serverns delade hemlighet</B> måste innehålla <B>64 tecken</B> (oktetter), och standardvärdet är ett tomt fält. Det går att använda 5 EAP-autentiseringsmetoder, EAP-TLS, EAP-TTLS/MSCHAPv2, PEAPv0/EAP-MSCHAPv2, PEAPv1/EAP-GTC och EAP-SIM.</p><HR><p><B>Så här sparar och avbryter du ändringar</B></p><p>Klicka på <B>Tillämpa</B> för att ändringarna ska börja gälla. <BR>Klicka på <B>Avbryt</B> om du vill återgå till de tidigare inställningarna. </p></body>";
