var hlp_h_adv_wds="<body bgcolor=#0099cc ><P><font size=4><B>Hjälp för inställning av trådlös upprepningsfunktion </B></font></P> <a name=en_repeat></a> <p><b>(Wireless Repeating Function Settings Help) Den här funktionen möjliggör trådlös upprepning</b></p> <p>Aktivera den om du vill använda Bridge-läget eller Repeater-läget och välj sedan önskat läge för din miljö. </p><ul>     <p><li><a name=repeat></a><strong>Trådlös repeater </strong>  <p>(Wireless Repeater) I det här läget kommunicerar routern <I>bara</I> med en annan trådlös station i basstationläge. Du måste ange MAC-adressen (den fysiska adressen) till den andra trådlösa stationen i basstationläge i fältet. WEP kan (och ska) användas till att skydda den här kommunikationen.   <p><li><a name=base></a><strong>Trådlös basstation (Wireless Base Station)  </strong>  <p>Välj bara det här alternativet om -routern är huvudrouter för en grupp trådlösa stationer i upprepningsläge. Andra trådlösa stationer i upprepningsläge måste anges till trådlöst upprepningsläge med hjälp av routerns MAC-adress. Sedan skickar de all trafik till den här huvudroutern istället för att kommunicera direkt med varandra. WEP kan (och ska) användas till att skydda den här trafiken.   <p>Om det här alternativet är valt måste du ange MAC-adresserna för de andra kopplingspunkter i fälten. </body>";
var hlp_h_adv_wire_setting="<body bgColor=#0099cc><P><font size=4><B>Hjälp för avancerad trådlös användning</B></font></P><P><B>Varning!  </B>Den trådlösa routern har redan konfigurerats med optimala inställningar. Ändra inte inställningarna såvida du inte har fått anvisningar från NETGEAR-supporten. Felaktiga inställningar kan göra att den trådlösa routern inte fungerar ordentligt.<HR><A name=settings></A><P><B>Inställningar för trådlös router</B></P><P>Aktivera trådlös routerradio <P>Routerns trådlösa kopplingspunkt kan aktiveras och avaktiveras för trådlös åtkomst. Lampan Wireless som indikerar trådlös användning på routerns frontpanel visar också aktuell status för den trådlösa kopplingspunkten så att du vet om den är aktiverad eller avaktiverad. Om den är aktiverad har trådlösa stationer åtkomst till internet. Om den är avaktiverad har trådlösa stationer ingen åtkomst till internet.</P><P>Enable SSID Broadcast (aktivera SSID-sändning)<P>Om den här funktionen är aktiverad kommer den trådlösa routern att sända sitt namn (SSID) till alla trådlösa stationer. Stationer som saknar SSID (eller har värdet null) kan då tillämpa rätt SSID för anslutningar till den här kopplingspunkten.</P><P>Aktivera WMM</P><P>WMM (trådlös multimedia) är en underuppsättning av standarden 802.11e. Med WMM kan trådlös trafik ha ett urval av prioriteter beroende på typen av data. Tidsberoende information som video eller ljud har högre prioritet än vanlig trafik. För att WMM ska fungera korrekt måste de trådlösa klienterna också stödja WMM.</P><P>Fragmentationströskel, CTS/RTS-tröskel, Inledningsläge<P>De här inställningarna är reserverade för trådlösa test och avancerad konfigurering. Ändra inte de här inställningarna.</P><HR><A name=wps></A><P><B>WPS-inställningar</B></P><p>Routerns PIN-kod</p><p>Det här är PIN-koden som du använder på en registrator (till exempel från Nätverksutforskaren i Windows 7) för att konfigurera routerns trådlösa inställningar via WPS. PIN-koden finns vanligtvis också på routerns produktetikett.</p><p>Aktivera routerns PIN-kod</p><P>Du kan bara konfigurera routerns trådlösa inställningar eller lägga till en trådlös klient via WPS med hjälp av routerns PIN-kod när PIN-kod har avaktiverats.</p><p>Säkerhet mot nyckelsökningsangrepp</p><p>WPS-routerns PIN-kod kan utsättas för nyckelsökningsangrepp. Om du aktiverar det här alternativet kan routerns PIN-kod inaktiveras automatiskt om routern identifierar ett misstänkt nyckelsökningsangrepp. När routerns PIN-kod inaktiveras automatiskt förblir den inaktiverad tills att routern startas om eller så kan du aktivera PIN-koden manuellt genom att markera kryssrutan Aktivera routerns PIN-kod och klicka på <b>Tillämpa</b>.<br>Med aktiverad säkerhet kan du konfigurera antalet misslyckade försök som tillåts innan routerns PIN-kod automatiskt inaktiveras.</p><P>Behåll befintliga trådlösa inställningar<P>Det här visar om routern är WPS-konfigurerad.<br>Om det här alternativet inte är markerat och en ny trådlös klient läggs till, ändras routerns trådlösa inställningar till ett automatiskt genererat slumpmässigt SSID och dito säkerhetsnyckel. Dessutom kanske inte en del externa registratorer (t.ex. Nätverksutforskaren i Windows 7) ser routern.<br>Om de grundläggande trådlösa inställningarna konfigureras från routerns hanterande användargränssnitt markeras det här alternativet automatiskt.</P><HR><A name=access></A><P><B>Åtkomstlista för kort för trådlöst</B></P><P>Som standard får trådlösa datorer som konfigurerats med rätt SSID åtkomst till ditt trådlösa nätverk. För att öka säkerheten kan du begränsa åtkomsten till det trådlösa nätverket genom att bara tillåta specifika datorer baserat på deras MAC-adresser. Klicka på knappen <b>Konfigurera åtkomstlista</b> på skärmen Trådlösa inställningar om du vill visa skärmen Trådlös åtkomstlista.</P><P><B>Så här sparar och avbryter du ändringar</B></P><P>Klicka på <B>Tillämpa </B>för att ändringarna ska börja gälla. <BR>Klicka på <B>Avbryt</B> om du vill återgå till de tidigare inställningarna. </P></body>";
var hlp_h_diag="<title>Hjälp</title><link rel=stylesheet href=help.css></head><body bgcolor=#0099cc> <p><font size=4><b>Felsökningshjälp</b></font></p><p>På den här sidan kan du utföra olika felsökningar. Dessa behövs inte vid normal användning.</p><a name=ping></a><p><b>Pinga en IP-adress eller värdnamn</b> Använd det här för att skicka en ping-paketbegäran till den angivna IP-adressen eller värdnamnet. Alternativet används ofta för att testa en anslutning. Om tidsgränsen för begäran överskrids (inget svar mottas) innebär det vanligtvis att destinationen inte går att nå.<br> Vissa nätverksenheter kan dock konfigureras till att inte besvara ping.<BR><B>Pinga VPN</B> – När du aktiverar pinga VPN går ping-paketet genom VPN-tunneln när VPN-tunneln är aktiverad och fungerar.<a name=dnslookup></a><p><b>Utför DNS-sökning</b><BR>En DNS (Domain Name Server) omvandlar internetnamnet (t.ex. www.netgear.com) till en IP-adress. Om du behöver IP-adressen till en webbplats, FTP, e-post eller annan server på internet kan du utföra en DNS-sökning för att söka efter IP-adressen.</p><a name=rtable></a><p><b>Visa dirigeringstabell</b><BR>Den här funktionen visar den interna dirigeringstabellen. Informationen används av den tekniska supporten och annan personal som förstår sig på dirigeringstabeller.</p><a name=reboot></a><p><b>Starta om routern</b><BR>Utföra en fjärromstart med hjälp av den här knappen. Du kan använda den här om routern verkar ha blivit instabil eller inte fungerar normalt.</p><p><b>Obs!</b>   Vid omstart bryts alla anslutningar till routern (t.ex. den här) eller som går via routern (t.ex. LAN-användare som använder Internet). Anslutningar till internet återupprättas dock om möjligt automatiskt.</p></body>";
var hlp_h_fwrl="<body bgcolor=#0099cc><h1 class=helpfile>Hjälp för brandväggsregler</h1> <p>Du kan använda det här fönstret för att skapa brandväggsregler för att blockera eller tillåta viss trafik. <B>Den här funktionen är endast till för avancerade administratörer!</b> Felaktig konfiguration orsakar allvarliga problem.</p><a name=out></a><h2 class=helpfile>Utgående tjänster</h2><p>Här visas alla befintliga regler för utgående trafik. Om du inte definierat några regler visas enbart standardregeln. Standardregeln tillåter all utgående trafik.<p>Så här skapar du en ny regel:<ol><li>Klicka på knappen Lägg till. (Det spelar ingen roll vilken alternativknapp som är vald)<li>Fönstret Utgående tjänst visas. Till det här fönstret finns en egen hjälpfil. <li>Fyll i fönstret Utgående tjänst och spara uppgifterna. Den nya regeln finns med i tabellen när du återgår till det här fönstret.</ol><p>Så här ändrar du en befintlig regel:<ol><li>Klicka på alternativknappen bredvid en rad i tabellen. </li><li>Klicka på knappen för önskad åtgärd:<ul><li>Redigera – för att ändra i regeldefinitionen. Fönstret Utgående tjänst visas med uppgifter om den valda regeln.<li>Flytta – för att flytta den valda regeln till en ny plats i tabellen. Du ombeds ange den nya positionen.<li>Ta bort – för att ta bort den valda regeln.</ul></ol><a name=in></a><h2 class=helpfile>Inkommande tjänster</h2><p>Här visas alla befintliga regler för inkommande trafik. Om du inte definierat några regler visas enbart standardregeln. Standardregeln blockerar all inkommande trafik.<p>Så här skapar du en ny regel:<ol><li>Klicka på knappen Lägg till. (Det spelar ingen roll vilken alternativknapp som är vald)<li>Fönstret Inkommande tjänst visas. Till det här fönstret finns en egen hjälpfil. <li>Fyll i fönstret Inkommande tjänst och spara uppgifterna. Den nya regeln finns med i tabellen när du återgår till det här fönstret.</ol><p>Så här ändrar du en befintlig regel:<ol><li>Klicka på alternativknappen bredvid en rad i tabellen. </li><li>Klicka på knappen för önskad åtgärd:<ul><li>Redigera – för att ändra i regeldefinitionen. Fönstret Inkommande tjänst visas med uppgifter om den valda regeln.<li>Flytta – för att flytta den valda regeln till en ny plats i tabellen. Du ombeds ange den nya positionen.<li>Ta bort – för att ta bort den valda regeln.</ul></ol><p><b>Tillämpa eller avbryta    </b></p><p>Klicka på <b>Tillämpa</b> för att uppdatera ändringar i tabellerna <b>Utgående tjänster</b> och <b>Inkommande tjänster</b>. <br>Klicka på <b>Avbryt</b> om du vill ignorera ändringar som du inte har sparat.<br></body>";
var hlp_h_log="<body bgcolor=#0099cc><P><font size=4><B>Hjälp för loggar </B></font></P><p> (Logs Help) En logg är ett detaljerat register över de webbsidor som användare i ditt nätverk har haft eller försökt att få åtkomst till. Om du har installerat innehållsfiltrering på skärmen Blockera webbsidor (Block Sites), visas skärmen Loggar (Logs) när någon i ditt nätverk försöker få åtkomst till en blockerad sida. Om du har aktivera e-postavisering får du dessa loggar i ett e-postmeddelande. Om du inte har aktiverat e-postavisering kan du visa loggarna här.</p><p><ul><li>Klicka på <b>Rensa log</b> (Clear Log) om du vill ta bort alla loggposter.</ul><p><ul><li>Klicka på <b>Uppdatera</b> (Refresh) om du vill se de senaste åtkomstförsöken.</ul><p><ul><li>Klicka på <b>Skicka logg</b> (Send Log) om du vill skicka loggfilen till ditt e–postkonto. Den här funktionen är användbar när du testar dina e-postinställningar.</ul></body>";
var hlp_h_portforward_1="<body bgcolor=#0099cc ><P><font size=4><B> Hjälp för portvidarebefordran/portutlösning </B></font></P><p>(Port Forwarding / Port Triggering Help) Portutlösning är en avancerad funktion som du kan använda för spel och andra Internet-program. Portvidarebefordran kan användas för att aktivera liknande funktioner, men den är statisk och därför har vissa begränsningar. </p><p>Portutlösning öppnar en inkommande port tillfälligt och kräver inte att servern på Internet spårar din IP-adress om den ändras av DHCP, till exempel. </p><p>Portutlösningen övervakar utgående trafik. När routern upptäcker trafik på den angivna utgående porten minns den IP-adressen till datorn som skickade datan och 'utlöser' den inkommande porten. Inkommande trafik på den utlösta porten vidarebefordras då till den utlösande datorn.</p><p><a name=select></a>På skärmen Portvidarebefordran/portutlösning (Port Forwarding / Port Triggering) kan du göra lokala datorer eller servrar tillgängliga på Internet för olika tjänster (till exempel FTP eller HTTP), för Internetspel (som Quake III) eller för olika Internet-program (som CU-SeeMe).</p><p>Portvidarebefordran är avsedd för FTP, webbservrar och andra serverbaserade tjänster. När portvidarebefordran har konfigurerats vidarebefordras en begäran från Internet till rätt server. </p>";
var hlp_h_portforward_2="<p>Portutlösning tillåter bara begäran från Internet när en tilldelad port har utlösts. Portutlösning gäller chatt- och Internetspel.</p><hr><p><b>Portvidarebefordran</b></p><p>(Port Forwarding) För de tjänster, program och spel som redan finns i listrutan behöver du bara ange datorns IP-adress. Annars kan du ange portnumret och datorns IP-adress för varje tjänst, spel eller program genom att klicka på knappen <b>lägg till anpassad tjänst</b> (Add Custom Service). </p><p><b> Porttilldelning </b></p><p>(Port Assignment) Du kan göra upp till 20 olika porttilldelningar för Internet-tjänster, -program och -spel. I listorna med <b>tjänstnamn</b> (Service Name) kan du välja en tjänst, ett program eller ett spel. Om du inte ser en post som du vill använda i listorna kan du kontakta programvaru- eller spelutvecklaren och be om rätt portsiffror.<p><b> För Internet-tjänster </b></p><p> ( For Internet Services) Innan du börjar måste du bestämma vilken typ av tjänster du vill tillhandahålla och ange IP-adressen till den dator som ska tillhandahålla tjänsterna. De vanligaste tjänsterna är en webbserver (HTTP) eller FTP server.</p><a name=setup></a><p>Så här konfigurerar du en dator eller server så att de blir tillgängliga på Internet för Internet-tjänster:<ol> <li>  Välj den Internettjänst du vill använda i listan <b>tjänstnamn</b> (Service Name).</li> <li>Skriv in datorns IP-adress i fältet <b>serverns IP-adress </b>(Server IP Address).</li> <li>Klicka på <b>lägg till (Add)</b>.</li></ol><p><b>Obs! </b>Det går bra att ha en enskild dator eller server tillgänglig för mer än en typ av tjänst. För att göra detta väljer du en annan tjänst och skriver in samma IP-adress för den datorn eller servern.</p><p><b> För Internetspel eller -program (For Internet Games or Applications) </b></p><p> (för Internetspel eller -program) Innan du börjar måste du veta vilken tjänst, vilket program eller spel du kommer att konfigurera. Du behöver också IP-adressen till den dator som du kommer att använda.</p><p>Så här konfigurerar du en dator till att spela Internetspel eller att använda Internet-program:<ol><li>Välj det Internet-program eller -spel som du vill använda från en av de relevanta listorna.  <br>Fälten <b>Startport  </b>(Start Port) och <b>Slutport  </b>(End Port) är ifyllda.  <br><b>Obs! </b>Om du hittar spelet eller programmet du vill ha i listorna kan du klicka på knappen <b>Lägg till anpassad tjänst</b> (Add Custom Service) och ange tjänstens namn, startport, slutport och serverns IP-adress. </li> <li>Skriv in datorns IP-adress i fältet<b>server-IP-adress</b> (Server IP Address). </li> <li>Klicka på <b>lägg till</b> (Add). </li></ol><p>Så här installerar du en ytterligare dator för spel, till exempel Hexen II eller KALI:<ol> <li> Klicka på <b>lägg till anpassad tjänst</b> (Add Custom Service).</li> <li>Skriv in tjänstens namn i fältet <b>tjänstnamn </b>(Service Name).</li> <li>Skriv in startportnumret i fältet <b> start- port</b> (Starting Port)  <br>För de här spelen använder du standardnumret och lägg till 1 för varje extra dator. Om du redan har konfigurerat en dator till att spela Hexen II via port 26900 skulle alltså den andra datorns portnummer vara 26901 och den tredje datorns portnummer 26902.</li> <li>Skriv samma portnummer i fältet <b>slutport</b> (Ending Port).</li> <li>Skriv in datorns IP-adress i fältet <b>server-IP-adress </b>(Server IP Address).</li> <li>Klicka på .<b>tillämpa (Apply)</b>. </li></ol><p>Så här modifierar du en tjänst:<ol> <li>Välj alternativknappen för tjänsten i tabellen. </li> <li>Klicka på <b>redigera tjänst</b> (Edit Service). </li> <li>Modifiera informationen i fälten <b>tjänstnamn</b> (Service Name), <b>start- port</b> (Starting Port), <b>slut- port</b> (Ending Port) och <b>server-IP-adress</b> (Server IP Address). </li> <li>Klicka på <b> tillämpa</b> (Apply). </li></ol><p>Så här tar du bort en tjänst:<ol> <li>Välj alternativknappen för tjänsten i tabellen. </li> <li>Klicka på <b>ta bort tjänst</b> (Delete Service). </li></ol></body>";
var hlp_h_pf_service="<body bgcolor=#0099cc><P><font size=4><B> Hjälp för anpassade tjänster – portar (Ports - Custom Services Help) </B></font></P><p> Så här installerar du ett program, ett spel eller en tjänst:<ol><li> Skriv in tjänstnamnet i fältet <b>tjänstnamn</b> (Service Name).</li><li>Skriv in startportnumret i fältet <b>startport</b> (Starting Port).<br></li><li>Om programmet bara använder en enskild port, skriver du samma portnummer i fältet <b>slutport</b> (Ending Port).</li><li>Om programmet använder ett intervall av portar skriver du slutportnumret för intervallet i fältet <b>slutport</b> (Ending Port).</li> <li>Skriv in IP-adressen i fältet <b>server-IP-adress</b> (Server IP Address).</li><li>Klicka på <b>tillämpa</b>(Apply).</li></ol><p>Så här redigerar du en tjänst:<ol><li>Modifiera informationen i fälten <b>tjänstnamn</b>(Service Name),<b> startport</b> (Starting Port),<b> Slutport (Ending Port)</b> och <b>server-IP-adress</b> (Server IP Address).</li><li>Klicka på <b>tillämpa</b>(Apply). </li></ol></body>";
var hlp_h_porttrigger="<body bgcolor=#0099cc ><P><font size=4><B> Hjälp för portvidarebefordran/portutlösning </B></font></P><p>(Port Forwarding / Port Triggering Help) Portutlösning är en avancerad funktion som du kan använda för spel och andra Internet-program. Portvidarebefordran kan användas för att aktivera liknande funktioner, men den är statisk och därför har vissa begränsningar. </p><p>Portutlösning öppnar en inkommande port tillfälligt och kräver inte att servern på Internet spårar din IP-adress om den ändras av DHCP, till exempel. </p><p>Portutlösningen övervakar utgående trafik. När routern upptäcker trafik på den angivna utgående porten minns den IP-adressen till datorn som skickade datan och 'utlöser' den inkommande porten. Inkommande trafik på den utlösta porten vidarebefordras då till den utlösande datorn.</p><p><a name=select></a>På skärmen Portvidarebefordran/portutlösning (Port Forwarding / Port Triggering) kan du göra lokala datorer eller servrar tillgängliga på Internet för olika tjänster (till exempel FTP eller HTTP), för Internetspel (som Quake III) eller för olika Internet-program (som CU-SeeMe).</p><p>Portvidarebefordran är avsedd för FTP, webbservrar och andra serverbaserade tjänster. När portvidarebefordran har konfigurerats vidarebefordras en begäran från Internet till rätt server. </p><p>Portutlösning tillåter bara begäran från Internet när en tilldelad port har utlösts. Portutlösning gäller chatt- och Internetspel.</p><hr><p><b>Portutlösning</b></p><p>Obs! Om rutan <b>Avaktivera portutlösning</b> är markerad kommer <b>alla</b> portutlösningsfunktioner att avaktiveras, men konfigurationsinformationen kommer att finnas kvar i routern.</p><p><a name=pt_timeout></b><b>Tidsgräns för portutlösning</b></p><p>Ange ett värde mindre än 9 999 minuter. Värdet på tidsgränsen för portutlösning kontrollerar inaktivitetstimern för tilldelade inkommande portar. Inkommande portar kommer att stängas när inaktivitetstimern går ut.</p><p><b> För internetspel eller -program </b></p><p>Innan du startar måste du känna till vilken tjänst, tillämpning eller vilket spel du kommer att konfigurera. Du måste även känna till den utgående portadressen (den utlösande porten) för spelet eller tillämpningen.</p><p>Om du konfigurerar datorn för att spela internetspel eller använda tillämpningar på internet: <ol> <li> Klicka på knappen <b>Lägg till tjänst</b>. </li> <li> Ange ett namn på tjänsten i fältet <b>Tjänstnamn</b>.  </li> <li> Om du väljer <b>Alla</b> (standardvärdet) under <b>Tjänstanvändare</b> kommer den här tjänsten att kunna användas av alla i nätverket. Om du vill begränsa tjänsten till en viss dator kan du välja <b>Enskild adress</b> och ange datorns IP-adress. </li> <li> Välj <b>Tjänsttyp</b>. </li> <li> Ange utgående portnummer i fältet <b>Utlösande port</b>. </li> <li> Ange information om inkommande port i fälten <b>Anslutningstyp</b>, <b>Startport</b> och <b>Slutport</b>. Den här informationen hittar du i spelets eller programmets handbok eller på supportwebbplatsen.  </li> <li> Klicka på knappen <b>Tillämpa</b>.  </li></ol><p>Så här ändrar du en tjänst:<ol> <li> Markera alternativknappen för tjänsten i tabellen. </li> <li> Klicka på <b>Redigera tjänst</b>. </li> <li> Gör dina ändringar.</li> <li> Klicka på knappen <b>Tillämpa</b>.</li></ol><p>Så här tar du bort en tjänst:<ol> <li> Markera alternativknappen för tjänsten i tabellen. </li> <li> Klicka på knappen <b>Ta bort tjänst</b>. </li></ol></body>";
var hlp_h_qos_main="<body bgcolor=#0099cc ><P><font size=4><B> Hjälp för QoS-inställningar </B></font></P><p>  QoS är en avancerad funktion som du kan använda för att prioritera vissa Internet-program och onlinespel samt minimera påverkan när bandbredden är full. <hr><p><a name=wifi></a><b> Inställningar för Wi-Fi Multimedia (WMM)</b><P> WMM (trådlös multimedia) är en underuppsättning av standarden 802.11e. Med WMM kan trådlös trafik ha ett urval av prioriteter beroende på typen av data. Tidsberoende information som video eller ljud har högre prioritet än vanlig trafik. För att WMM ska fungera korrekt måste de trådlösa klienterna också stödja WMM.<hr><p><a name=qos_on></a><b> Aktivera QoS för internetåtkomst </b><p> När den här funktionen är aktiverad prioriterar QoS-funktionen internettrafik. Du kan ändra prioritetsnivån för program, onlinespel, en Ethernet LAN-port eller en angiven MAC-adress som redan finns i listrutan genom att klicka på knappen <b>Redigera</b> . Om du vill ta bort prioritetsregeln kan du klicka på <b>Ta bort</b>. Du kan också definiera prioritetspolicyn för varje onlinespel, program, LAN-port eller datorns MAC-adress genom att klicka på knappen<b>Lägg till prioritetsregel</b>.<p><b>Så här sparar du och avbryter ändringar:</b><p>Klicka på <b>Tillämpa</b> om du vill att ändringarna ska börja gälla. <p>Klicka på <b>Avbryt</b> om du vill återgå till de tidigare inställningarna. <hr><p><b>För program eller onlinespel</b><p>. Så här anger du prioritet för ett program eller ett onlinespel: <ul>1. Välj <b>Program</b> eller <b>Onlinespel</b> i listorna </b>Prioritetskategori</b>. <br>2. Välj de internetprogram eller -spel som du vill använda i en av de relevanta listorna. <br>3. Välj prioritetsnivå: <b>Högst</b>, <b>Hög</b>, <b>Normal</b> eller <b>Låg</b>. <br>4. Du kan också skriva namnet i fältet <b>QoS-policy för</b> för den här regeln. <br>5. Klicka på <b>Tillämpa</b>.</ul><p><b>För en Ethernet LAN-port.</b><p>Så här anger du prioritet för datorer som är anslutna till en LAN-port: <ul>1. Välj numret för den LAN-port som du vill ange prioritetsnivå för. <br>2. Välj prioritetsnivå: <b>Högst</b>, <b>Hög</b>, <b>Normal</b> eller <b>Låg</b>. <br>3. Du kan också skriva namnet i fältet <b>QoS-policy för</b> för den här regeln. <br>4. Klicka på <b>Tillämpa</b>.</ul><p><b>För en MAC-adress.</b><p>Så här anger du prioritet för en specificerad dator via dess MAC-adress: <ul>1. Välj MAC-adressen i listan <b> Prioritetskategori</b>. <br>2. Klicka på knappen <b>Uppdatera</b> om du vill uppdatera listan för de datorer som redan är anslutna till routrar. <br>3. Välj postens alternativknapp i tabellen. <br>4. Ändra informationen i fälten <b>MAC-adress</b> och <b>Enhetsnamn</b>. <br>5. Välj prioritetsnivå: <b>Högst</b>, <b>Hög</b>, <b>Normal</b> eller <b>Låg</b>. <br>6. Du kan också skriva namnet i fältet <b>QoS-policy för</b> för den här regeln. <br>7.Klicka på knappen <b>Redigera</b>. <br>8.Klicka på <b> Tillämpa</b>. </ul><p>Så här lägger du till prioriteten för en specificerad dator via dess MAC-adress: <ul>1.  Välj <b>MAC-adress</b> i listan <b>Prioritetskategori</b>. <br>2.    Ange MAC-adressen till den dator som du vill ange prioritet för. <br>3. Du kan också ange ett namn i fältet <b>Enhetsnamn</b>. <br>4. Välj prioritetsnivå: Högst, Hög, Normal eller Låg. <br>5.     Du kan även skriva namnet i fältet <b>QoS-policy för</b> för den här regeln. <br>6. Klicka på <b>Lägg till</b>. <br>7.Klicka på <b> Tillämpa</b>. </ul><p><b>Så här tar du bort en tjänst:</b><ul>1. Välj postens alternativknapp i tabellen. <br>2. Klicka på <b>Ta bort</b>. <br>3. Klicka på <b>Tillämpa</b>. </body>";
var hlp_h_rm="<body bgcolor=#0099cc ><P><font size=4><B>Hjälp för fjärrhantering</B></font></P><p> (Remote Management Help) På skärmen Fjärrhantering (Remote Management) kan du låta en användare på Internet konfigurera, uppgradera och kontrollera status för din router.</p><p> <b>VIKTIGT: </b><i>Glöm inte att ändra routerns standardlösenord till ett mycket säkert lösenord.</i></p><hr><a name=turnon></a><p><b>Aktivera fjärrhantering (Turn Remote Management On)</b></p><p><ul> 1.Markera kryssrutan <b>aktivera fjärrhantering</b> (Turn Remote Management On).<br> 2. Klicka på <b>tillämpa</b> (Apply) om du vill spara ändringen.</ul> </ul> </p> <hr> <a name=address></a><p><b>Fjärrhanteringsadress</b></p><p>(Remote Management Address) Detta är den aktuella adressen som du använder när du får åtkomst till router från Internet. För att få åtkomst till routern måste du skriva in routerns WAN IP-adress i webbläsarfältet för adress (i IE) eller plats (i Netscape) följt av kolon (:) och det anpassade portnumret. Om din externa adress exempelvis är 10.0.0.123 och du använder portnummer 8080, anger du dem i din webbläsare:</p> <p><screen>http://10.0.0.123:8080</screen></p><hr><a name=access></a><p><b>Tillåt fjärråtkomst</b><p> (Allow Remote Access) För säkerhets skull bör du begränsa åtkomsten till så få externa IP-adresser som är praktiskt möjligt. <p><ul>Välj <b>bara den här datorn</b> (Only This Computer) om du vill ge åtkomst åt bara en IP-adress.</ul><p><ul>Välj <b>IP-adressintervall</b> (IP Address Range) om du vill tillåta åtkomst från ett helt intervall av IP-adresser på Internet. Ange en start- och slut-IP-adress för att definiera det tillåtna intervallet.</ul><p><ul>Välj <b>Alla</b> (Everyone) om du vill tillåta allmän åtkomst på Internet.</ul><hr><a name=port></a><p><b>Portnummer</b></p><p> (Port Number) Webbläsaråtkomst använder vanligtvis standardtjänstport 80 för HTTP. Om du vill ha större säkerhet kan du ändra webbgränssnittet för fjärrhantering till en anpassad port genom att ange det här numret i det angivna fältet. Välj ett nummer mellan 1024 och 65534, men använd inte numret för en allmän tjänstport.</p><hr> <p><b>Så här sparar och avbryter du ändringar:</b></p><a name=To></a><p> Klicka på <b>tillämpa</b> (Apply) om du vill att ändringarna ska börja gälla.<br> Klicka på <b>avbryt</b> (Cancel) om du vill återgå till de tidigare inställningarna.</p></body>";
var hlp_h_secu="<body bgcolor=#0099cc><P><font size=4><B>Hjälp för WAN-konfiguration  </B></font></P><p>På den här sidan kan du konfigurera en standard-DMZ-server och tillåta routern att svara på ping från internet. Båda alternativen är känsliga ifråga om säkerhet, så använd dem med försiktighet.</p><a name=spi></a><p><b>Avaktivera portskanning och DoS-skydd</b> - DoS-skydd skyddar ditt nätverk mot DoS-attacker. Den bör bara avaktiveras under speciella omständigheter.</p><a name=dmz></a><p><b> Standard-DMZ-server  </b><p>När du anger en standard-DMZ-server kan du konfigurera en dator eller server som är allmänt tillgänglig på internet för tjänster som du inte har definierat. Här är säkerheten ett problem, så använd bara den här möjligheten om du är villig att riskera öppen åtkomst. Om en odefinierad tjänstbegäran kommer in, avbryter routern den om du inte tilldelat en standard-DMZ-server.<p> Så här utser du en dator eller en server till DMZ-server: <ol><li>Markera kryssrutan <i>standard-DMZ-server</i></li>.<li>Skriv in IP-adressen för servern. </li><li>Klicka på <b>Tillämpa</b> (Apply). </li></ol><hr><a name=ping></a><p><b> Svara på ping på internetport  </b><p>Om du vill att routern ska svara på ping från internet markerar du den här kryssrutan. Den kan användas som ett diagnostiskt verktyg. Men liksom DMZ-servern kan det innebära ett säkerhetsproblem. Du bör inte markera den här kryssrutan om du inte har en specifik anledning till det.</p><a name=igmp></a><p><b>Avaktivera funktionen för IGMP-proxy</b></p><p>Med funktionen för IGMP-proxy kan en dator i ett LAN-nätverk ta emot relevant multicast-trafik från internet. Avaktivera funktionen om du inte behöver den genom att markera kryssrutan.</p><a name=mtu></a><p><b>MTU-storlek</b><p>Det normala värdet för MTU (Maximum Transmit Unit) för de flesta Ethernet-nätverk är 1 500 byte, 1 492 byte för PPPoE-anslutningar, 1 436 för PPTP-anslutningar och 1 428 för L2TP-anslutningar. Vissa internetleverantörer kräver att man minskar MTU-värdet. Det behövs dock sällan och ska inte utföras såvida du inte är säker på att det är nödvändigt för anslutningen till internetleverantören.</p><a name=nat></a><p><b>NAT-filtrering</b><p>Med det här alternativet anger du hur routern ska hantera inkommande trafik. Alternativet Säkrad ger en säker brandvägg som skyddar datorerna i det lokala nätverket från angrepp från internet. Samtidigt kan det orsaka att vissa internetspel, P2P-program eller multimediaprogram inte fungerar. Alternativet Öppen ger å andra sidan en mycket mindre säker brandvägg, men med den fungerar nästan alla internetprogram.</p><p><b>Avaktivera SIP ALG</b><p>Vissa program för röst-/videokommunikation fungerar inte optimalt med SIP ALG. Om du markerar det här alternativet och avaktiverar SIP ALG kan dina program för röst/video skapa/ta emot samtal genom routern.</p></body>";
var hlp_h_upnp="<body bgcolor=#0099cc >  <p><font size=4><b> Hjälp för UPnP</b></font></p><p>Universal Plug'n'Play (UPnP) hjälper enheter, till exempel Internet-enheter och datorer, att få åtkomst till nätverket och ansluta till andra enheter när det behövs. UPnP-enheterna kan automatiskt upptäcka tjänster från andra registrerade UPnP-enheter i nätverket. </p><a name=turnon></a> <p><b>Slå på UPnP</b></p><p>(Turn UPnP On) UPnP kan aktiveras för automatisk enhetskonfiguration eller avaktiveras. Standardinställningen för UPnP är Aktiverad. Om den här funktionen är avaktiverad kommer routern inte att tillåta att någon enhet styr dess resurser automatiskt, till exempel portvidarebefordran (mappning). </p><a name=adv></a>  <p><b>Annonseringsperiod</b></p><p>(Advertisement Period) Den här perioden anger hur ofta routern annonserar (sänder) sin UPnP-information. Det här värdet kan ligga inom intervallet 1–1440 minuter. Standardvärdet är 30 minuter. Kortare perioder säkerställer att kontrollpunkterna har aktuell enhetsstatus på bekostnad av ytterligare nätverkstrafik. Längre perioder kan kompromissa med enhetsstatusens aktualitet, men kan samtidigt ge en avsevärd minskning av nätverkstrafik.</p><a name=live></a>  <p><b>Annonseringens livstid</b></p><p>(Advertisement Time to Live) Annonseringens livstid mäts i hopp (steg) för varje UPnP-paket som skickas. Ett hopp är antalet steg som tillåts att spridas för varje UPnP-annonsering innan den försvinner. Antalet hopp kan vara mellan 1 och 255. Standardvärdet för annonseringens livstid är fyra hopp, vilket brukar räcka bra för de flesta hemmanätverk. Om du märker att vissa enheter inte uppdateras eller nås som de ska, kanske det här värdet måste ökas en aning.</p><a name=table></a><p><b>UPnP Portmap-tabell</b></p><p>(UPnP Portmap Table) Den här tabellen visar IP-adressen för varje UPnP-enhet som har åtkomst till routern just nu, och vilka portar (interna och externa) som enheten har öppnat. UPnP Portmap-tabellen visar också vilken typ av port som har öppnats och om den porten fortfarande är aktiv för varje IP-adress.<p><b>Så här sparar, avbryter och uppdaterar du tabellen:</b></p><p>Klicka på <b>tillämpa</b> (Apply) för att spara de nya inställningarna på routern. <br>Klicka på <b>avbryt</b> (Cancel) om du vill avbryta ändringar som du inte har sparat. <br>Klicka på <b>Uppdatera</b> (Refresh) om du vill uppdatera Portmap-tabellen och visa vilka aktiva portar som har öppnats av UPnP-enheter.  </body>";
var hlp_h_usb_basic = hlp_h_usb_adv="<body bgColor=#0099cc><P><font size=4><B> Hjälp för USB-lagring </B></font></P><P><B>Obs! </B>Den här sidan är bara till för avancerade användare. När en USB-lagringsenhet är ansluten installeras den automatiskt av routern.</P><P><a name=device></a><B> Nätverks-/enhetsnamn  </B></P><P> Det namn som används för att komma åt routern från din dator.</P><P><a name=workgroup></a><B> Arbetsgrupp</B></P><P> Det arbetsgruppsnamn routern använder.</P><P><a name=access></a><B> Förteckning över åtkomstmetoder</B></P><P> I den här förteckningen visas de olika sätt på vilka man får åtkomst till nätverksmapparna</P><P><B> Obs!</B> I standardläget är endast nätverksanslutning och HTTP aktiverade<UL><LI> Åtkomstmetod: Lista över alla tillgängliga metoder <ul><li> Nätverksanslutning: Här används UNC-sökvägar t.ex. readysharephotos</li><li> HTTP: Den här anslutningen kan kommas åt via en webbläsare </li><li> HTTP (Internet): Den här anslutningen kan kommas åt via en webbläsare på Internet </li><li> FTP: Den här anslutningen kan kommas åt via en FTP-klient i hemnätverket</li><li>FTP (Internet): Den här anslutningen kan kommas åt via en fjärransluten FTP-klient över Internet</li></ul></LI><LI> Status: Visar om de olika åtkomstmetoderna är aktiverade eller avaktiverade </LI><LI> Länk: Oavsett åtkomstmetod kommer du åt dina lagrade data direkt genom att klicka på länken som visas eller genom att klistra in länken i en webbläsare </LI><LI> Port: För Internetprotokoll som HTTP/FTP visas porten, och för metoder för Internetåtkomst som HTTP/FTP (via Internet) kan det här anpassas.</LI></UL></P><P><B> Knappen Tillämpa  </B></P><P> Klicka på den här knappen för att spara alla ändringar du gjort på sidan </P><P><a name=available></a><B> Förteckning över tillgängliga nätverksmappar  </B></P><P> Det här är en förteckning över alla nätverksmappar som är konfigurerade och tillgängliga på routern:<UL><LI> Mappnamn: Fullständig sökväg till den nätverksmapp som används </LI><LI> Volymnamn: Volymnamn på lagringsenheten (antingen USB-enhet eller hårddisk)</LI><LI> Totalt/ledigt utrymme: Visar hur stor del av lagringsenheten som används </LI><LI> Delat namn: Det namn som visas i routerns webbaserade användargränssnitt. Du kommer åt dina lagrade data direkt genom att klicka här eller genom att klistra in det delade namnet i en webbläsare, t.ex. //readyshare/photos. Om &quot;Inte delat&quot; visas så har standardinställningen för delning tagits bort och det finns ingen annan delning av rotmappen.</LI><LI> Läs-/skrivbehörighet: Visa behörigheter/åtkomstkontroll för nätverksmappen:<ul><li>&quot;Alla - inget lösenord&quot; ger alla användare tillgång till nätverksmappen </li><li>&quot;admin&quot; betyder att alla användare ska använda samma användarnamn och lösenord för åtkomst till routerns webbaserade användargränssnitt </li></ul></LI></UL></P><P><B> Knappen Redigera  </B></P><P> Genom att välja en nätverksmapp och klicka på knappen Redigera kan du ändra uppgifterna för nätverksmappen.<UL><LI> Mapp: Klicka på Bläddra och bläddra till mappträdet där du väljer den enhet eller undermapp du vill dela </LI><LI> Delat namn: Det namn som visas när du ansluter till nätverksmappen </LI><LI> Läsbehörighet: Bestämmer läsbehörighet </LI><LI> Skrivbehörighet: Bestämmer skrivbehörighet </LI></UL></P><P><B> Skapa nätverksmapp  </B></P><P> Klicka här om du vill skapa en ny nätverksmapp<UL><LI> USB-enhet: Välj den enhet du vill dela i rullgardinsmenyn </LI><LI> Mapp: Klicka på Bläddra och bläddra till mappträdet där du väljer den enhet eller undermapp du vill dela </LI><LI> Delat namn: Det namn som visas när du ansluter till nätverksmappen </LI><LI> Läsbehörighet: Bestämmer läsbehörighet </LI><LI> Skrivbehörighet: Bestämmer skrivbehörighet </LI></UL></P><P><B> Knapp för säker borttagning av USB-enhet  </B></P><P> Du tar bort en av eller alla USB-enheter som är anslutna till routern på ett säkert sätt genom att klicka på den här knappen. </P><P><B> Knappen Tillämpa  </B></P><P> Klicka på den här knappen för att spara alla ändringar du gjort på sidan </P><P><B> Knappen Uppdatera</B></P><P> Uppdatera sidan genom att klicka på den här knappen. Det kan vara användbart om du precis har anslutit en ny USB-enhet</P></BODY>";
var hlp_h_usb_apd="<body bgColor=#0099cc><P><font size=4><B> Hjälp angående godkända USB-enheter</B></font></P><P> För ökad säkerhet kan du ställa in att routern endast ska dela utvalda USB-enheter. Du aktiverar den här funktionen genom att markera kryssrutan Tillåt endast godkända enheter och klicka på knappen Tillämpa.</P><P> Så här lägger du till en enhet till de godkända USB-enheterna:<OL><LI> Enheten måste vara ansluten till routern.</LI><LI> När den är ansluten visas enheten under Tillgängliga USB-enheter </LI><LI> Välj enheten och klicka på Lägg till </LI></OL></P><P> Så här tar du bort en enhet från dina godkända USB-enheter:<OL><LI> Välj enheten under Godkända USB-enheter </LI><LI> Klicka på Ta bort </LI></OL></P></BODY>";
//var hlp_h_usb_basic="<body bgColor=#0099cc><P><font size=4><B> USB Storage (Basic Settings) Help</B></font></P><P><B>NOTE:</B>This page shows your current USB Storage settings, to Edit any of settings shown, or to create a new Network Folder, click Edit </P><P><a name=device></a><B> Network/Device Name </B></P><P> Is the name used to access the Router from your Laptop/PC. The Network/Device Name shown in the Router Web GUI can either be clicked to immediately access the storage or can be entered into a web browser e.g //readyshare.</P><P><a name=available_folder></a><B> Available Network Folders Table</B></P><P> This table shows all the Network Folders currently available and configured on the Router:<UL><LI> Folder Name : Full path of the used by the Network Folder </LI><LI> Volume Name : Volume name from the storage device (either USB drive or HDD)</LI><LI> Total/Free Space : Shows the current utilization of the storage device </LI><LI> Share Name : The Name shown in the Router Web GUI can either be clicked to immediately access the storage or can be entered into a web browser e.g//readyshare/photos.If 'Not Shared' is shown then the default share has been deleted and no other share for the root folder exists. Click the link to change this setting.</LI><LI> Read/Write Access : Shows the permissions/access controls on the Network Folder:<ul><li>All - no password allows all users to access the Network Folder </li><li>admin will prompt for users to provide the same username and password used to access the Router Web GUI </li></ul></LI></UL></P><P><B> Edit Button </B></P><P> Click to Edit any of settings shown, or to create a new Network Folder </P><P><B> Safely Remove USB Device Button </B></P><P> Click to Safely Remove either one or all of the USB devices attached to your Router </P><P><B> Refresh Button </B></P><P>Click to Refresh the page, helpful if you have just connected a new USB device</P></BODY>";
var hlp_h_usb_settings="<body bgColor=#0099cc><P><font size=4><B> Hjälp angående USB-inställningar</B></font></P><P> För ökad säkerhet kan du ställa in att routern endast ska dela utvalda USB-enheter. Du aktiverar den här funktionen genom att välja Nej och klicka på knappen Tillämpa.</P><P> Klicka på Godkända enheter om du vill ange godkända enheter </P></BODY>";
var hlp_h_usb_print="<body bgcolor=#0099cc><P><font size=4><B>Hjälp för ReadySHARE Printer</B></font></P><p>Med ReadySHARE Printer kan Windows- och Mac-datorer dela med en USB-skrivare som är ansluten till routerns USB-port.</p></body>";
var hlp_h_wds="<body bgColor=#0099cc><P><font size=4><B>Hjälp för avancerad trådlös användning</B></font></P><P><B>Varning! </B>Den trådlösa routern har redan konfigurerats med optimala inställningar. Ändra inte dessa inställningar om inte anvisningar om detta har erhållits från NETGEARs support. Felaktiga inställningar kan göra att den trådlösa routern inte fungerar ordentligt.<HR><A name=settings></A><P><B>Inställningar för trådlös router</B></P><P>Aktivera trådlös routerradio <P>Routerns trådlösa kopplingspunkt kan aktiveras och avaktiveras för trådlös åtkomst. Lampan Wireless som indikerar trådlös användning på routerns frontpanel visar också aktuell status för den trådlösa kopplingspunkten så att du vet om den är aktiverad eller avaktiverad. Om den är aktiverad har trådlösa stationer åtkomst till internet. Om den är avaktiverad har trådlösa stationer ingen åtkomst till internet.</P> <P>Fragmentationströskel, CTS/RTS-tröskel, Inledningsläge<P>De här inställningarna är reserverade för trådlösa test och avancerad konfigurering. Ändra inte de här inställningarna.</P><P>Stäng av den trådlösa signalen efter schema</P><P>Om du markerar den här kryssrutan kan du lägga till, redigera eller ta bort regeln under den tidsperiod då den trådlösa signalen är avstängd. Den här funktionen kan aktiveras om internetanslutningen fungerar och routern kan hämta uppdateringar från NTP-servern.</P><HR><A name=wps></A><P><B>WPS-inställningar</B></P><p>Routerns PIN-kod</p><p>Det här är PIN-koden som du använder på en registrator (till exempel från Nätverksutforskaren på en dator med Windows Vista) för att konfigurera routerns trådlösa inställningar via WPS. PIN-koden finns också på routerns produktetikett. </p><P>Avaktivera routerns PIN-kod<P> Du kan bara konfigurera routerns trådlösa inställningar eller lägga till en trådlös klient via WPS med hjälp av routerns PIN-kod när PIN-kod har avaktiverats. Routerns PIN-kod kan avaktiveras temporärt när routern upptäcker misstänkta försök att bryta sig in i de trådlösa inställningarna genom att använda routerns PIN-kod via WPS. Du kan aktivera den här funktionen manuellt genom att avmarkera <b></b>kryssrutan och klicka på knappen <b>Tillämpa</b>. </P><P><b>Behåll befintliga trådlösa inställningar</b> <P>Detta visar om routern har WPS-konfigurerad status.<br>Om det här alternativet inte är valt och en ny trådlös klient läggs till, ändras routerns trådlösa inställningar till ett automatiskt genererat slumpmässigt SSID och dito säkerhetsnyckel. Om alternativet däremot är valt syns inte routern för vissa externa registratorer (till exempel Network Explorer på Vista Windows).Om de grundläggande trådlösa inställningarna konfigureras från routerns hanterande användargränssnitt väljs det här alternativet automatiskt.</P><HR><A name=access></A><P><B>Åtkomstlista för trådlösa kort</B></P><P>Som standard får trådlösa datorer som konfigurerats med rätt SSID åtkomst till ditt trådlösa nätverk. För att öka säkerheten kan du begränsa åtkomsten till det trådlösa nätverket genom att bara tillåta specifika datorer baserat på deras MAC-adresser. Klicka på knappen <b>Konfigurera åtkomstlista</b> på skärmen Trådlösa inställningar om du vill visa skärmen Trådlös åtkomstlista.</P><P><B>Så här sparar och avbryter du ändringar</B></P><P>Klicka på <B>Tillämpa</B> för att ändringarna ska börja gälla. <BR>Återgå till de föregående inställningarna genom att klicka på <B>Avbryt</B>. </P></body>";
var hlp_h_wire_guest_abgn="<body bgColor=#0099cc><P><font size=4><B>Gästnätverksinställningar  </B></font></P><p><b>Det här är tänkt för att låta gäster använda din internetanslutning utan du behöver ge dem säkerhetsnyckeln till ditt trådlösa nätverk.</b></p><HR><A name=network></A><A name=wireless></A><P><B>Trådlösa inställningar för en profil</B></P><A name=enable_guest></A><p>Aktivera gästnätverk <p>Om den här kryssrutan är markerad är det aktuella gästnätverket aktiverat. Du och dina besökare kan ansluta till ditt nätverk via SSID:t för profilen.<A name=enable_ssid></A><p>Aktivera SSID-sändning <p>Om det här alternativet är aktiverat kommer den trådlösa åtkomstpunkten att sända ut sitt namn (SSID) till alla trådlösa stationer. Stationer som saknar SSID (eller har värdet null) kan då tillämpa rätt SSID för anslutningar till den här kopplingspunkten.<A name=allow_guest></A><p>Tillåt gäster att se varandra och komma åt mitt lokala nätverk <p>När alternativet är avmarkerat har användare som ansluter till gästnätverket enbart åtkomst till internet men inte till andra enheter i samma nätverk eller i andra nätverk, däribland huvudnätverket och det trådanslutna nätverket. Dessutom saknar klienterna i gästnätverket åtkomst till routerns administrationsgränssnitt och andra tjänster som tillhandahålls av routern (till exempel ReadySHARE-lagring, ReadySHARE Printer m.fl. om routern har de funktionerna).<br>När alternativet är markerat har användare som ansluter till gästnätverket åtkomst inte bara till internet, utan även till alla enheter på alla lokala nätverk, däribland huvudnätverket och det trådanslutna nätverket.<A name=guest_ssid></A><p>Namn på trådlöst gästnätverk (SSID) <p>Ange ett värde på upp till 32 alfanumeriska tecken. Samma namn (SSID) måste tilldelas till alla trådlösa enheter i nätverket. Det standardinställda SSID:t är NETGEAR_Guest, men NETGEAR rekommenderar starkt att du ändrar nätverkets namn (SSID) till ett annat värde. Det här värdet är dessutom skiftlägeskänsligt. Exempelvis är <i>NETGEAR</i> inte samma som <i>NETGEAr</i>.</p><HR><A name=security></A><p><b>Säkerhetsalternativ</b></p><UL><LI>Ingen - ingen datakryptering<LI>WEP - Wired Equivalent Privacy, använd WEP 64- eller 128-bitars datakryptering<br><b>Obs!</b> WPS-funktionen (Wi-Fi Protected Setup) är avaktiverad när säkerhetsinställningen är WEP.<LI>WPA2-PSK [AES] - (Wi-Fi Protected Access version 2 med Pre-Shared Key), använd WPA2-PSK-standardkryptering med AES-krypteringstyp<LI>WPA-PSK [TKIP] + WPA2-PSK [AES] - Tillåter klienterna att använda antingen WPA-PSK [TKIP] eller WPA2-PSK [AES]<LI>WPA/WPA2 för företag - Det finns funktioner för 802.1x-autentisering, inte för hemmabruk, du måste ha en RADIUS-server i nätverket.</LI></UL><p>För att du ska få bästa prestanda med trådlösa 11N-adaptrar i ett robust säkerhetsnätverk rekommenderar NETGEAR att du ändrar säkerhetsalternativet för ditt nätverk till WPA2-PSK.</p><HR><A name=wep></A><p><b>Säkerhetskryptering (WEP)  </b></p><P>Autentiseringstyp <p>I normala fall kan du använda standardvärdet Automatisk för det här alternativet. Du kan välja att låta adaptern använda Öppet system eller Delad nyckel som autentiseringstyp. Om du vill ha bättre och säkrare autentisering kan du välja Delad nyckel, så kan dina trådlösa adaptrar endast använda Delad nyckel för anslutning till det här nätverket.<p>Krypteringsstyrka <p>Välj WEP-krypteringsnivå: <UL><LI>64-bitars kryptering (ibland kallad 40-bitars) <LI>128-bitars kryptering </LI></UL><HR><A name=wepkey></A><p><b>Nyckel för säkerhetskryptering (WEP)</b></p><p>Om WEP är aktiverat kan du välja på att programmera de fyra datakrypteringsnycklarna manuellt. Dessa värden måste vara identiska på alla datorer och kopplingspunkter i nätverket. <p>Välj vilken av de fyra nycklarna som kommer att användas och ange matchande uppgifter om WEP-nyckel för ditt nätverk i det valda nyckelfältet. <p>För 64-bitars WEP anger du tio hexadecimalsiffror (valfri kombination av 0-9, A-F). <p>För 128-bitars WEP anger du tjugosex hexadecimalsiffror (valfri kombination av 0-9, A-F). <p>Se till att du klickar på Tillämpa för att spara inställningarna på den här menyn.</P><HR><A name=wpa-psk></A><p><b>Säkerhetskryptering (WPA2-PSK)</b></p><p>WPA2 är en nyare version av WPA. Välj bara det här alternativet om alla trådlösa klienter i ditt nätverk stöder WPA2. Om det här alternativet är valt måste du använda AES-kryptering och ange WPA-lösenordet (nätverksnyckeln). Ange ett ord eller en grupp utskrivbara tecken i rutan Lösenord. Lösenordet måste bestå av mellan 8 och 63 ASCII-tecken eller exakt 64 hexadecimala siffror. En hexadecimal siffra är något av följande tecken: <br>0, 1, 2, ..., 8, 9, A, B, C, D, E eller F. </p><HR><A name=wpa-psk+wpa2-psk></A><p><b>Säkerhetskryptering (WPA-PSK + WPA2-PSK)  </b></p><p>Med det här alternativet kan klienterna använda antingen WPA (med TKIP, Sändarpaket använder också TKIP) eller WPA2 (med AES). Om det här alternativet är valt måste krypteringen vara TKIP + AES. WPA-lösenordet (nätverksnyckeln) måste också anges. För högsta trådlösa prestanda måste 11N-klienter ansluta till den här routern med hjälp av WPA2-PSK (med AES). För klienter som ansluter i WPA-PSK (med TKIP) är den högsta trådlösa hastigheten vid 802.11g. Ange ett ord eller en grupp utskrivbara tecken i rutan Lösenord. Lösenordet måste bestå av mellan 8 och 63 ASCII-tecken eller exakt 64 hexadecimala siffror. En hexadecimal siffra är något av följande tecken: <br>0, 1, 2, ..., 8, 9, A, B, C, D, E eller F. </p><HR><A name=wpawpa2></a><p><b>Säkerhetskryptering (WPA/WPA2 för företag)</b></p><p>Det finns funktioner för 802.1x-autentisering, inte för hemmabruk, du måste ha en RADIUS-server i nätverket. I <b>WPA-läge</b> ingår WPA [TKIP], WPA2 [AES] och WPA [TKIP] + WPA2 [AES] (standardvärdet). <b>RADIUS-serverns IP-adress</b> är IP-adressen till RADIUS-servern (autentiseringsservern) som INTE får vara samma som IP-adressen till den router som användaren konfigurerar. Den här autentiseringsservern kan finnas på både WAN- och LAN-sidan. Värdeintervallet för <b>RADIUS-serverport</b> är mellan <b>1 och 65535</b>, och standardvärdet är 1812. Värdet för <b>RADIUS-serverns delade hemlighet</b> måste innehålla <b>64 tecken</b> (oktetter), och standardvärdet är ett tomt fält. Det går att använda 5 EAP-autentiseringsmetoder, EAP-TLS, EAP-TTLS/MSCHAPv2, PEAPv0/EAP-MSCHAPv2, PEAPv1/EAP-GTC och EAP-SIM.</p><HR><p><b>Så här sparar och avbryter du ändringar</b></p><p>Klicka på <b>Tillämpa</b> för att ändringarna ska börja gälla. <br>Klicka på <b>Avbryt</b> om du vill återgå till de tidigare inställningarna. </p></body>"
var hlp_h_wire_guest_bg="<body bgColor=#0099cc><P><font size=4><B>Gästnätverksinställningar </B></font></P><p><B>Det här är tänkt för att låta gäster använda din internetanslutning utan du behöver ge dem säkerhetsnyckeln till ditt trådlösa nätverk.</B></p><HR><A name=network></A><A name=wireless></A><P><B>Trådlösa inställningar för en profil</B></P><A name=enable_guest></A><p>Aktivera gästnätverk </P><p>Om den här kryssrutan är markerad är det aktuella gästnätverket aktiverat. Du och dina besökare kan ansluta till ditt nätverk via SSID:t för profilen. <A name=enable_isolation></A></P><P>Aktivera trådlös isolering</P><P>Om du markerar det här alternativet kommer den trådlösa klienten med aktuellt SSID endast att ha åtkomst till internet, och inte till andra trådlösa klienter ens om de har samma SSID, Ethernet-klienter eller den här enheten. Andra klienter har inte heller åtkomst till den här trådlösa klienten. <A name=enable_ssid></A></P><p>Aktivera SSID-sändning </P><p>Om det här alternativet är aktiverat kommer den trådlösa åtkomstpunkten att sända ut sitt namn (SSID) till alla trådlösa stationer. Stationer som saknar SSID (eller har värdet null) kan då tillämpa rätt SSID för anslutningar till den här kopplingspunkten.<A name=allow_guest></A></P><p>Ge en gäst åtkomst till Mitt lokala nätverk </P><p>Om alternativet inte markeras har användare som ansluter till denna SSID endast åtkomst till internet direkt, samt till andra klienter i samma SSID-nätverk. Klienter hos aktuell SSID har inte åtkomst till routerns webbgränssnitt, klienter för andra SSID, Ethernet-nätverk eller andra tjänster på den trådlösa routern.<BR>Om alternativet markeras har samtliga användare som ansluter till denna SSID åtkomst inte bara till internet, utan även till lokala nätverk på den här trådlösa routern, precis som användare på den primära SSID:n.<A name=guest_ssid></A></P><p>Namn på trådlöst gästnätverk (SSID) </P><p>Ange ett värde på upp till 32 alfanumeriska tecken. Samma namn (SSID) måste tilldelas till alla trådlösa enheter i nätverket. Standard-SSID är NETGEAR_Guest<B>N</B>, där N är profilnumret, men NETGEAR rekommenderar att du ändrar nätverksnamnet (SSID) till någonting annat. Det här värdet är dessutom skiftlägeskänsligt. Exempelvis är <I>NETGEAR</I> inte samma som <I>NETGEAr</I>.</p><HR><A name=security></A><p><B>Säkerhetsalternativ</B></p><UL><LI>Ingen - ingen datakryptering<LI>WEP - Wired Equivalent Privacy, använd WEP 64- eller 128-bitars datakryptering<BR><B>Obs!</B>&nbsp;WPS-funktionen (Wi-Fi Protected Setup) är avaktiverad när säkerhetsinställningen är Autentisering med delad nyckel<LI>WPA-PSK [TKIP] - (Wi-Fi Protected Access med Pre-Shared Key), använd WPA-PSK-standardkryptering med TKIP-krypteringstyp<LI>WPA2-PSK [AES] - (Wi-Fi Protected Access version 2 med Pre-Shared Key), använd WPA2-PSK-standardkryptering med AES-krypteringstyp<LI>WPA-PSK [TKIP] + WPA2-PSK [AES] - Tillåter klienterna att använda antingen WPA-PSK [TKIP] eller WPA2-PSK [AES]<LI>WPA/WPA2 för företag - Det finns funktioner för 802.1x-autentisering, inte för hemmabruk, du måste ha en RADIUS-server i nätverket.</LI></UL><p>För att du ska få bästa prestanda med trådlösa 11N-adaptrar i ett robust säkerhetsnätverk rekommenderar NETGEAR att du ändrar säkerhetsalternativet för ditt nätverk till WPA2-PSK.</p><HR><A name=wep></A><p><B>Säkerhetskryptering (WEP) </B></p><P>Autentiseringstyp </P><p>I normala fall kan du använda standardvärdet Automatisk för det här alternativet. Du kan välja att låta adaptern använda Öppet system eller Delad nyckel som autentiseringstyp. Om du vill ha bättre och säkrare autentisering kan du välja Delad nyckel, så kan dina trådlösa adaptrar endast använda Delad nyckel för anslutning till det här nätverket.</P><p>Krypteringsstyrka </P><p>Välj WEP-krypteringsnivå: <UL><LI>64-bitars kryptering (ibland kallad 40-bitars) <LI>128-bitars kryptering </LI></UL><HR><A name=wepkey></A></P><p><B>Nyckel för säkerhetskryptering (WEP)</B></p><p>Om WEP är aktiverat kan du välja på att programmera de fyra datakrypteringsnycklarna manuellt eller automatiskt. Dessa värden måste vara identiska på alla datorer och kopplingspunkter i nätverket. </P><p>Automatisk nyckelgenerering (lösenordsfras) </P><p>Ange ett ord eller en grupp utskrivbara tecken i rutan Lösenordsfras och klicka på knappen Generera för att automatiskt konfigurera WEP-nycklarna. Om krypteringsstyrkan har angetts till 64 bitar kommer alla de fyra nyckelrutorna att fyllas i automatiskt med nyckelvärden. Om krypteringsstyrkan har angetts till 128 bitar genereras endast en WEP-nyckel, och de fyra nyckelfälten fylls i med samma nyckelvärde. </P><p>Manuellt inmatningsläge </P><p>Välj vilken av de fyra nycklarna som kommer att användas och ange matchande uppgifter om WEP-nyckel för ditt nätverk i det valda nyckelfältet. </P><p>För 64-bitars WEP anger du tio hexadecimalsiffror (valfri kombination av 0-9, A-F). </P><p>För 128-bitars WEP anger du tjugosex hexadecimalsiffror (valfri kombination av 0-9, A-F). </P><p>Se till att du klickar på Tillämpa för att spara inställningarna på den här menyn.</P><HR><A name=wpa-psk></A><p><B>Säkerhetskryptering (WPA-PSK)</B></p><p>Om det här alternativet är valt måste du använda AES-kryptering och ange WPA-lösenordsfrasen (nätverksnyckeln). Ange ett ord eller en grupp utskrivbara tecken i rutan Lösenordsfras. Lösenordsfrasen måste bestå av mellan 8 och 63 ASCII-tecken eller exakt 64 hexadecimala siffror. En hexadecimal siffra är något av följande tecken: <BR>0, 1, 2, ..., 8, 9, A, B, C, D, E eller F. </P><p>Var noga med att klicka på knappen Tillämpa så att inställningarna sparas. </p><HR><A name=wpa2-psk></A><p><B>Säkerhetskryptering (WPA2-PSK)</B></p><p>WPA2 är en nyare version av WPA. Välj bara det här alternativet om alla trådlösa klienter i ditt nätverk stöder WPA2. Om det här alternativet är valt måste du använda AES-kryptering och ange WPA-lösenordsfrasen (nätverksnyckeln). Ange ett ord eller en grupp utskrivbara tecken i rutan Lösenordsfras. Lösenordsfrasen måste bestå av mellan 8 och 63 ASCII-tecken eller exakt 64 hexadecimala siffror. En hexadecimal siffra är något av följande tecken: <BR>0, 1, 2, ..., 8, 9, A, B, C, D, E eller F. </p><HR><A name=wpa-psk+wpa2-psk></A><p><B>Säkerhetskryptering (WPA-PSK + WPA2-PSK) </B></p><p>Med det här alternativet kan klienterna använda antingen WPA (med TKIP, Sändarpaket använder också TKIP) eller WPA2 (med AES). Om det här alternativet är valt måste krypteringen vara TKIP + AES. WPA-lösenordsfrasen (nätverksnyckeln) måste också anges. För högsta trådlösa prestanda måste 11N-klienter ansluta till den här routern med hjälp av WPA2-PSK (med AES). För klienter som ansluter i WPA-PSK (med TKIP) är den högsta trådlösa hastigheten vid 802.11g. Ange ett ord eller en grupp utskrivbara tecken i rutan Lösenordsfras. Lösenordsfrasen måste bestå av mellan 8 och 63 ASCII-tecken eller exakt 64 hexadecimala siffror. En hexadecimal siffra är något av följande tecken: <BR>0, 1, 2, ..., 8, 9, A, B, C, D, E eller F. </p><HR><A name=wpawpa2></a><p><B>Säkerhetskryptering (WPA/WPA2 för företag)</B></p><p>Det finns funktioner för 802.1x-autentisering, inte för hemmabruk, du måste ha en RADIUS-server i nätverket. I <B>WPA-läge</B> ingår WPA [TKIP], WPA2 [AES] och WPA [TKIP] + WPA2 [AES] (standardvärdet). <B>RADIUS-serverns IP-adress</B> är IP-adressen till RADIUS-servern (autentiseringsservern) som INTE får vara samma som IP-adressen till den router som användaren konfigurerar. Den här autentiseringsservern kan finnas på både WAN- och LAN-sidan. Värdeintervallet för <B>RADIUS-serverport</B> är mellan <B>1 och 65535</B>, och standardvärdet är 1812. Värdet för <B>RADIUS-serverns delade hemlighet</B> måste innehålla <B>64 tecken</B> (oktetter), och standardvärdet är ett tomt fält. Det går att använda 5 EAP-autentiseringsmetoder, EAP-TLS, EAP-TTLS/MSCHAPv2, PEAPv0/EAP-MSCHAPv2, PEAPv1/EAP-GTC och EAP-SIM.</p><HR><p><B>Så här sparar och avbryter du ändringar</B></p><p>Klicka på <B>Tillämpa</B> för att ändringarna ska börja gälla. <BR>Klicka på <B>Avbryt</B> om du vill återgå till de tidigare inställningarna. </p></body>";
var hlp_h_wmac="<body bgcolor=#0099cc> <P><font size=4><B>Hjälp för åtkomstlista för trådlösa kort (Wireless Card Access List Help)</B></font></P><p>Som standard får trådlösa datorer som konfigurerats med rätt SSID åtkomst till ditt trådlösa nätverk. För att öka säkerheten kan du begränsa åtkomsten till det trådlösa nätverket genom att bara tillåta specifika datorer baserat på deras MAC-adresser.<p>Skärmen Åtkomstinställningar för trådlöst nätverkskort visar en lista över trådlösa datorer som kommer att få anslutas till routern baserat på deras MAC-adresser. Trådlösa datorer måste även ha korrekt konfigurerade SSID-inställningar och inställningar för trådlös säkerhet på sidan Trådlösa inställningar för att få åtkomst till det trådlösa nätverket.</p><p></p><hr><a name=control></a><p><b> Aktivera åtkomstkontroll</b></p><p><ul> 1. Markera kryssrutan <b>Aktivera åtkomstkontroll</b> om du vill aktivera begränsningen av trådlösa datorer efter deras MAC-adresser.<br> 2. Klicka på <b>Tillämpa</b> om du vill spara ändringarna och återgå till skärmen Trådlösa inställningar.</ul></ul></p> <p> <b>Obs!</b> Om alternativet <b>Aktivera åtkomstkontroll</b> är aktiverat och åtkomstkontrollistan är tom, kommer inga trådlösa datorer att kunna ansluta till det trådlösa nätverket.</p><hr><p><b> Så här konfigurerar du åtkomstkontrollistan  </b><ul> 1. Klicka på <b>Lägg till</b> för att gå till skärmen åtkomstsinställningar. För att underlätta för dig visas en lista över aktiva trådlösa kort och deras Ethernet MAC-adresser på den här skärmen.</ul> <ul>2. Om önskad dator visas i listan kan du klicka på alternativknappen för den datorn och hämta dess MAC-adress. I annat fall kan du ange MAC-adressen till den godkända datorn manuellt. MAC-adressen brukar stå på den trådlösa enhetens undersida.</ul> <ul> 3. Om du inte hittar något enhetsnamn kan du ange ett beskrivande namn för datorn som du lägger till.</ul> <ul> 4. När du har angett MAC-adressen går du tillbaka till skärmen Trådlös åtkomstlista genom att klicka på knappen <b>Lägg till</b>. <br><b>Obs!</b> Upprepa steg 1 till 4 för varje trådlös dator. </ul> <ul> 5. Markera kryssrutan <b>Aktivera åtkomstkontroll</b> om du vill aktivera åtkomstkontrollen.</ul> <ul> 6. Klicka på <b>Tillämpa</b> om du vill spara ändringarna och återgå till skärmen Trådlösa inställningar.</ul><a name=editpc></a>  <p> <b> Så här redigerar du en trådlös dator i åtkomstkontrollistan:</b> <ul> 1. Välj alternativknappen för den trådlösa dator som du vill redigera.<br> 2. Klicka på knappen <b>Redigera (Edit)</b>.<br> 3. Redigera enhetsnamnet eller MAC-adressen.<br> 4. Klicka på <b>Godkänn (Accept)</b> när du är klar.<br> 5. Klicka på <b>Tillämpa</b> om du vill spara ändringarna och återgå till skärmen Trådlösa inställningar.</ul> </ul><p> <b> Så här tar du bort en dator från åtkomstkontrollistan:</b>  <ul> 1. Klicka på alternativknappen för den trådlösa dator som du vill ta bort.<br> 2. Klicka på knappen <b>Ta bort (Delete)</b>.<br> 3. Klicka på <b>Tillämpa</b> om du vill spara ändringarna och återgå till skärmen Trådlösa inställningar.</ul>  </ul></p><hr><p><b>Så här sparar och avbryter du ändringar:</b></p><p> Klicka på <b>Tillämpa</b> (Apply) när du har ändrat klart inställningarna. <br> Klicka på <b>Avbryt</b> om du vill återgå till de tidigare inställningarna.</p></body>";
var hlp_hatdev="<body bgcolor=#0099cc ><P><font size=4><B>Hjälp för anslutna enheter</B></font></P><p>(Attached Devices Help) Den här skärmen visar IP-adress, enhetsnamn och MAC-adress (Media Access Control) för alla datorer som är anslutna till routern.<p>Inget av dessa värden kan ändras på den här skärmen. Om du vill uppdatera den här skärmen och visa listan med alla befintliga anslutna enheter klickar du på knappen <i>uppdatera</i> (Refresh). </body>";
var MBSH01="<body bgcolor=#0099cc ><p><font size=4><b>Hjälp för Säkerhetskopieringsinställn.</b></font></p><p>(Backup Settings Help) På den här skärmen kan du säkerhetskopiera, återställa och radera routerns aktuella inställningar. </p><p>När routern fungerar korrekt bör du säkerhetskopiera all information så att du har den tillgänglig om något går fel. När du säkerhetskopierar inställningarna sparas de som en fil på din dator. Du kan återställa routerns inställningar från den filen. </p><a name=save></a><p>Så här skapar du en säkerhetskopia av de aktuella inställningarna:<ol><li>Klicka på <b>säkerhetskopiera</b> (Back Up).</li><li>Om din webbläsare inte är inställd till att spara hämtade filer automatiskt, letar du rätt på platsen där filen sparas, byter namn på den om du vill, och klickar på <b>spara</b> (Save). <br>Om webbläsaren är inställd till att spara hämtade filer automatiskt, sparas filen på en viss plats på hårddisken och kallas ";
var MBSH02=". </li></ol><hr><p><b>VIKTIGT!</b>När du börjat återställa inställningar eller radera routern, får du <I>inte</I> gå ut på nätet, stänga av routern, stänga av datorn eller göra något annat med routern förrän routern har startat om igen! Detta tar bara omkring en minut. När testlampan slutat blinka väntar du några sekunder till innan du använder routern. </p><hr><a name=restore></a><p>Så här återställer du inställningar från en säkerhetskopia:<ol><li>Klicka på <b>bläddra</b> (Browse).</li><li>Leta rätt på och markera den tidigare sparade säkerhetskopian (standardnamnet är ";
var MBSH03=").</li><li>Klicka på <b>återställ</b> (Restore). <br>En skärm visas som meddelar att routern har återställts till de tidigare inställningarna. Routern startar om. Detta tar omkring en minut.<br><b>VIKTIGT!</b>Försök inte gå ut på nätet, stänga av routern, stänga av datorn eller göra något annat med routern förrän routern har startat om igen! När testlampan slutat blinka väntar du några sekunder till innan du använder routern. </li><li>Stäng meddelandefönstret.</li></ol><a name=revert></a><p>Så här raderar du aktuella inställningar och återställer routern till de ursprungliga fabriksinställningarna:<ul><li>Klicka på <b>Radera</b>(Erase).<br><b>VIKTIGT!</b>Försök inte gå ut på nätet, stänga av routern, stänga av datorn eller göra något annat med routern förrän routern har startat om igen! När testlampan slutat blinka väntar du några sekunder till innan du använder routern. </ul><p>När du har raderat routerns aktuella inställningar, blir routerns lösenord <b>password</b>, LAN IP-adressen <b>192.168.1.1</b> och routern kommer att fungera som en DHCP-server i LAN-nätverket och som en DHCP-klient till Internet. </p></a></body>";
var hlp_hbackup=MBSH01+MBSH02+MBSH03;
var hlp_hddns="<body bgcolor=#0099cc ><P><font size=4><B>Hjälp för dynamisk DNS</B></font></P><p> (Dynamic DNS Help) Detta är en dynamisk DNS-tjänst (DDNS) som tillhandahåller en central, allmän databas där information (som e-postadresser, värdnamn och IP-adresser) kan lagras och hämtas. Den dynamiska DNS-servern lagrar även lösenordsskyddad information och tar emot e-postadressbaserade förfrågningar. </p><p> Om du vill använda en DDNS-tjänst måste du registrera dig först. Internet-leverantör som tillhandahåller den dynamiska DNS-klienten kommer att förse dig med ett lösenord eller en nyckel.</p><a name=setup></a><p>Installera DDNS:<ol><li> Om du har registrerat dig hos en DDNS-leverantör markerar du kryssrutan <b>använd en dynamisk DNS-tjänst</b> (Use A Dynamic DNS Service).  </li><li><a name=provider></a>Välj namnet på leverantören av din dynamiska DNS-tjänst .&nbsp; </li><li>Skriv in värdnamnet som du fått av DNS-leverantören. <br>DDNS-leverantören kanske kallar det för domännamnet. </li><li>Skriv in användarnamnet till ditt DDNS-konto. </li><li>Skriv in lösenordet (eller nyckeln) till ditt DDNS-konto. </li> <li>Klicka på <b>tillämpa</b> (Apply) för att aktivera DDNS-tjänsten.  </li></ol><a name=wildcards></a><p><b>Obs!</b> Routern stöder bara grundläggande DDNS. Inloggningsuppgifter och lösenord kan inte göras säkra. Om du har en privat WAN IP-adress bör du inte använda DDNS-tjänsten eftersom detta kan leda till problem. </p></body>";
var hlp_hemail="<body bgcolor=#0099cc ><P><font size=4><B>Hjälp för e-post</B></font></P><p> (E-mail Help) Varningar kan skickas när någon i ditt LAN (Local Area Network) försöker besöka en blockerad webbsida Loggar är listor på alla besökta URL-adresser. Om du vill ta emot varningar och loggar via e–post fyller du i inställningarna på den här skärmen.</p><p>Du kan alltid kontrollera loggarna manuellt genom att visa skärmen Loggar (Logs). Om du inte vill ha e-postmeddelanden lämnar du fälten tomma.</p><a name=receive></a><p><b>Så här får du varningar och loggar med e–post:</b><ol><li>Markera kryssrutan <b>aktivera e-postavisering</b> (Turn E-mail Notification On).</li><li>I fältet <b>server för utgående e-post</b> (Outgoing Mail Server) skriver du namnet på din Internet-leverantörs utgående SMTP-server (till exempel smtp.myISP.com). <br>Om du lämnar det här fältet tomt kommer inga varningar eller loggar att skickas till dig.<br><b>Tips!</b> Du använde de här uppgifterna när du konfigurerade ditt e-postprogram. Om du inte kommer ihåg dem kan du kontrollera inställningarna i ditt e-postprogram.</li><li>I fältet <b>e-postadress</b> (E-mail Address) skriver du in en e-postadress om du vill att varningar och loggar ska skickas till dig eller till någon annan. <br>Använd en fullständig e-postadress (till exempel Jackie@myISP.com). </li><li><a name=alert></a>Om du vill att en e-postvarning skickas när någon i ditt nätverk försöker ansluta till en blockerad URL markerar du kryssrutan<b>skicka varning omedelbart</b> (Send Alert Immediately).<br></li><li><a name=schedule></a>Om du inte vill ha loggar markerar du kryssrutan <b>inga</b> (None) i den första listan i avsnittet Skicka loggar enligt det här schemat (Send Logs According to This Schedule).<br> <br>Om du vill att loggar ska skickas till dig väljer du ett av de andra alternativen.<ul><li>Om du valt <b>varje vecka</b>(Weekly) markerar du vilken dag i veckan.</li><li>Om du valt <b>varje vecka</b> (Weekly) eller <b>varje dag</b> (Daily) väljer du vilken tid på dagen som e-postmeddelandet ska skickas.</li></ul><a name=Apply></a><li>Klicka på <b>tillämpa</b> (Apply) för att ändringarna ska bli giltiga.</li></ol><a name=timezone></a><p><b>Tidszon.</b><p>Välj lokal tidszon. Det här krävs om ditt schema ska fungera på rätt sätt.</p><p>Markera Justera automatiskt för sommartid om det behövs i din region.</p></body>";
var hlp_hether="<body bgcolor=#0099cc><P><font size=4><B>Hjälp</B></font></P><p>(Help) På skärmen grundläggande inställningar (Basic Settings) kan du konfigurera, uppgradera och kontrollera status för din trådlösa NETGEAR Cable/DSL-router. <p>Klicka på en post i kolumnen längst till vänster. De aktuella inställningarna eller informationen för det området visas i mittenkolumnen. <p>Användbar information som relaterar till de valda inställningsfönstren visas i den här kolumnen. Om du använder Internet Explorer kan du klicka på en post i mittenkolumnen för att gå direkt till det relaterade hjälpavsnittet. I annat fall bläddrar du ned tills du hittar det. <hr><P><font size=4><B>Hjälp för grundläggande inställningar</B></font></P><p><b>Obs!</b> Om du konfigurerar routern för första gången kanske standardinställningarna fungerar för dig utan ändringar. <a name=question></a><p><b>Kräver internetanslutningen inloggning?</b> <p>Välj det här alternativet utifrån vilken typ av konto du har hos din internetleverantör. Om du måste ange inloggningsuppgifter varje gång du ansluter till internet eller om du har ett PPPoE/PPTP/L2TP-konto hos din internetleverantör klickar du på <b>Ja</b>. Annars klickar du på <b>Nej</b>. <p><b>Obs!  </b>Om du har installerat PPP-programvara, till exempel WinPoET (från Earthlink) eller Enternet (från PacBell), har du PPPoE. Klicka på <b>Ja</b>. När du har klickat på Ja och konfigurerat routern behöver du inte köra PPP-programmet på datorn för att ansluta till internet. </p><a name=acname></a><p><b>Kontonamn  </b><p>(även kallat värdnamn eller systemnamn) <p>De flesta användare kan skriva in sitt konto- eller användarnamn i det här fältet. Om ditt huvud-e-postkonto är JerAB@ISP.com skriver du alltså JerAB i det här fältet. <p>Om du har fått ett specifikt värdnamn från din internetleverantör anger du det (till exempel CCA7324-A). <a name=doname></a><p><b>Domännamn  </b><p>Normalt sett kan det här fältet lämnas tomt om inte internetleverantören kräver att det fylls i. Du kan ange internetleverantörens domännamn. Om internetleverantörens e-postserver är mail.xxx.yyy.zzz skriver du alltså xxx.yyy.zzz som domännamn.<p>Om du har fått ett domännamn av internetleverantören skriver du in det i det här fältet. (Earthlink Cable kan till exempel kräva ett värdnamn för hem och Comcast tillhandahåller ibland ett domännamn.) <p>Om du har ett kabelmodem brukar det här vara arbetsgruppsnamnet. <p><a name=InternetIP></a><b>Internet-IP-adress  </b><p>Om du loggar in på din tjänst eller om du inte fått någon fast IP-adress av internetleverantören, kommer routern att söka upp en IP-adress automatiskt när du ansluter. Välj <b>Hämta dynamiskt från ISP</b> (Get Dynamically from ISP). <p>Om du har en fast (eller statisk) IP-adress, har du fått en IP-adress av din internetleverantör. Välj <b>använd statisk IP-adress</b> (Use Static IP Address) och skriv in IP-adress, subnätmask och gateway-IP-adress i rätt fält. <p>Exempel: <ul><li> IP-adress: 24.218.156.183 <li> Subnätmask: 255.255.255.0 <li> Gateway-IP-adress: 24.218.156.1 </ul><p><a name=DNSaddress></a><b>DNS-adress (Domain Name Server)  </b><p>DNS-servern används till att söka upp webbsideadresser baserat på deras namn. <p>Om din internetleverantör har gett dig en eller två DNS-adresser väljer du <b>Använd de här DNS-servrarna</b> och skriver in den primära och sekundära adressen. <p>Annars väljer du <b>Hämta automatiskt från ISP</b>. <p><b>Obs! </b>Om du får felmeddelanden om att adressen inte kan hittas när du går till en webbplats, är det troligt att dina DNS-servrar inte är rätt konfigurerade. Kontakta din internetleverantör och be om rätt DNS-serveradresser. <p><a name=localaddress></a><b>Routerns MAC-adress  </b><p>Datorns lokala adress är dess unika adress i ditt nätverk. Den kallas också för datorns MAC-adress (Media Access Control).<p>Vanligtvis ska du välja <b>använd standardadress</b> (Use Default Address). <p>Om din internetleverantör kräver MAC-autentisering väljer du antingen <b>Använd datorns MAC-adress</b> (Use Computer MAC Address) för att dölja routerns MAC-adress med hjälp av datorns egen MAC-adress, eller <b>använd den här MAC-adressen</b> (Use This MAC Address) och skriver in MAC-adressen för en annan dator manuellt. MAC-adressens format är XX:XX:XX:XX:XX:XX. Det här värdet kan ändras om alternativet <b>använd datorns MAC-adress</b> (Use Computer MAC Address) har valts när ett värde redan har angetts i <b>använd den här MAC-adressen</b> (Use This MAC Address). <p><b>Knapparna Tillämpa, Avbryt och Test</b><p>Klicka på <b>Tillämpa (Apply)</b> när du har ändrat klart inställningarna. <p>Klicka på <b>Avbryt (Cancel)</b> om du vill återgå till de tidigare inställningarna. <p>Klicka på <b>Test</b> för att ansluta till NETGEARs webbplats. Om anslutningen fungerar är inställningarna korrekta och du kan klicka på <b>Logga ut</b> (Logout) för att avsluta dessa skärmar och börja surfa på nätet. <p>Om anslutningen inte fungerar: <ul><li> Gå igenom inställningarna och kontrollera att du har valt rätt alternativ och skrivit in allt korrekt. <li>Kontakta din internetleverantör för att bekräfta att du har rätt konfigureringsuppgifter. <li>Läs avsnittet Felsökning (Troubleshooting) i enhetens<I> installationshandbok</I> (Installation Guide).<li> Kontakta NETGEARs tekniska support.</ul></body>";
var hlp_hkeyword="<body bgcolor=#0099cc > <P><font size=4><B>Hjälp för webbsideblockering</B></font></P> <p>(Block Sites Help) Om du vill begränsa åtkomsten till vissa webbsidor på Internet måste du installera funktionen innehållsfiltrering. Du kan filtrera innehåll på två sätt: <ul><li>Blockera åtkomst till vissa domäner (till exempel www.badstuff.com/XXX) <li>Blockera webbsidor som innehåller vissa ord (som svordomar eller sexuellt innehåll). </UL><p>När användare försöker ansluta till en blockerad webbplats visas meddelandet: 'Blockerat av NETGEAR (Blocked by NETGEAR'.</p><hr><a name=blocking></a><p><b>Så här aktiverar du webbsideblockering:</b></p><ul>Välj <b>Enligt schema</b> (Per Schedule) för att slå på webbsideblockeringen och blockera webbsidor enligt de inställningar som gjorts på skärmen schema (Schedule).</ul><ul>Välj <b>alltid</b> (Always) om du vill aktivera webbsideblockeringen så att den tillåter konstant blockering, oavsett vilka inställningar som angetts på skärmen schema (Schedule).</ul><p><b>Obs!</b> På skärmen schema (Schedule) kan du ange när blockering av nyckelord och domännamn ska ske.</p><p><b>Så här avaktiverar du webbsideblockering:</b></p><p><ul>Välj <b>aldrig</b> (Never) om du vill stänga av webbsideblockeringen. </ul><hr><a name=toaddword></a><p><b>Så här blockerar du nyckelord och Internet-domäner:</b></p><ol><li>Välj blockeringsläge för nyckelord: aldrig (Never), enligt schema (Per Schedule) eller alltid (Always).</li><li>I fältet <a name=toaddword></a> <b>ange nyckelord eller domännamn här</b> (Type Keyword Or Domain Name Here) skriver du det ord eller domännamn som du vill blockera.</li><li>Klicka på <b>lägg till nyckelord (Add Keyword).</b> <li>Ordet eller domännamnet syns då i listan. </li><li>Fortsätt att lägga till namn och nyckelord tills du är färdig.</li><li>Klicka på <b>tillämpa (Apply)</b> när du är klar.</li></ol><a name=blocklist></a><p><b>Blockeringslista</b>. Listan under rubriken Blockera webbsidor som innehåller dessa nyckelord eller domännamn (Block Sites Containing these Keywords or Domain Names) innehåller den aktuella listan över poster som blockeras.</p><a name=todelete></a><p><b>Så här tar du bort ett nyckelord eller domännamn:</b></p><ol><li>Välj ordet eller domännamnet i listan.</li><li>Klicka på <b>ta bort nyckelord (Delete Keyword)</b>.</li><li>Fortsätt välja och ta bort namn och nyckelord tills du är klar.</li><li>Klicka på tillämpa <b>(Apply)</b>.</li></ol><p><b> Så här tar du bort alla nyckelord och domännamn:</b></p><ol><li>Klicka på <b>töm lista (Clear List)</b>.</li><li>Klicka på <b>tillämpa (Apply)</b>.</li></ol></p><hr><a name=trusted></a><p><b>Så här ger du en dator obegränsad åtkomst till Internet:</b></p><ol><li>Markera kryssrutan <b>tillåt att pålitliga IP-adresser besöker blockerade webbsidor</b> (Allow Trusted IP Address to Visit Blocked Sites).</li><li>Skriv in IP-adressen till den aktuella datorn i fältet pålitlig IP-adress (Trusted IP Address). <br>Det ska räcka att skriva in ett nummer i det sista fältet.</li><li>Klicka på <b>tillämpa (Apply).</b>.</li></ol><a name=To></a><p><b>Så här tillåter du obegränsad åtkomst till Internet:</b></p><ol><li>Välj <B>aldrig (Never)</b> i <b>listan blockering av nyckelord</b> (Keyword Blocking).</li><li>Klicka på <b>tillämpa (Apply)</b>.</li></ol></body>";
var hlp_hlanip="<body bgcolor=#0099cc><p><font size=4><b>Hjälp för LAN-konfiguration</b></font></p>  <p>Standardvärdena för DHCP och TCP/IP fungerar för de flesta användare.</p><hr><a name=device_name></a><p><b>Enhetsnamn</b></p><p>Det här är ditt eget namn på routern. Du kan se routernamnet i Network Explorer på datorer med Windows Vista och Network Explorer på alla Windows-datorer.</p><hr><a name=tcp></a><p><b>TCP/IP-konfiguration för LAN</b></p><p>Det här är avancerade inställningar som kan konfigureras om du är nätverksadministratör och ditt nätverk innehåller flera routrar. Om du gör några ändringar i dessa inställningar måste du starta om samtliga datorer innan inställningarna kan börja gälla.</p><ul><li><B>IP-adress</B>. Skriv in routerns IP-adress mellan prickarna (fabriksstandarden är 192.168.1.1).<li><b>IP-subnätmask</B>. Subnätmasken anger nätverksnummerdelen av en IP-adress. Routern kommer automatiskt att beräkna subnätmasken utifrån den IP-adress som du tilldelar. Såvida du inte implementerar subnetting, använder du 255.255.255.0 som subnätmask (beräknad av routern).</ul><ul><li><b>RIP-omdirigering:</B> Med RIP (Routing Information Protocol, RFC1058 och RFC1389) kan en router utbyta routinginformation med andra routrar. RIP-omdirigeringen styr hur routern skickar och tar emot RIP-paket. Standardvärdet är Ingen.<ul><li>När <b>Båda</b> eller <b>Endast ut</b> är valda kommer routern att sända ut sin routingtabell regelbundet. <li>När den är inställd på <b>Båda</b> eller <b>Endast in</b> införlivar den all RIP-information som tas emot. <li><b>RIP-version:</B> Med den här inställningen kontrollerar du format och sändningsmetod för de RIP-paket som routern skickar. (Båda formaten känns igen vid mottagning.) Standardvärdet för den här inställningen är Avaktiverad.<ul><li>RIP-1 används över hela världen. RIP-1 fungerar förmodligen bra för de flesta nätverk, såvida du inte har en ovanlig konfiguration. <li>RIP-2 innehåller mer information. För både RIP-2B och RIP-2M skickas routingdata i RIP-2-format. <UL> <li>För RIP-2B används subnätutsändning.  <li>För RIP-2M används multicasting. (Se anmärkning nedan.) </ul> </ul></ul><p><b>Obs!  </b>Multicasting kan minska belastningen på system utan routrar eftersom de inte lyssnar till RIP-multicast-adressen och därför inte tar emot RIP-paketet. Men om en router använder multicasting måste alla routrar i nätverket använda multicasting. </p><hr><a name=dhcp></a><p><b>Använda routern som DHCP-server (Use Router As DHCP Server)</b></p><p>Routern konfigureras som en DHCP-server (Dynamic Host Configuration Protocol) som standard, vilket innebär att den tillhandahåller TCP/IP-konfiguration för alla datorer som är anslutna till routern.  <p> Såvida du inte fått anvisningar från Internet-leverantören om att ändra dessa inställningar, låter du kryssrutan <b>Använda routern som DHCP-server (Use Router As DHCP Server)</b> vara markerad.  <p> Om internetleverantören meddelar dig att du ska avmarkera den här kryssrutan, måste du ha en annan DHCP-server i nätverket. Annars måste du konfigurera datorn manuellt.   <ul><li><B>Start-IP-adress</B> (Starting IP Address). I det här fältet anges den första av de närliggande adresserna i IP-adresspoolen. 192.168.1.2 är standard-startadressen. <li><b>Slut-IP-adress</b> (Ending IP Address). Det här fältet anger den sista av de närliggande adresserna i IP-adresspoolen. 192.168.1.254 är standard-slutadressen.</ul><hr><a name=reserved></a><p><b>Adressreservation</b></p><p>När du anger en reserverad IP-adress för en dator i LAN-nätverket, kommer den datorn alltid att ta emot samma IP-adress varje gång den får åtkomst till DHCP-servern. Reserverade IP-adresser måste tilldelas till servrar som kräver permanenta IP-inställningar.<p><b>Så här reserverar du en IP-adress:</b> <ol><li> Klicka på knappen <b>Add</b> (lägg till). <li> Välj alternativknappen för den dator som du vill lägga till från adressreservationstabellen.<li> Om datorn inte finns med i adressreservationstabellen, anger du IP-adress, MAC-adress och enhetsnamn för den dator du vill lägga till.<li> Klicka på knappen <B>Lägg till (Add)</b> när du är klar.</ol><br><p><b>Så här redigerar du en reserverad IP-adress:</b> </p><ol><li> Markera alternativknappen bredvid den reserverade adress som du vill redigera.<li> Klicka på knappen <b>Redigera (Edit)</b>.<li> Redigera IP-adressen, MAC adressen eller enhetens namn.<li> Klicka på <B>Godkänn (Accept)</b> när du är klar.</ol><p><b>Så här tar du bort en reserverad IP-adress</b> </p><ol><li> Markera alternativknappen bredvid den reserverade adress som du vill ta bort.<li> Klicka på knappen <b>Ta bort (Delete)</b>. </ol><hr><a name=To></a><p><b>Så här sparar och avbryter du ändringar:</b></p><p>Klicka på <b>Tillämpa (Apply)</b> om du vill spara de nya inställningarna för routern. <br>Klicka på <b>Avbryt (Cancel)</b> om du vill ignorera ändringar som du inte har sparat. </p></body>";
var hlp_hpasswd="<body bgcolor=#0099cc><P><font size=4><B>Hjälp för att ange lösenord</B></font></P><p> Du använder sidan Ange lösenord om du vill ändra lösenordet du använder till att gå in på Inställningssidorna, <I>inte</I> lösenordet till ISP-kontot. <p> Så här ändrar du lösenordet: <ol> <li>Skriv in det gamla lösenordet.   <BR>Det standardinställda lösenordet för routern är <b>password</b>.  <li>Skriv ett nytt lösenord och bekräfta det genom att ange det igen i fältet <b>Upprepa nytt lösenord</b>.   <br>  <b>Obs!</B> Se till att du noterar lösenordet på ett säkert ställe.  <li>Klicka på <b>Tillämpa</b> om du vill ändra lösenordet eller på <b>Avbryt</b> om du vill behålla det befintliga lösenordet. </ol><p> <b>Obs!</b> Om du har säkerhetskopierat routerinställningarna tidigare bör du göra en ny säkerhetskopia så att inställningsfilen inkluderar det nya lösenordet. </p><p><b>Aktivera lösenordsåterställning</b><br>NETGEAR rekommenderar att du aktiverar lösenordsåterställning om du ändrar lösenordet för routerns användarnamn admin. Det ger dig ett enkelt sätt att återställa lösenordet på om du glömmer det. <p><b>Så här aktiverar du lösenordsåterställning:</b><ol><li>Markera kryssrutan <b>Aktivera lösenordsåterställning</b>.<li>Välj två säkerhetsfrågor och besvara dem.<li>Klicka på <b>Tillämpa</b> så sparas inställningarna.</ol></p>När du går in på routern via webbläsaren visas inloggningsfönstret. Om lösenordsåterställning är aktiverat sätter lösenordsåterställningen igång när du klickar på <b>Avbryt</b>. Därefter kan du återställa lösenordet genom att ange de sparade svaren på säkerhetsfrågorna. Det här tillvägagångssättet för lösenordsåterställning fungerar i webbläsarna Internet Explorer, Firefox och Chrome, men inte i Safari.</p></body>";
var hlp_hschedul="<body bgcolor=#0099cc ><P><font size=4><B>Hjälp för schema</B></font></P><p>(Schedule Help) Om du har aktiverat innehållsfiltrering på skärmen Blockera webbsidor (Block Sites) eller tjänstblockering på skärmen Blockera tjänster (Block Services), kan du konfigurera ett schema för när blockeringen ska inträffa eller när åtkomsten inte är begränsad. </p><a name=blocksch></a><p>Så här blockerar du nyckelord, tjänster och Internet-domäner utifrån ett schema:<ol><li>Välj ett av följande:<b>Varje dag</b> (Every Day).<br> En eller flera dagar (One or more days).</li><li>Om du vill begränsa åtkomsten helt för de valda dagarna väljer du <b>Hela dagen</b>(All Day).<br>Om du vill begränsa åtkomsten under vissa tider under de valda dagarna, anger du en tid i fälten <b>Starta blockering</b> (Start Blocking) och <b>Avsluta blockering</b> (End Blocking).<br><b>Obs!</b> Ange tider enligt 24-timmarsklockan. 10:30 a.m. anges alltså som 10 timmar och 30 minuter medan 10:30 p.m. anges som 22 timmar och 30 minuter.</li><li>Klicka på <a name=Apply></a><b>tillämpa</b> (Apply).</li></ol></body>";
var hlp_hsroutes="<body bgcolor=#0099cc ><P><font size=4><B>Hjälp för statiska rutter</B></font></P><p> (Static Routes Help) Statiska rutter ger routern information som den inte kan få automatiskt på andra sätt. Detta kan hända när RIP-funktionen är avaktiverad i LAN-nätverket. (Se skärmen LAN IP Setup.) Alla definierade statiska rutter visas i tabellen. Du lägger till eller tar bort en rutt i området under tabellen Statiska rutter (Static Routes).</p><hr><a name=str_table></a><p><b>Så här anger du en statisk rutt:</b> </p><ol><li>Klicka på <b>lägg till</b> (Add). </li><li>Skriv in ett namn på den statiska rutten i fältet <b>ruttnamn (Route Name)</b> under tabellen.<br>(Detta görs enbart i identifieringssyfte.) </li><li>Välj <b>privat (Private)</b> om du vill begränsa åtkomsten enbart till LAN. </li><li>Välj <b>Aktiv </b> (Aktiv) om du vill att rutten ska börja gälla. </li><li>Skriv in mål-IP-adressen i textrutan. </li><li>Skriv in målets IP-subnätmask. <br>Om det gäller en enskild värd skriver du <b>255.255.255.255</b>. </li><li>  Skriv in gatewayens IP-adress, som måste vara en router på samma segment. </li><li>Skriv ett tal mellan 2 och 15 i fältet <b>metriskt värde</b> (Metric).   <br>Detta representerar antalet övriga routrar i ditt nätverk. Vanligtvis fungerar värdet 2 eller 3 bäst, men om det är en direktanslutning anger du det till 2. </li><li>    Klicka på <b>tillämpa</b> (Apply) för att ange den statiska rutten i tabellen. </li></ol><p><b>Så här redigerar du en statisk rutt:</b> <ol><li>Klicka på alternativknappen bredvid rutten du vill redigera. </li><li>Uppdatera informationen.<li>Klicka på <b>tillämpa (Apply)</b> när du är klar.</ol><p><b>Så här tar du bort en statisk rutt:</b> <ol><li>Klicka på alternativknappen bredvid rutten du vill ta bort. </li><li>Klicka på <b>ta bort (Delete)</b>.</li><li>Klicka på <b>tillämpa (Apply)</b> om du vill ta bort den statiska rutten från tabellen. </li></ol></body>";
var hlp_hsstatus="<body bgcolor=#0099cc ><P><font size=4><B>Hjälp för routerstatus</B></font></P>    <p> (Router Status Help) På skärmen routerstatus (Router Status) kan du kontrollera routerns inställningar och statistik.  Den här skärmen visar alla aktuella inställningar. Om något behöver ändras måste du göra det på den relevanta skärmen.<p><b>Maskinvaruversion</b>: Routerns modell.<a name=firv></a> <p><b> Version av fast programvara (Firmware Version)</b>: Detta är den aktuella programvara som routern använder. Den ändras om du uppgraderar din router.<p><b>Version av användargränssnittsspråk</b>: Den lokaliserade versionen av användargränssnittet.<a name=internet_port></a><p><b>Internet- port</b>: Detta är de aktuella inställningarna som du angett i installationsguiden Setup Wizard eller på skärmen grundläggande inställningar (Basic Settings).<ul><a name=wanmac></a><li>MAC-adress. Routerns fysiska adress, som den visas från Internet.<a name=wanip></a><li>IP-adress. Den aktuella Internet-IP-adressen Om den tilldelats dynamiskt och ingen Internet-anslutning finns, kommer fältet att vara tomt eller visa 0.0.0.0.<a name=wansubnet></a><li>IP-subnätmask (IP Subnet Mask). Subnätmasken som är associerad med Internet-IP-adressen.<a name=wangtw></a><li>Standard-gateway (Default Gateway). Aktuell Internet-gateway. Om den tilldelats dynamiskt och ingen Internet-anslutning finns, kommer fältet att vara tomt eller visa 0.0.0.0.<a name=wandns></a><li>DNS-server (Domain Name Server). Visar aktuell DNS-adress.<a name=wandhcp></a><li>DHCP. Indikerar antingen <b>Klient</b> (Client) (IP-adressen erhålls dynamiskt) eller <b>ingen</b>(None).</ul><a name=lan_port></a> <p><b>LAN- port</b>. Detta är de aktuella inställningar som de visas på skärmen IP-konfiguration för LAN ( LAN IP Setup). <ul><a name=lanmac></a> <li>MAC-adress. Routerns fysiska adress som den visas i LAN-nätverket.<a name=lanip></a><li>IP-adress. Routerns LAN-IP-adress.<a name=lansubnet></a><li> IP-subnätmask (IP Subnet Mask). Subnätmasken som är associerad med LAN-IP-adressen.<a name=landhcp></a><li>DHCP. Indikerar om routern fungerar som DHCP-server för enheter i LAN-nätverket.</ul><a name=wireless_port></a><p><b>Trådlös  port (Wireless Port)</b>: Detta är de aktuella inställningarna som visas på skärmen Trådlösa anslutningar (Wireless Settings).<ul><a name=wlssid></a><li>Namn (SSID) (Name, SSID). Routerns SSID.<a name=wlregion></a><li>Region. Platsen (land).<a name=wlchannel></a><li>Kanal (Channel). Den kanal som används.";
var hlp_hupgrd="<body bgcolor=#0099cc> <p><font size=4><b>Hjälp för routeruppgradering</b></font></p> <p>Du installerar nya versioner av routerns programvara via skärmen Routeruppgradering (Router Upgrade).<a name=check></a> <p>Klicka på knappen <b>Sök efter</b> (Check) så hamnar du på NETGEARs webbplats där du kan hämta <b>nya versioner</b> av routerns programvara. När du har hämtat filen måste du extrahera den innan du kan uppgradera routern.    <p>Markera kryssrutan om du vill söka efter en ny version när du loggar in. <p><b>VIKTIGT</b> När du klickar du på <b>Överför </b>(Upload) får du <i>inte</i> avbryta processen när programvaran skickas till routern och routern startas om. Om du tror att processen skulle kunna avbrytas på något sätt, klickar du på <b>avbryt</b> (Cancel) för att behålla routerns befintliga programvara.</p><a name=locate></a><p><b>Sök rätt på och markera uppgraderingsfilen på hårddisken.</b><ol><li>Gå till www.NETGEAR.com och hämta den uppdaterade programvaran.<li>Extrahera filen manuellt om detta inte sker automatiskt.<br>Du kanske vill läsa filen <i>Versionsinformation</i> (Release Notes) innan du fortsätter.<li>Klicka på <b>Bläddra</b> (Browse).<li>Sök rätt på och markera den fil du just hämtat och extraherat.<li>Klicka på <b>Överför</b> (Upload) för att skicka programvaran till routern.<br>Den nya programvaran laddas i routern och routern startar om.<br><b>Obs!</b> Försök inte gå ut på internet, stänga av routern, stänga av datorn eller göra något annat med routern förrän omstarten är klar! När lampan klar (Ready) slutar blinka bör du vänta ytterligare några sekunder innan du gör något.<li>Klicka på <b>Routerstatus (Router Status)</b> och kontrollera versionen av den fasta programvaran för att bekräfta att routern nu har den nya programvaran installerad. </ol><p><B>VIKTIGT</b> I vissa fall, till exempel vid större uppgraderingar, måste du konfigurera om routern efteråt. Läs <i>Versionsinformationen</i> (Release Notes) som medföljer programvaran för att ta reda på om du måste konfigurera om routern. <p>Om uppgraderingen inte fungerade med den här metoden kan du läsa i <i>Referenshandboken</i> (Reference Manual) på produktens supportwebbplats om andra sätt att uppgradera routern på.</p> </body>";
var hlp_hwiz_cfm="<body bgcolor=#0099cc > <P><font size=4><B>   Hjälp för Smart Wizard-guiden  </B></font></P>  <p> (Setup Wizard Help) Installationsguiden har upptäckt att det redan finns en aktiv Internet-anslutning. Eftersom din Internet-anslutning verkar fungera är det kanske inte nödvändigt att du fortsätter med installationsguiden. Om du bestämmer dig för att fortsätta med installationsguiden kan vissa ändringar av din befintliga konfiguration inträffa. NETGEAR rekommenderar att du säkerhetskopierar dina befintliga inställningar innan du fortsätter med installationsguiden. <p>Gör så här:<ol> <li>Klicka på <b>ja</b> (Yes) om du vill fortsätta med installationsguiden.<br><li>Klicka på <b>nej</b> (No) om du vill avsluta installationsguiden och behålla din befintliga Internet-anslutning.</ol> <p>Så här säkerhetskopierar du inställningarna:<ol> <li>Klicka på <b>nej</b> (No) för att avsluta installationsguiden och behålla din befintliga Internet-anslutning.<li>Klicka på <b>Säkerhetskopieringsinställn. (Back Up Settings)</b> på navigeringsfältet för att öppna skärmen Säkerhetskopiering (Backup ).<br><li>När inställningarna har sparats kör du installationsguiden igen.</ol> </body>";
var hlp_hwizard="<body bgcolor=#0099cc ><P><font size=4><B>Hjälp för Smart Wizard-installation </B></font></P>             <p>(Smart Setup Wizard Help) När routern har anslutits till ditt nätverk måste den konfigureras. Du kan göra det med hjälp av installationsguiden Smart Setup Wizard. Guiden försöker automatiskt söka upp typen av Internettjänst som du har via din Internet-leverantör. Alternativt kan du konfigurera routern manuellt. Om du inte har erfarenhet av att konfigurera Internet-anslutningar rekommenderar vi att du låter installationsguiden göra en del av arbetet.<p>När du konfigurerar routern kommer du att använda informationen som du fyllde i tidigare i <I>Installationshandboken (Installation Guide)</i>.<p>Så här kommer du igång:<ol> <li>Välj <b>ja</b> (Yes) om du vill använda installationsguiden<br>eller<br> <b>nej</b> (No) om du vill konfigurera routern manuellt.<li>Klicka på <b>nästa</b> (Next).</ol></body>";
var hlp_hWPS="<body bgcolor=#0099cc ><P><font size=4><B>Hjälp för att lägga till WPS-klient</B></font></P><p><a name=internet></a><a name=meter></a>(Add WPS Client Help) WPS står för Wi-Fi Protected Setup. Detta är en process som gör det enkelt att lägga till en trådlös klient till nätverket utan att man behöver konfigurera specifika trådlösa inställningar som SSID, säkerhetsläge och lösenordsfras.<p>Du kan välja att lägga till en trådlös klient genom att trycka på en knapp eller genom att ange en PIN-kod.<p>Med knappmetoden klickar du på en knapp på klienten (antingen en fysisk knapp på maskinvaran eller en programvaruknapp i användargränssnittet till klientens programvara).<p>Med PIN-kodmetoden måste du ange klientens PIN-kod här. Du måste starta klientens WPS-process samtidigt. Klientens PIN-kod finns i användargränssnittet i klientens programvara.</p></body>";
var hlp_UPG_upgrade_h="<body bgcolor=#0099cc> <p><font size=4><b>Hjälp för routeruppgradering</b></font></p> <p>Du installerar nya versioner av routerns programvara via skärmen Routeruppgradering (Router Upgrade).<a name=check></a> <p>Klicka på knappen <b>Sök efter</b> (Check) så hamnar du på NETGEARs webbplats där du kan hämta <b>nya versioner</b> av routerns programvara. När du har hämtat filen måste du extrahera den innan du kan uppgradera routern.    <p>Markera kryssrutan om du vill söka efter en ny version när du loggar in. <p><b>VIKTIGT</b> När du klickar du på <b>Överför </b>(Upload) får du <i>inte</i> avbryta processen när programvaran skickas till routern och routern startas om. Om du tror att processen skulle kunna avbrytas på något sätt, klickar du på <b>avbryt</b> (Cancel) för att behålla routerns befintliga programvara.</p><a name=locate></a><p><b>Sök rätt på och markera uppgraderingsfilen på hårddisken.</b><ol><li>Gå till www.NETGEAR.com och hämta den uppdaterade programvaran.<li>Extrahera filen manuellt om detta inte sker automatiskt.<br>Du kanske vill läsa filen <i>Versionsinformation</i> (Release Notes) innan du fortsätter.<li>Klicka på <b>Bläddra</b> (Browse).<li>Sök rätt på och markera den fil du just hämtat och extraherat.<li>Klicka på <b>Överför</b> (Upload) för att skicka programvaran till routern.<br>Den nya programvaran laddas i routern och routern startar om.<br><b>Obs!</b> Försök inte gå ut på internet, stänga av routern, stänga av datorn eller göra något annat med routern förrän omstarten är klar! När lampan klar (Ready) slutar blinka bör du vänta ytterligare några sekunder innan du gör något.<li>Klicka på <b>Routerstatus (Router Status)</b> och kontrollera versionen av den fasta programvaran för att bekräfta att routern nu har den nya programvaran installerad. </ol><p><B>VIKTIGT</b> I vissa fall, till exempel vid större uppgraderingar, måste du konfigurera om routern efteråt. Läs <i>Versionsinformationen</i> (Release Notes) som medföljer programvaran för att ta reda på om du måste konfigurera om routern. <p>Om uppgraderingen inte fungerade med den här metoden kan du läsa i <i>Referenshandboken</i> (Reference Manual) på produktens supportwebbplats om andra sätt att uppgradera routern på.</p> </body>";
var hlp_hBKS_service="<body bgColor=#0099cc><P><font size=4><B>Hjälp för att blockera tjänster</B></font></P><P>(Block Services Help) Med den här funktionen kan du blockera Internet-åtkomst för specifika användare i ditt lokala nätverk baserat på deras IP-adress. Du kan till exempel förhindra att alla eller bara vissa personer i nätverket använder utvalda Internet-tjänster som att surfa på webben (http). Du kan konfigurera tjänstblockeringen till att aldrig vara på, att alltid vara på eller att aktivera den enligt ett schema. </P><HR><A name=block></A><P><B>Så här aktiverar du tjänstblockeringen:</B></P><UL>  <LI>Välj <B>Efter schema</B> (Per Schedule) om du vill aktivera tjänstblockeringen och blockera enligt inställningarna på skärmen Schema (Schedule).   <LI>Välj <B>alltid</B> (Always) om du vill aktivera tjänstblockeringen så att funktionen alltid är på, oavsett vilka inställningar som finns på skärmen Schema (Schedule). </LI></UL><BR><P><B>Så här avaktiverar du tjänstblockeringen:</B><P><P><UL>  <LI>Välj <B>aldrig</B> (Never) för att stänga av tjänstblockeringen.</LI></UL><A name=table></A><P><B>Tjänsttabell</B> <P>(Service Table) Den här tabellen visar alla blockerade tjänster. Du kan lägga till och ta bort poster ur tabellen efter behov.</P><A name=add></A><P><B>Så här lägger du till en ny tjänst:</B> <OL>  <LI>Klicka på knappen <B>lägg till</B> (Add).   <LI>Följ anvisningarna på skärmen som visas.   <LI>Klicka på <B>tillämpa</B> (Apply) när du är klar. </LI></OL><A name=edit></A><P><B>Så här redigerar du en tjänst:</B> <OL>  <LI>Välj alternativknappen till den tjänst som du vill redigera.   <LI>Klicka på knappen <B>redigera</B> (Edit).   <LI>Ändra uppgifterna för tjänsten efter behov.   <LI>Klicka på <B>godkänn</B> (Accept) när du är klar. </LI></OL><A name=delete></A><P><B>Så här tar du bort en tjänst:</B> <OL>  <LI>Välj alternativknappen bredvid den rad i tabellen där tjänsten som du vill ta bort finns.   <LI>Klicka på <B>ta bort</B> (Delete) om du vill radera den valda tjänsten. </LI></OL><HR><P><B>Så här sparar och avbryter du ändringar:</B></P><P>Klicka på <A name=To></A><B>tillämpa</B> (Apply) om du vill spara de nya inställningarna för routern. <BR>Klicka på <A name=cancel></A><B>avbryt</B> (Cancel) om du vill avbryta ändringar som du inte har sparat. </P></body>";
var hlp_h_tm="<body bgcolor=#0099cc><P><font size=4><B> Hjälp för trafikräknaren  </B></font></P><A name=internet></A><H2 class=helpfile> Internettrafikräknare </H2><A name=meter></A><P><B> Aktivera trafikräknare  </B> <BR> Markera det här alternativet om du vill registrera volymen på den Internettrafik som går genom routerns Internetport. <P><B> Trafikvolymen styrs efter  </B> <BR> Markera det här alternativet om du vill registrera och begränsa volymen på den Internettrafik som går genom routerns Internetport.<UL><LI> Ingen begränsning – Om du väljer det här alternativet tillämpas inte de angivna begränsningarna när trafikgränsen är uppnådd.<LI> Endast hämtning – Om du väljer det här alternativet tillämpas de angivna begränsningarna endast på inkommande trafik <LI> Båda riktningarna – Om du väljer det här alternativet tillämpas de angivna begränsningarna på såväl inkommande som utgående trafik.</UL><P><B> Anslutningstidskontroll</B> <BR> Välj det här alternativet om du vill registrera och begränsa den tid Internetanslutningen används. Det här alternativet är bara tillgängligt för anslutningar via PPPoE, PPTP och L2TP.<P><B> Månadsbegränsning  </B><BR> Ange månatlig volymbegränsning eller tidsbegränsning för anslutning.<P><B> Sammanfatta datavolym för varje anslutning efter</B> <BR> En del Internetleverantörer tar betalt för en viss mängd extra data när användare gör en ny anslutning. Om så är fallet anger du den extra datavolymen här.<A name=counter></A><H2 class=helpfile> Trafikräknare</H2><P><B> Starta om trafikräknaren</B><BR> Här bestämmer du när trafikräknaren ska startas om. Ange önskad tid och dag i månaden.<P><B> Starta om räknaren nu</B> <BR> Klicka på den här knappen så startas trafikräknaren om omedelbart.<A name=reached></A><H2 class=helpfile> Trafikkontroll</H2><P><B> Visa ett varningsmeddelande</B><BR> Ange ett värde skilt från noll så visar routern ett varningsmeddelande innan den månatliga begränsningen av datavolym/anslutningstid uppnås när den angivna mängden har uppnåtts. Varningsmeddelandet kan endast visas när trafikstatusfönstret är öppet.<P><B> När månadsgränsen har uppnåtts</B><BR><P> Markera de åtgärder du önskar:<UL> <LI> Ställ in Internetlampan på att blinka grönt/gult – Internetlampan lyser växelvis med ett grönt och ett gult sken. <LI> Avbryt och stäng ned Internetanslutningen – all åtkomst till Internet stängs ned. </UL><A name=statistics></A><H2 class=helpfile> Statistik över Internettrafik</H2><P> Visar statistik över Internettrafik via Internetporten. <BR> Om trafikmätaren inte är aktiverad är den här statistiken inte tillgänglig. <P><B> Trafikstatus</B> <BR><BR> Klicka på den här knappen om du vill ha automatiska uppdateringar om användarstatus för Internettrafiken.<P></P></body>";
var hlp_WLG_acl_add="<body bgcolor=#0099cc > <P><font size=4><B>Hjälp för konfiguration av åtkomstlista för trådlösa kort (Wireless Card Access Setup Help)</B></font></P><a name=card></a> <p><b>Tillgängliga trådlösa kort (Available Wireless Cards)</b></p> <p>Listan <b>Tillgängliga trådlösa kort</b> (Available Wireless Cards) visar alla tillgängliga datorer och deras MAC-adresser  <p>Om den trådlösa datorn visas i listan <b>Tillgängliga trådlösa kort</b> (Available Wireless Cards) kan du välja alternativknappen till den datorn för att hämta dess MAC-adress. Om den trådlösa datorn inte syns i listan kontrollerar du att den har konfigurerats korrekt och klickar sedan på knappen <b>uppdatera</b> (Refresh) för att uppdatera listan med tillgängliga trådlösa datorer. Om den trådlösa datorn fortfarande inte syns använder du följande anvisningar för att konfigurera den trådlösa datorns MAC-adress manuellt.</p><hr><a name=entry></a> <p><b>Inmatning av trådlöst kort</b></p> <p>(Wireless Card Entry) Om inga trådlösa datorer visas i listan <b>Tillgängliga trådlösa kort</b> (Available Wireless Cards) kan du ange den godkända trådlösa datorns enhetsnamn och MAC-adress manuellt. <p><b>Obs!</b> MAC-adressen består av en 12-teckennyckel som brukar stå på den trådlösa enhetens undersida.</p><hr> <p>  <p><b>Så här lägger du till och avbryter ändringar:</b></p><p> Klicka på <b>lägg till</b> (Add) när du har ändrat klart inställningarna. <br> Klicka på <b>avbryt</b> (Cancel) om du vill återgå till de ursprungliga inställningarna.<br> Klicka på <b>uppdatera</b> (Refresh) om du vill visa alla anslutna enheter.</p></body>";
var hlp_VER_sel="<body bgcolor=#0099cc> <P><font size=4><B>Hjälp för uppgradering av fast programvara</B></font></P>        <p>(Firmware Upgrade Assistant Help). Routern kan automatiskt söka efter nya tillgängliga versioner av den fasta programvaran på Internet.<p>Klicka på <b>ja</b> (Yes) om du vill starta sökningen nu.<br>Klicka på <b>nej</b> (No) om du inte vill söka efter en ny version nu.<p>Om du föredrar att söka efter en ny version senare kan du göra det på skärmen routeruppgradering (Router Upgrade).<p>Om du inte vill se det här meddelandet igen nästa gång du loggar in, markerar du kryssrutan <b>visa inte det här meddelande igen</b> (Do not display this message again) och klickar på <b>nej</b> (No).</body>";
var hlp_h_LANG_change="<title>Hjälp</title><link rel=stylesheet href=help.css></head><body bgcolor=#0099cc ><h1>Kontrollera språkhjälp</h1><p>Användargränssnittets språk skiljer sig från språket i webbläsaren, om du vill ändra gränssnittsspråk till webbläsarspråk klickar du på <B>Ja</B>-knappen, annars på <B>Nej</B>-knappen</p></body>";
var hlp_h_wire=hlp_h_swsh01+hlp_h_swsh04+hlp_h_swsh03;
var hlp_h_fwsv="<body><h1 class='helpfile'>Services Help</h1><p>The Services menu contains a list of user-defined Services for creating firewall rules.If a service does not appear in the predefined Services list in the Firewall Rules menu, you can define the service in this menu. The new service will then appear in the Firewall Rules menuServices list.<a name='table'></a><h2 class='helpfile'>Service Table</h2><p>This table lists all Services you have defined. If you have not defined any Services, the table will be empty.<p>To Create a Service<ol><li>Click <b>Add Custom Service</b> </li><li>Enter the data for the service as required.</li><li>Click <b>Apply</b> to save the new service.</li></ol><p>To Edit a Service<ol><li>Click the radio button next to a service in the table.</li><li>Click <b>Edit Service</b> to display the service's data in the 'Service Definition' section.</li><li>Change the data for the service as required.</li><li>Click <b>Apply</b> to save your changes.</li></ol><p>To Delete a Service<ol><li>Click the radio button next to a service in the table.</li><li>Click <b>Delete Service</b> to delete the selected service.</li></ol></body>";
var hlp_h_mode="<body><a name='head'></a><h1 class='helpfile'>Device Mode Help</h1><p>You can use this page to set the mode for this device.</p><p>Device Name<p>This field displays the current name of this device.</p><p>Device Mode<p>Select the desired device mode for the router:<ul><li>Router - Both the ADSL Modem and the Router features are operational. In this mode, this device can provide shared Internet Access to all your LAN users.<li>Modem - Only the ADSL Modem component is operational. All Router features are disabled.</ul><p></p></body>";
var hlp_h_redit="<body><h1>Edit Address Reservation Help</h1><p>When you specify a reserved IP address for a PC on the LAN, that PC will always receive the same IP address each time it accesses the DHCP server. Reserved IP addresses should be assigned to servers that require permanent IP settings.<p><hr><p> <b>To Edit A Reserved IP Address:</b> </p><ul>1. Edit the IP Address, MAC Address or Device Name.<br>2. Click the <b>Accept</b> button when finished.</ul><p><hr><p> <b>To Accept Or Cancel</b> </p><p>Click <b>Accept</b> to update changes to the <b>Address Reservations</b> table.<br>Click <b>Cancel</b> to disregard any unsaved changes.<br></ul></body>";
var hlp_h_rulein="<body bgcolor=#0099cc><h1 class=helpfile>Hjälp för inkommande tjänst</h1> <p>Det här fönstret använder du för att definiera en ny inkommande brandväggsregel eller för att redigera en befintlig regel.Brandväggsregler kan användas för att blockera eller tillåta viss trafik. <B>Den här funktionen är endast till för avancerade administratörer!</b> Felaktig konfiguration orsakar allvarliga problem.</p><a name=serv>  </a><p><b>Tjänst</b><br>Välj önskad tjänst. Det här fastställer vilka paket som omfattas av regeln. Vid behov kan du definiera en ny tjänst i fönstret Tjänster, genom att definiera de protokoll och portnummer som tjänsten använder.<a name=action>  </a><p><b>Åtgärd</b><br>Välj önskad åtgärd för paket som omfattas av den här regeln:<ul><li>TILLÅT alltid<li>TILLÅT enligt schema, blockera annars<li>BLOCKERA alltid<li>BLOCKERA enligt schema, tillåt annars</ul>Obs!<ul><li>All inkommande trafik som inte tillåts av regler som du skapat kommer att blockeras av standardregeln.<li>BLOCKERA-regler är bara användbara om trafiken redan omfattas av en TILLÅT-regel. (Det vill säga, du vill blockera en underuppsättning av trafik som för närvarande tillåts av en annan regel.)<li>Använd fönstret Schema för att definiera schemat som används i dessa val.</ul><a name=dest></a><p><B>LAN-server</b><BR>Ange IP-adressen för datorn eller servern i LAN-nätverket som ska ta emot inkommande trafik som omfattas av den här regeln.<a name=source></a><p><b>WAN-användare</b><BR>De här inställningarna fastställer vilka paket som omfattas av regeln, baserat på deras käll-IP-adress (WAN). Välj önskat alternativ:<ul><li>Alla &nbsp; &nbsp; Alla IP-adresser omfattas av den här regeln.<li>Adressintervall&nbsp; &nbsp; Om du väljer det här alternativet måste du fylla i fälten Start och Slut.<li>Enskild adress &nbsp; &nbsp; Ange nödvändig adress i fältet Start.</ul><a name=log></a><p><b>Logg</b><br>Fastställer om paket som omfattas av den här regeln loggas. Välj önskad åtgärd.<ul><li>Alltid – logga alltid trafik som övervägs av den här regeln, oavsett om den matchar eller inte. (Användbart när du korrigerar dina regler.)<li>Aldrig – logga aldrig trafik som övervägs av den här regeln, oavsett om den matchar eller inte.</ul><pre></pre><p>Klicka på <b>Tillämpa</b> för att ändringarna ska börja gälla.<p>Klicka på <b>Avbryt</b> om du vill återgå till föregående fönster.</body>";
var hlp_h_ruleinat="<body bgcolor=#0099cc><h1 class=helpfile>Hjälp för inkommande tjänst</h1> <p>Det här fönstret använder du för att definiera en ny inkommande brandväggsregel eller för att redigera en befintlig regel.Brandväggsregler kan användas för att blockera eller tillåta viss trafik. <B>Den här funktionen är endast till för avancerade administratörer!</b> Felaktig konfiguration orsakar allvarliga problem.</p><a name=serv>  </a><p><b>Tjänst</b><br>Välj önskad tjänst. Det här fastställer vilka paket som omfattas av regeln. Vid behov kan du definiera en ny tjänst i fönstret Tjänster, genom att definiera de protokoll och portnummer som tjänsten använder.<a name=action>  </a><p><b>Åtgärd</b><br>Välj önskad åtgärd för paket som omfattas av den här regeln:<ul><li>TILLÅT alltid<li>TILLÅT enligt schema, blockera annars<li>BLOCKERA alltid<li>BLOCKERA enligt schema, tillåt annars</ul>Obs!<ul><li>All inkommande trafik som inte tillåts av regler som du skapat kommer att blockeras av standardregeln.<li>BLOCKERA-regler är bara användbara om trafiken redan omfattas av en TILLÅT-regel. (Det vill säga, du vill blockera en underuppsättning av trafik som för närvarande tillåts av en annan regel.)<li>Använd fönstret Schema för att definiera schemat som används i dessa val.</ul><a name=dest></a><p><B>LAN-server</b><BR>Ange IP-adressen för datorn eller servern i LAN-nätverket som ska ta emot inkommande trafik som omfattas av den här regeln.<a name=source></a><p><b>WAN-användare</b><BR>De här inställningarna fastställer vilka paket som omfattas av regeln, baserat på deras käll-IP-adress (WAN). Välj önskat alternativ:<ul><li>Alla &nbsp; &nbsp; Alla IP-adresser omfattas av den här regeln.<li>Adressintervall&nbsp; &nbsp; Om du väljer det här alternativet måste du fylla i fälten Start och Slut.<li>Enskild adress &nbsp; &nbsp; Ange nödvändig adress i fältet Start.</ul><a name=log></a><p><b>Logg</b><br>Fastställer om paket som omfattas av den här regeln loggas. Välj önskad åtgärd.<ul><li>Alltid – logga alltid trafik som övervägs av den här regeln, oavsett om den matchar eller inte. (Användbart när du korrigerar dina regler.)<li>Aldrig – logga aldrig trafik som övervägs av den här regeln, oavsett om den matchar eller inte.</ul><pre></pre><p>Klicka på <b>Tillämpa</b> för att ändringarna ska börja gälla.<p>Klicka på <b>Avbryt</b> om du vill återgå till föregående fönster.</body>";
var hlp_h_ruleou="<body bgcolor=#0099cc><h1 class=helpfile>Hjälp för utgående tjänst</h1> <p>Det här fönstret använder du för att definiera en ny utgående brandväggsregel eller för att redigera en befintlig regel.Utgående brandväggsregler används för att blockera eller tillåta åtkomst åt datorer i nätverket till tjänster eller program på internet.</p><a name=serv>  </a><p><b>Tjänst</b><br>Välj önskad tjänst eller program som ska omfattas av den här regeln. Om önskad tjänst eller program inte visas i listan måste du definiera den med menyn Tjänster.<a name=action>  </a><p><b>Åtgärd</b><br>Välj önskad åtgärd för paket som omfattas av den här regeln:<ul><li>BLOCKERA alltid<li>BLOCKERA enligt schema, tillåt annars<li>TILLÅT alltid<li>TILLÅT enligt schema, blockera annars</ul>Obs!<ul><li>All utgående trafik som inte blockeras av regler som du skapat kommer att tillåtas av standardregeln.<li>TILLÅT-regler är bara användbara om trafiken redan omfattas av en BLOCKERA-regel. (Det vill säga, du vill tillåta en underuppsättning av trafik som för närvarande blockeras av en annan regel.)<li>Använd fönstret Schema för att definiera schemat som används i dessa val.</ul><a name=source></a><p><B>LAN-användare</b><BR>De här inställningarna fastställer vilka datorer i ditt nätverk som påverkas av regeln, baserat på deras käll-IP-adress (LAN). Välj önskat alternativ:<ul><li>Alla – Alla lokala IP-adresser omfattas av den här regeln.<li>Adressintervall – Om du väljer det här alternativet måste du fylla i fälten Start och Slut.<li>Enskild adress – Ange nödvändig adress i fältet Start.</ul><a name=dest></a><p><b>WAN-servrar</b><BR>De här inställningarna fastställer vilka internetplatser som omfattas av regeln, baserat på deras mål-IP-adress (WAN). Välj önskat alternativ:<ul><li>Alla – Alla internet-IP-adresser omfattas av den här regeln.<li>Adressintervall – Om du väljer det här alternativet måste du fylla i fälten Start och Slut.<li>Enskild adress – Ange nödvändig adress i fältet Start.</ul><a name=log></a><p><b>Logg</b><br>Fastställer om paket som omfattas av den här regeln loggas. Välj önskad åtgärd:<ul><li>Alltid – logga alltid trafik som övervägs av den här regeln, oavsett om den matchar eller inte. (Användbart när du korrigerar dina regler.)<li>Aldrig – logga aldrig trafik som övervägs av den här regeln, oavsett om den matchar eller inte.</ul><pre></pre><p>Klicka på <b>Tillämpa</b> för att ändringarna ska börja gälla.<p>Klicka på <b>Avbryt</b> om du vill återgå till föregående fönster.</body>";
var hlp_h_wadd="<body><h1>Wireless Station Access Setup Help</h1><a name='card'></a><p> <b>Available Wireless Stations</b> </p><p>The <b>Available Wireless Stations</b> list displays any available wireless PCs and their MAC addresses.<p>If the wireless PC appears in the <b>Available Wireless Stations</b> list, you can click on the radio button of that PC to capture its MAC address. If your wireless PC is not displayed, make sure that the PC is configured correctly, and then click on the <b>Refresh</b> button to update the available list of wireless PCs. If the wireless PC is still not displayed, then follow the instructions below on how to manually setup the wireless PC's MAC address.</p><hr><a name='entry'></a><p> <b>Wireless Station Entry</b> </p><p>If no wireless PCs appears in the <b>Available Wireless Stations</b> list, you can manually enter the Device Name and MAC address of the authorized wireless PC.<p> <b>Note:</b> The MAC address is a twelve character key that can usually be found on the bottom of the wireless device.</p><hr><p><p> <b>To Add Or Cancel Changes</b> </p><p>Click <b>Add</b> when you finish changing the settings.<br> Click <b>Cancel</b> to return to the original settings.<br>Click <b>Refresh</b> to show the current attached devices.</p></body>";
var hlp_hlanip_mo="<body><h1>LAN IP Setup Help</h1><a name='tcp'></a><p> <b>LAN TCP/IP Setup</b> </p><p>These are advanced settings that you may configure if you are a network administrator and your network contains multiple Routers. If you make any changes to these settings you will need to restart your computer(s) for the settings to take effect.</p><ul><li> <b>IP Address:</b> Type the IP address of your Router in dotted decimal notation (factory default: http://www.routerlogin.net).<li> <b>IP Subnet Mask:</b> The subnet mask specifies the network number portion of an IP address. Your Router will automatically calculate the subnet mask based on the IP address that you assign. Unless you are implementing subnetting, use 255.255.255.0 as the subnet mask (computed by the Router).</ul><hr><a name='To'></a><p> <b>To Save Or Cancel Changes</b> </p><p>Click <b>Apply</b> to save the new settings to the Router.<br>Click <b>Cancel</b> to disregard any unsaved changes.</p></body>";
var hlp_hmodem_wizard="<body><h1>Setup Wizard Help</h1><p>This page allows you to select the language of the web-based GUI</p><p> <b>Select Country and Language</b> </p><p>Choose the correct country of operation and language. The Country selection helps to determine your configuration quickly. The Language will change the text in the web-based GUI to the selected language. The Country and Language will be saved when you click <b>Apply</b> .<p>Click <b>Apply</b> to continue.</body>";
var hlp_hmstatus="<body><h1>Modem Status Help</h1><p>You can use the <i>Modem Status</i> page to check the current settings and statistics for your Router. This page shows you the current settings.If something needs to be changed, you'll have to change it on the relevant page.<p> <b>Device Name</b> : This is current name of this device.</p><p> <b>Firmware Version</b> : This is the current Firmware (software) the Modem is using. This will change if you upgrade your Firmware.</p><a name='lan_port'></a><p> <b>LAN Port</b> : These are the current settings, as set in the <i>LAN IP Setup</i> page.<ul><li>IP Address - LAN IP address of the Router.<li>IP Subnet Mask - subnet mask associated with the LAN IP address.</ul><a name='modem'></a><p> <b>Modem</b> : The current Modem status and settings are shown in this section.<ul><li>ADSL Firmware Version - This is the version number of the low-level ADSL firmware. This is contained within the Router Firmware.<li>Modem Status - the current state of the ADSL connection to your phone company.<li>DownStream Connection Speed - the connection speed of the ADSL connection from the phone company to your Router.<li>UpStream Connection Speed - the connection speed of the ADSL connection from your Router to the phone company.<li>VPI - the VPI setting entered on the ADSL Settings page.<li>VCI - the VCI setting entered on the ADSL Settings page.</ul><p>Click <b>Show Statistics</b> to see Router performance statistics such as the number of packets sent and number of packets received for each port.</body>";
var hlp_hmstatus_w="<body><h1>Modem Status Help</h1><p>You can use the <i>Modem Status</i> page to check the current settings and statistics for your Router. This page shows you the current settings.If something needs to be changed, you'll have to change it on the relevant page.</p><p> <b>Device Name</b> : This is current name of this device.</p><p> <b>Firmware Version</b> : This is the current Firmware (software) the Modem is using. This will change if you upgrade your Firmware.</p><a name='lan_port'></a><p> <b>LAN Port</b> : These are the current settings, as set in the <i>LAN IP Setup</i> page.<ul><li>IP Address - LAN IP address of the Router.<li>IP Subnet Mask - subnet mask associated with the LAN IP address.</ul><a name='modem'></a><p> <b>Modem</b> : The current Modem status and settings are shown in this section.<ul><li>ADSL Firmware Version - This is the version number of the low-level ADSL firmware. This is contained within the Router Firmware.<li>Modem Status - the current state of the ADSL connection to your phone company.<li>DownStream Connection Speed - the connection speed of the ADSL connection from the phone company to your Router.<li>UpStream Connection Speed - the connection speed of the ADSL connection from your Router to the phone company.<li>VPI - the VPI setting entered on the ADSL Settings page.<li>VCI - the VCI setting entered on the ADSL Settings page.</ul><a name='wireless_port'></a><p> <b>Wireless Port</b> : These are the current settings, as set in the <i>Wireless Settings</i> page.<ul><li>Name (SSID) - SSID of the WNR2000.<li>Region - the location (country).<li>Channel - the current channel in use.<li>Wireless AP - indicates if the Access Point feature of the WNR2000 is enabled or not. If not enabled, the Wireless LED on the front panel will be off.<li>Broadcast Name - indicates if the WNR2000 is broadcasting its SSID.</ul><p>Click <b>Show Statistics</b> to see Router performance statistics such as the number of packets sent and number of packets received for each port.</body>";
var hlp_hph_fail="<body><h1 class='helpfile'>No Internet Connection Detected</h1><p>The Setup Wizard wasn't able to access the Internet through the ADSL modem.<p>Please verify the following:<ul><li>The modem is connected to the external line.<li>The settings you entered are correct.<br> <b>Note:</b> Make sure there are no typos. Many values are case-sensitive; therefore, PatAB is not the same as patab.</ul><p>If you've corrected the problem, click <b>Retry</b> to have the Router try again.<p>Click <b>Cancel</b> to return the beginning of the Setup Wizard.<hr><p>If you continue to have problems:<ul><li>Contact your ISP to verify the configuration information.</li><li>Read the Troubleshooting section in the <i>WNR2000 Installation Guide</i> .</li><li>On the <i>WNR2000</i> Resource CD, read the <i>Troubleshooting Guide</i> or the Troubleshooting section in the <i>Reference Manual</i> .</li><li>Contact NETGEAR Technical Support.</li></ul></body>";
var hlp_hreserv="<body><h1>Address Reservation Help</h1><p>When you specify a reserved IP address for a PC on the LAN, that PC will always receive the same IP address each time it accesses the DHCP server. Reserved IP addresses should be assigned to servers that require permanent IP settings.</p><hr><a name='table'></a><p> <b>Address Reservation Table</b> </p><p>The Address Reservation Table displays the attached devices on your network that are available for IP reservation.</p><hr><p> <b>To Reserve An IP Address:</b> </p><ol><li>Select the radio button of the Computer you wish to add from the <b>Address Reservation Table</b> .<li>If the Computer you want is not on the list; click the <b>Refresh</b> button to update the table.<li>If the Computer is still not on the <b>Address Reservation Table</b> ; Enter the IP Address, MAC Address, and Device Name of the computer you wish to add.<li>Click the <b>Add</b> button when finished.</ol><hr><p> <b>To Add Or Cancel Changes</b> </p><p>Click <b>Add</b> to reserve an IP address for a selected computer.<br>Click <b>Cancel</b> to disregard any unsaved changes.<br></p></body>";
var hlp_hw_dyn="<body><h1 class='helpfile'>Dynamic IP Address Help</h1><p>No configuration of the Router is needed to support a Dynamic IP Address</p><p>Click <b>Apply</b> when you finish changing the settings.</p><p>Click <b>Cancel</b> to return to the original settings.</p><p>Click <b>Test</b> to connect to the NETGEAR Web site. If you connect successfully, your settings work and you may click <b>Logout</b> to exit these pages and enjoy surfing the 'net!</p><p>If you don't connect successfully,</p><ul><li>Go through the settings and make sure you've selected the correct options and typed everything correctly.</li><li>Contact your ISP to verify the configuration information.</li><li>On the <b>Resource CD</b> , read the Troubleshooting chapter in the <i>Reference Manual.</i> </li><li>Contact NETGEAR Technical Support.</li></ul></body>";
var hlp_hw_fail="<body><h1>Setup Wizard Help</h1><p>The Router was unable to establish an Internet connection using any connection method.<ul><li>If you are using an 'Always on' connection, with a Fixed IP address, select <b>Basic Settings</b> and configure the Setup screen with the data provided by your ISP.<li>Otherwise, check all connections before continuing. Click <b>Retry Wizard</b> to try again if you found a connection issue and fixed it. If you know the settings needed by your ISP, they can be configured on the <b>ADSL Settings</b> and <b>Basic Settings</b> pages.</ul><p></p></body>";
var hlp_hw_fix="<body><h1>Setup Wizard Help</h1><p> <b>Do you have a Fixed or Static IP Address Assigned by your ISP?</b> <p>If you know that your ISP has provided a fixed IP address, click the 'Yes' button,and the enter the IP address and related data from your ISP on the next screen.<p>If you are uncertain, click 'Not sure'. You will then see a setup screen which allows foreither a fixed or dynamic IP address, and also contains a 'Test' button. Refer to the data fromyour ISP to configure this screen.<p></p></body>";
var hlp_hw_msg="<body><h1>Smart Setup Wizard Help</h1><p>The Router will first check the DSL connection, and then test different WAN (Internet) connection methods.<p>If the current DSL settings do not work, it may take up to 4 minutes to test all possible DSL connection parameters. Please be patient.<p>After a DSL connection can be established, the WAN (Internet) connection will be tested.</p><p></p></body>";
var hlp_hwiz_fix="<body><h1>Help </h1> <a name='InternetIP'></a> <h2>Internet IP Address </h2> <p>If you log in to your service or your ISP did not provide you with a fixed IP address, the router will find an IP address for you automatically when you connect.  Select <b>Get Dynamically From ISP</b>. </p> <p>If you have a fixed (static, permanent) IP address, your ISP will have provided you with the required information. Select <b>Use Static IP Address</b> and type the IP Address, Subnet Mask and Gateway IP Address into the correct boxes. </p> <p>The IP Address is your personal address, and the Gateway IP Address is the address of your ISP's router. If you can't determine your subnet mask, try 255.255.255.0. </p> <a name='DNSaddress'></a> <h2>Domain Name Server (DNS) Address </h2> <p>The DNS server is used to look up site addresses based on their names. </p> <p>If your ISP gave you one or two DNS addresses, select <b>Use These DNS Servers</b> and type the primary and secondary addresses. </p> <p>Otherwise, select <b>Get Automatically From ISP</b>. </p> <p><b>Note: </b>If you get 'Address not found' errors when you go to a Web site, it is likely that your DNS servers aren't set up properly. You should contact your ISP to get DNS server addresses. </p> <a name='buttons'> </a> <h2>Apply, Cancel and Test Buttons</h2> <p>Click <b>Apply</b> when you finish changing the settings. </p> <p>Click <b>Cancel</b> to return to the original settings. </p> <p>Click <b>Test</b> to connect to the NETGEAR Web site. If you connect successfully, your settings work and you may click <b>Logout</b> to exit these pages and enjoy surfing the 'net!</p> <p>If you don't connect successfully, </p> <ul> <li>Go through the settings and make sure you've selected the correct options and typed everything correctly. </li> <li>Contact your ISP to verify the configuration information. </li> <li>On the <b>GearBox CD</b>, read the Troubleshooting chapter in the <i>Reference Manual.</i></li> <li>Contact NETGEAR Technical Support.</li> </ul></body>";
var hlp_hwiz_dyn="<body><h1>Help </h1> <a name='accountname'></a> <h2>Account Name </h2> <p>(also known as Host Name or System Name) </p> <p>For most users, type your account name or user name in this box. For example, if your main mail account is JerAB@ISP.com, then put JerAB in this box.  <p>If your ISP has given you a specific Host name, then type it (for example, CCA7324-A).  <a name='domain'></a> <h2>Domain Name </h2> <p>For most users, you may leave this box blank. You may type the domain name of your ISP. For example, if your ISP's mail server is mail.xxx.yyy.zzz, you would type xxx.yyy.zzz as the Domain Name. </p> <p>If you have a Domain name given to you by your ISP, type it in this box.  (For example, Comcast supplies a Domain name.) </p> <p>If you have a cable modem, this is the Workgroup name. </p> <a name='buttons'> </a> <h2>Apply, Cancel and Test Buttons</h2> <p>Click <b>Apply</b> when you finish changing the settings. </p> <p>Click <b>Cancel</b> to return to the original settings. </p> <p>Click <b>Test</b> to connect to the NETGEAR Web site. If you connect successfully, your settings work and you may click <b>Logout</b> to exit these pages and enjoy surfing the 'net!</p> <p>If you don't connect successfully, </p> <ul> <li>Go through the settings and make sure you've selected the correct options and typed everything correctly. </li> <li>Contact your ISP to verify the configuration information. </li> <li>On the <b>GearBox CD</b>, read the Troubleshooting chapter in the <i>Reference Manual.</i></li> <li>Contact NETGEAR Technical Support.</li> </ul></body>";
var hlp_hwiz_pppoe="<body><h1>Help </h1> <a name='login'></a> <h2>Login </h2> <p>This is usually the name that you use in your e-mail address. For example, if your main mail account is JerAB@ISP.com, then put JerAB in this box. </p> <p>Some ISPs (like Mindspring, Earthlink, and T-DSL) require that you use your full e-mail address when you log in. If your ISP requires your full e-mail address, then type it in the Login box. </p> <a name='password'></a> <h2>Password</h2> <p>Type the password that you use to log in to your ISP. </p> <a name='serv_name'></a> <h2>Service Name</h2> <p>If your ISP provided a Service Name, enter it here. Otherwise, this may be left blank.  <a name='idletime'></a> <h2>Idle Timeout</h2> <p>An idle Internet connection will be terminated after this time period.  <p>If this value is zero (0), then the connection will be \"kept alive\" by re-connecting immediately whenever the connection is lost.</p> <a name='InternetIP'></a> <h2>Internet IP Address </h2> <p>If you log in to your service or your ISP did not provide you with a fixed IP address, the router will find an IP address for you automatically when you connect.  Select <b>Get dynamically from ISP</b>. </p> <p>If you have a fixed (static, permanent) IP address, your ISP will have provided you with an IP address. Select <b>Use static IP address</b> and type in the IP Address. </p> <a name='DNSaddress'></a><h2 class='helpfile'>Domain Name Server (DNS) Address</h2><p>The DNS server is used to lookup site addresses based on their names.</p><p>If your ISP gave you one or twoDNS addresses, select <b>Use These DNS Servers</b> and type the primary andsecondary addresses.</p><p>Otherwise, select <b>GetAutomatically From ISP</b> .</p><p> <b>Note:</b> If you get'Address not found' errors when you go to a Web site, it is likely that yourDNS servers aren't set up properly. You should contact your ISP to get DNSserver addresses.</p> <a name='buttons'></a> <h2> Apply, Cancel and Test Buttons</h2> <p>Click <b>Apply</b> when you finish changing the settings. </p> <p>Click <b>Cancel</b> to return to the original settings. </p> <p>Click <b>Test</b> to connect to the NETGEAR Web site. If you connect successfully, your settings work and you may click <b>Logout</b> to exit these pages and... enjoy surfing the <b>'net!</b> </p> <p>If you don't connect successfully, </p> <ul> <li>Go through the settings and make sure you've selected the correct options and typed everything correctly. </li> <li>Contact your ISP to verify the configuration information. </li> <li>Read the Troubleshooting section in the <i>Device Installation Guide.</i></li> <li>On the <i>Device GearBox CD</i>, read the <i>Troubleshooting Guide</i> or the Troubleshooting section in the <i>Reference Guide.</i></li> <li>Contact NETGEAR Technical Support.</li> </ul></body>";
var hlp_hwiz_pptp="<body><h1 >Help </h1><a name='login'></a><h2 >Login </h2> <p>This is usually the name that you use in your e-mail address. For example, if your main mail account is JerAB@ISP.com, then put JerAB in this box. </p> <p>Some ISPs (like Mindspring, Earthlink, and T-DSL) require that you use your full e-mail address when you log in. If your ISP requires your full e-mail address, then type it in the Login box.</p> <a name='password'></a> <h2 >Password</h2> <p>Type the password that you use to log in to your ISP. </p> <a name='idletime'></a> <h2 >Idle Timeout</h2> <p>An idle Internet connection will be terminated after this time period.  <p>If this value is zero (0), then the connection will be \"kept alive\" by re-connecting immediately whenever the connection is lost.</p> <a name='myip'></a> <h2 >My IP Address</h2> <p>If your ISP gave you a fixed IP address, such as 10.0.0.140, enter it here.  Otherwise, leave this at 0.0.0.0 You will then be allocated an IP address automatically when you connect.</p> <a name='serverip'></a> <h2 >Server Address</h2> <p>If your ISP gave you the IP address of your ISP's server, such as 10.0.0.138, enter it here. Otherwise, leave this at 0.0.0.0 You will then be allocated an IP address automatically when you connect.</p><a name=gwip></a><h2 class=helpfile>Gateway IP Address</h2><p>if you have a fixed(or static IP) address for 'My IP Address', your ISP should have also provided you with a 'Gateway IP Address'. You need to enter the 'Gateway IP Address' here.</p><p>if you use DHCP client to get 'My IP Address' or your service provider requires you to leave 'My IP Address' blank, there is no need to enter a 'Gateway IP address'. <a name='buttons'></a> <h2 >Apply, Cancel and Test Buttons</h2> <p>Click <b>Apply</b> when you finish changing the settings. </p> <p>Click <b>Cancel</b> to return to the original settings. </p> <p>Click <b>Test</b> to connect to the NETGEAR Web site. If you connect successfully, your settings work and you may click <b>Logout</b> to exit these pages and... enjoy surfing the <b>'net!</b> </p> <p>If you don't connect successfully, </p> <ul> <li>Go through the settings and make sure you've selected the correct options and typed everything correctly. </li> <li>Contact your ISP to verify the configuration information. </li> <li>Read the Troubleshooting section in the <i>Device Installation Guide.</i></li> <li>On the <i>Device GearBox CD</i>, read the <i>Troubleshooting Guide</i> or the Troubleshooting section in the <i>Reference Guide.</i></li> <li>Contact NETGEAR Technical Support.</li> </ul></body>";
var hlp_hwiz_phfail="<body><h1> No Internet Connection Detected </h1> <p>The Setup Wizard wasn't able to access the Internet through the Cable/DSL modem.  <p>Please verify the following: <ul> <li>The modem is connected to the external line.  <li>The settings you entered are correct.  <br> <b>Note:</b> Make sure there are no typos. Many values are case-sensitive; therefore, PatAB is not the same as patab.  </ul> <p>If you've corrected the problem, click <b>Retry</b> to have the router try again.  <p>Click <b>Cancel</b> to return the beginning of the Setup Wizard.  <hr> <p>If you continue to have problems: <ul> <li>Contact your ISP to verify the configuration information. </li> <li>Read the Troubleshooting section in the <i>Router Installation Guide</i>. </li> <li>On the <i>Router</i> Resouce CD, read the <i>Troubleshooting Guide</i> or the Troubleshooting section in the <i>Reference Manual</i>. </li> <li>Contact NETGEAR Technical Support.</li> </ul></body>";
var hlp_WIZ_det_fix="<body><h1>Smart Setup Wizard Help</h1><p><b>Do you have a Fixed or Static IP Address Assigned by your ISP?</b></p> <p>If you know that your ISP has provided a fixed IP address, click the \"Yes\" button, and the enter the IP address and related data from your ISP on the next screen.</p><p>If you are uncertain, click \"Not sure\". You will then see a setup screen which allows for either a fixed or dynamic IP address, and also contains a \"Test\" button. Refer to the data from your ISP to configure this screen.</p></body>";
var hlp_hpppoe="<body bgColor=#0099cc><DIV class=Section1><P><font size=4><B>Hjälp  </B></font></P><P>På skärmen Grundläggande inställningar kan du konfigurera, uppgradera och kontrollera status för din trådlösa NETGEAR Cable/DSL-router.</P><P>Klicka på en post i kolumnen längst till vänster. De aktuella inställningarna eller informationen för det området visas i mittenkolumnen. <P>Användbar information som relaterar till de valda inställningsfönstren visas i den här kolumnen. Om du använder Internet Explorer kan du klicka på en post i mittenkolumnen för att gå direkt till det relaterade hjälpavsnittet. I annat fall bläddrar du ned tills du hittar det. <HR><A name=bsetting></A><P><font size=4><B>Hjälp för grundläggande inställningar</B></font></P><P><B>Obs!</B> Om du konfigurerar routern för första gången kanske standardinställningarna fungerar för dig utan ändringar. <A name=question></A><P><B>Kräver internetanslutningen inloggning?</B> <P>Välj det här alternativet utifrån vilken typ av konto du har hos din internetleverantör. Om du måste ange inloggningsuppgifter varje gång du ansluter till internet eller om du har ett PPPoE/PPTP/L2TP-konto hos din internetleverantör klickar du på <B>Ja</B>. Annars klickar du på <B>Nej</B>. </P><P><B>Obs!  </B>Om du har installerat PPP-programvara, t.ex. WinPoET (från Earthlink) eller Enternet (från PacBell), har du PPPoE. Välj <b>Ja</b> När du har valt Ja och konfigurerat routern behöver du inte köra PPP-programmet på datorn för att ansluta till internet. </P><A name=isp></A><H2 class=helpfile>Internetleverantör</H2><P>Välj den tjänst som din internetleverantör tillhandahåller. <b>PPPoE</b> är vanligast. <b>PPTP</b> används i Österrike och andra europeiska länder. <b>L2TP</b> används i Ryssland, Israel och är inte vanligt i andra länder.</P><H2 class=helpfile><A name=login></A>Logga in </H2><P>Det här är oftast namnet du använder i din e-postadress. Om ditt huvud-e-postkonto är JerAB@ISP.com skriver du alltså JerAB i det här fältet. </P><P>Vissa internetleverantörer (som Mindspring, Earthlink och T-DSL) kräver att du använder din fullständiga e-postadress vid inloggning. Om din internetleverantör kräver att du anger din fullständiga e-postadress skriver du den i fältet <b>Inloggning (Login)</b>. </P><A name=password></A><H2 class=helpfile>Lösenord</H2><P>Skriv lösenordet som du använder för att logga in hos din internetleverantör. </P><A name=serv_name></A><H2 class=helpfile>Tjänstnamn</H2><P>Om du har fått ett tjänstnamn av din internetleverantör anger du det här. Annars kan du låta rutan vara tom.</P><a name=conn_mode></a><h2 class=helpfile>Anslutningsläge</h2><p>Ange anslutningsläget till antingen Uppringning på begäran, Alltid på eller Manuell anslutning.<br>Med standardinställningen, Uppringning på begäran, upprättas en PPPoE-/PPTP-/L2TP-anslutning automatiskt när det förekommer utgående trafik mot internet, och anslutningen kopplas ned automatiskt efter värdet för Inaktivitetstidsgräns. När anslutningsläget är Alltid på upprättas PPPoE/PPTP/L2TP-anslutningen automatiskt när datorn startas, och anslutningen bryts inte vid inaktivitet. Om anslutningen av någon anledning kopplas ned kommer routern fortsätta att försöka återupprätta den. Om du väljer Manuell anslutning måste du gå till skärmen Routerstatus och klicka på knappen Anslut för att ansluta till internet. En manuell anslutning kan inte bli inaktiv, och du måste klicka på knappen Koppla från på skärmen Routerstatus om du vill koppla ned anslutningen.</p><A name=pppoe_idletime></A><H2 class=helpfile>Inaktivitetstidsgräns</H2><P>En internetanslutning med inaktivitetstidsgräns avbryts efter den angivna tiden. <P>Om värdet är noll (0) kommer anslutningen att hållas levande, så fort anslutningen kopplas ned kommer den att upprättas igen.</P><A name=InternetIP></A><H2 class=helpfile>Internet-IP-adress </H2><P>Om du loggar in på din tjänst eller om du inte fått någon fast IP-adress av internetleverantören, kommer routern att söka upp en IP-adress automatiskt när du ansluter. Välj <B>Hämta dynamiskt från ISP</B>. </P><P>Om du har en fast (statisk, permanent) IP-adress, har du fått en IP-adress av din internetleverantör. Välj <B>Använd statisk IP-adress</B> och ange in IP-adressen. </P><A name=DNSaddress></A><H2 class=helpfile>DNS-adress (Domain Name Server) </H2><P>DNS-servern används till att söka upp webbsideadresser baserat på deras namn. </P><P>Om din internetleverantör har gett dig en eller två DNS-adresser väljer du <B>Använd de här DNS-servrarna</B> och skriver in den primära och sekundära adressen. </P><P>Annars väljer du <B>Hämta automatiskt från ISP</B>. </P><P><B>Obs!  </B>Om du får felmeddelanden om att adressen inte kan hittas när du går till en webbplats, är det troligt att dina DNS-servrar inte är rätt konfigurerade. Kontakta din internetleverantör och be om rätt DNS-serveradresser. </P><h2 class=helpfile><a name=localaddress></a>Routerns MAC-adress </h2><p>Varje dator eller router i nätverket har en unik 48-bitars lokal Ethernet-adress. Den kallas också för datorns MAC-adress (Media Access Control).</p><p>Vanligtvis väljer du <b>Använd standardadress</b>.</p><p>Om din internetleverantör kräver MAC-autentisering väljer du antingen <b>Använd datorns MAC-adress</b>, så att routern använder MAC-adressen till den dator du använder nu, eller <b>Använd den här MAC-adressen</b> och skriver in den MAC-adress som din internetleverantör förväntar sig manuellt.</p> <p>MAC-adressens format är XX:XX:XX:XX:XX:XX. Om du väljer <b>Använd den här MAC-adressen</b> och anger en MAC-adress ska du inte välja <b>Använd den här datorns MAC-adress</b>, eftersom din post då skrivs över.</p><H2 class=helpfile><A name=buttons></A>Knapparna Tillämpa, Avbryt och Test</H2><P>Klicka på <B>Tillämpa (Apply)</B> när du har ändrat klart inställningarna. </P><P>Klicka på <B>Avbryt (Cancel)</B> om du vill återgå till de tidigare inställningarna. </P><P>Klicka på <B>Test</B> för att ansluta till NETGEARs webbplats. Om anslutningen fungerar är inställningarna korrekta, och du kan klicka på <B>Logga ut</B> för att stänga skärmarna och börja surfa på nätet. </P><P>Om anslutningen inte fungerar: </P><UL>  <LI>Gå igenom inställningarna och kontrollera att du har valt rätt alternativ och skrivit in allt korrekt.   <LI>Kontakta din internetleverantör för att bekräfta att du har rätt konfigureringsuppgifter.   <LI>Läs avsnittet Felsökning i enhetens <I>installationshandbok</I>.   <LI>Kontakta NETGEARs tekniska support. </LI></UL></DIV></body>";
var hlp_hpptpc="<body bgcolor=#0099cc><div class=Section1><P><font size=4><B>Hjälp</B></font></P><p>På skärmen Grundläggande inställningar kan du konfigurera, uppgradera och kontrollera status för din trådlösa NETGEAR Cable/DSL-router.</p> <p>Klicka på en post i kolumnen längst till vänster. De aktuella inställningarna eller informationen för det området visas i mittenkolumnen. <p>Användbar information som relaterar till de valda inställningsfönstren visas i den här kolumnen. Om du använder Internet Explorer kan du klicka på en post i mittenkolumnen för att gå direkt till det relaterade hjälpavsnittet. I annat fall bläddrar du ned tills du hittar det. <hr><a name=bsetting></a><P><font size=4><B>Hjälp för grundläggande inställningar</B></font></P><p><b>Obs!</b> Om du konfigurerar routern för första gången kanske standardinställningarna fungerar för dig utan ändringar.<a name=question></a><p><b>Kräver internetanslutningen inloggning?</b> <p>Välj det här alternativet utifrån vilken typ av konto du har hos din internetleverantör. Om du måste ange inloggningsuppgifter varje gång du ansluter till internet eller om du har ett PPPoE/PPTP/L2TP-konto hos din internetleverantör klickar du på <b>Ja</b>. Annars klickar du på <b>Nej</b>. </p><p><b>Obs!  </b>Om du har installerat PPP-programvara, t.ex. WinPoET (från Earthlink) eller Enternet (från PacBell), har du PPPoE. Välj <b>Ja</b>. När du har valt Ja och konfigurerat routern behöver du inte köra PPP-programmet på datorn för att ansluta till internet. </p><a name=isp></a><h2 class=helpfile>Internetleverantör</h2><p>Välj den tjänst som din internetleverantör tillhandahåller. <b>PPPoE</b> är vanligast. <b>PPTP</b> används i Österrike och andra europeiska länder. <b>L2TP</b> används i Ryssland, Israel och är inte vanligt i andra länder.</p><a name=login></a><h2 class=helpfile>Logga in </h2><p>Det här är oftast namnet du använder i din e-postadress. Om ditt huvud-e-postkonto är JerAB@ISP.com skriver du alltså JerAB i det här fältet. </p><p>Vissa internetleverantörer (som Mindspring, Earthlink och T-DSL) kräver att du använder din fullständiga e-postadress vid inloggning. Om din internetleverantör kräver att du anger din fullständiga e-postadress skriver du den i fältet <b>Inloggning (Login)</b>. </p><a name=password></a><h2 class=helpfile>Lösenord</h2><p>Skriv lösenordet som du använder för att logga in hos din internetleverantör. </p><a name=conn_mode></a><h2 class=helpfile>Anslutningsläge</h2><p>Ange anslutningsläget till antingen Uppringning på begäran, Alltid på eller Manuell anslutning.<br>Med standardinställningen, Uppringning på begäran, upprättas en PPPoE-/PPTP-/L2TP-anslutning automatiskt när det förekommer utgående trafik mot internet, och anslutningen kopplas ned automatiskt efter värdet för Inaktivitetstidsgräns. När anslutningsläget är Alltid på upprättas PPPoE/PPTP/L2TP-anslutningen automatiskt när datorn startas, och anslutningen bryts inte vid inaktivitet. Om anslutningen av någon anledning kopplas ned kommer routern fortsätta att försöka återupprätta den. Om du väljer Manuell anslutning måste du gå till skärmen Routerstatus och klicka på knappen Anslut för att ansluta till internet. En manuell anslutning kan inte bli inaktiv, och du måste klicka på knappen Koppla från på skärmen Routerstatus om du vill koppla ned anslutningen.</p><a name=idletime></a><h2 class=helpfile>Inaktivitetstidsgräns</h2><p>En internetanslutning med inaktivitetstidsgräns avbryts efter den angivna tiden.<p>Om värdet är noll (0) kommer anslutningen att hållas levande, så fort anslutningen kopplas ned kommer den att upprättas igen.</p><a name=myip></a><h2 class=helpfile>Min IP-adress</h2><p>Om du har fått en fast IP-adress av din internetleverantör, till exempel 10.0.0.140, anger du den här. I annat fall lämnar du det här fältet tomt. Du kan då tilldelas en IP-adress automatiskt när du ansluter.</p><a name=serverip></a><h2 class=helpfile>Serverns IP-adress</h2><p>Om din internetleverantör gav dig IP-adressen till deras server, till exempel 10.0.0.138, anger du den här. Om din ISP har givit dig namnet på servern, t.ex. vpn.corbina.net, kan du ange namnet här.</p><h2 class=helpfile>IP-adress för gateway</h2><p>Om du har en fast (eller statisk) IP-adress som <b>Min IP-adress</b> bör din ISP ha tillhandahållit en gateway-IP-adress. Du måste ange gateway-IP-adressen här. Om du använder en DHCP-klient för att hämta <b>Min IP-adress</b>, eller om din internetleverantör kräver att du lämnar fältet Min IP-adress tomt, behöver du inte ange någon gateway-IP-adress. </p><a name=id></a><h2 class=helpfile>Anslutnings-ID/namn</h2><p>Fältet <b>ID/namn</b> ska normalt lämnas tomt. Men om du har fått den här uppgiften av din internetleverantör anger du anslutnings-ID:t här.</p><a name=DNSaddress></a><h2 class=helpfile>DNS-adress (Domain Name Server) </h2><p>DNS-servern används till att söka upp webbsideadresser baserat på deras namn. </p><p>Om din internetleverantör har gett dig en eller två DNS-adresser väljer du <b>Använd de här DNS-servrarna</b> och skriver in den primära och sekundära adressen. </p><p>Annars väljer du <b>Hämta automatiskt från ISP</b>. </p><p><b>Obs!  </b>Om du får felmeddelanden om att adressen inte kan hittas när du går till en webbplats, är det troligt att dina DNS-servrar inte är rätt konfigurerade. Kontakta din internetleverantör och be om rätt DNS-serveradresser. </p><h2 class=helpfile><a name=localaddress></a>Routerns MAC-adress </h2><p>Varje dator eller router i nätverket har en unik 48-bitars lokal Ethernet-adress. Den kallas också för datorns MAC-adress (Media Access Control).</p><p>Vanligtvis väljer du <b>Använd standardadress</b>.</p><p>Om din internetleverantör kräver MAC-autentisering väljer du antingen <b>Använd datorns MAC-adress</b>, så att routern använder MAC-adressen till den dator du använder nu, eller <b>Använd den här MAC-adressen</b> och skriver in den MAC-adress som din internetleverantör förväntar sig manuellt.</p> <p>MAC-adressens format är XX:XX:XX:XX:XX:XX. Om du väljer <b>Använd den här MAC-adressen</b> och anger en MAC-adress ska du inte välja <b>Använd den här datorns MAC-adress</b>, eftersom din post då skrivs över.</p><h2 class=helpfile><a name=buttons>  </a>Knapparna Tillämpa, Avbryt och Test</h2><p>Klicka på <b>Tillämpa</b> (Apply) när du har ändrat klart inställningarna. </p><p>Klicka på <b>Avbryt (Cancel)</b> om du vill återgå till de tidigare inställningarna. </p><p>Klicka på <b>Test</b> för att ansluta till NETGEARs webbplats. Om anslutningen fungerar är inställningarna korrekta och du kan klicka på <b>Logga ut</b> för att avsluta dessa skärmar och börja surfa på nätet.</p><p>Om anslutningen inte fungerar: </p><ul><li>Gå igenom inställningarna och kontrollera att du har valt rätt alternativ och skrivit in allt korrekt. </li><li>Kontakta din internetleverantör för att bekräfta att du har rätt konfigureringsuppgifter. </li><li>Läs avsnittet Felsökning i enhetens <i>installationshandbok</i>.</li><li>Kontakta NETGEARs tekniska support.</li></ul> </div></body>";
