var hlp_h_dslcfg="<body bgcolor=#0099cc><h1 class=helpfileHjälp för ADSL-inställningar<p>Standardparametrarna ska vara rätt och matcha det system som internetleverantören använder</p><ul><li>Multiplexing-metod – internetleverantören anger om Multiplexing-metoden är VC-BASERAD eller LLC-BASERAD.<li>Virtuell krets – internetleverantören anger vilken VPI/VCI-kombination som används för din tjänst.</ul><p><B>Tillämpa eller Avbryt </B></p><p>Klicka på <B>Tillämpa</B> om du vill spara de nya inställningarna för routern. <BR>Klicka på <B>Avbryt</B> om du vill ignorera ändringar som du inte har sparat. <BR></body>";
var hlp_h_svinfo="<body><a name='def'></a><h1 class='helpfile'>Service Definition Help</h1><p>The Service Definition menu allows you to define or edit your own custom service definition. The custom service can then be used when creating firewall rules.</p><p> <b>Name</b> </p><p>Enter a suitable name for this Service.</p><p> <b>Type</b> </p><p>Select the correct type for this Service (if in doubt, select TCP/UDP):<ul><li>TCP<li>UDP<li>TCP/UDP</ul><p> <b>Start Port</b> <ul><li>If a port range is required, enter the beginning of the range here, and the end of the range in the 'Finish Port' field.<li>If a single port is required, enter the same value in both the 'Start' and 'Finish' fields.</ul><p> <b>Finish Port</b> <ul><li>This field can be used to enter the end of the range of port numbers.<li>If a single port is required, enter the same value in both the 'Start' and 'Finish' fields.</ul></body>";
var hlp_hadv_wps="<body><h1 class='helpfile'>WPS (Wi-Fi Protected Setup) Settings</h1><p> <b>Router's PIN</b> <p>This is the PIN number you use on a registrar (for example from the Network Explorer on a Vista Windows PC) to configure the router's wireless settings through WPS.<BR>You can also find the PIN on the router's product label.<p> <b>Disable Router's PIN</b> <p>Only when the router's PIN is enabled can you configure the router's wireless settings or add a wireless client through WPS with the router's PIN number. This Router's PIN function may be temporarily disabled when the router detects suspicious attempts to break into the router's wireless settings by using the router's PIN through WPS. Users can manually enable this function by unchecking the option and clicking the Apply button.<p> <b>Keep Existing Wireless Settings</b> <p>This indicates whether or not the router is in the WPS Configured state.<br>If this option is not checked, adding a new wireless client will change the router's wireless settings to an automatically generated random SSID and security key. Please note that if this option is checked, some external registrars (e.g. Network Explorer on Vista Windows) may not see the router.<br>Configuring basic wireless settings from the router's management interface results in this option being checked.</p></body>";
var hlp_hipv6="<body><h1>IPv6 Help</h1></body>";
var hlp_hpppoa="<body bgcolor=#0099cc><div class=Section1><h1 class=helpfile>Hjälp </h1><p>På skärmen Grundläggande inställningar kan du konfigurera, uppgradera och kontrollera status för din trådlösa NETGEAR Cable/DSL-router.</p> <p>Klicka på en post i kolumnen längst till vänster. De aktuella inställningarna eller informationen för det området visas i mittenkolumnen. <p>Användbar information som relaterar till den valda inställningssidan visas i den här kolumnen. Om du använder Internet Explorer kan du klicka på en post i mittenkolumnen för att gå direkt till det relaterade hjälpavsnittet. I annat fall bläddrar du ned tills du hittar det. <hr><a name=bsetting></a><h1>Hjälp för grundläggande inställningar</h1><p><b>Obs!</b> Om du konfigurerar routern för första gången kanske standardinställningarna fungerar för dig utan ändringar. <a name=question></a><p><b>Kräver Internet-anslutningen inloggning?</b> <p>Välj det här alternativet utifrån vilken typ av konto du har hos din internetleverantör. Om du måste ange inloggningsuppgifter varje gång du ansluter till internet eller om du har ett PPPoE-konto hos din internetleverantör, väljer du <b>Ja</b>. I annat fall väljer du <b>Nej</b>. <a name=enc></a><h2 class=helpfile>Inkapsling</h2><p>Välj den tjänst som din internetleverantör tillhandahåller. De två alternativen är PPPoE (PPP over Ethernet) och PPPoA (PPP over ATM).</p><h2 class=helpfile><a name=login></a>Logga in </h2><p>Det här är oftast namnet du använder i din e-postadress. Om ditt huvud-e-postkonto är JerAB@ISP.com skriver du alltså JerAB i rutan. </p><p>Vissa Internet-leverantörer kräver att du använder din fullständiga e-postadress vid inloggning. Om din internetleverantör kräver att du anger din fullständiga e-postadress skriver du den i rutan Inloggning. </p><a name=password></a><h2 class=helpfile>Lösenord</h2><p>Skriv lösenordet som du använder för att logga in hos din internetleverantör. </p><a name=idletime></a><h2 class=helpfile>Inaktivitetstidsgräns</h2><p>En internetanslutning med inaktivitetstidsgräns avbryts efter den angivna tiden.<p>Om värdet är noll (0) hålls anslutningen igång genom att återanslutas varje gång anslutningen förloras.</p><p><a name=InternetIP></a><b>Internet-IP-adress  </b><p>Om du loggar in på din tjänst eller om du inte fått någon fast IP-adress av Internet-leverantören, kommer routern att söka upp en IP-adress automatiskt när du ansluter. Välj <b>Hämta dynamiskt från ISP</b>. <p>Om du har en fast (eller statisk) IP-adress, har du fått en IP-adress av din Internet-leverantör. Välj <b>Använd statisk IP-adress</b> och skriv in IP-adress, subnätmask och gateway-IP-adress i rätt fält.<p>Exempel: <ul><li>      IP-adress: 24.218.156.183 <li>      Subnätmask: 255.255.255.0 <li>      Gateway-IP-adress: 24.218.156.1 </ul><a name=DNSaddress></a><h2 class=helpfile>DNS-adress (Domain Name Server) </h2><p>DNS-servern används till att söka upp webbsideadresser baserat på deras namn. </p><p>Om din internetleverantör har gett dig en eller två DNS-adresser väljer du <b>Använd de här DNS-servrarna </b> och skriver in den primära och sekundära adressen. </p><p>Annars väljer du <b>Hämta automatiskt från ISP</b>. </p><p><b>Obs!  </b>Om du får felmeddelandet Adressen kunde inte hittas när du går till en webbplats, är det troligt att dina DNS-servrar inte är rätt konfigurerade. Kontakta din internetleverantör och be om rätt DNS-serveradresser.</p><p><a name=nat></a><b>NAT (Network Address Translation)</b><p>Med NAT kan alla LAN-datorer få internetåtkomst via den här routern, genom att dela den här routerns WAN IP-adress. I de flesta fall behövs NAT för internetåtkomst via den här routern. Du bör bara avaktivera NAT om du är säker på att du inte behöver den. När NAT är avaktiverad utför den här routern endast standarddirigering.</p><a name=buttons>  </a><h2 class=helpfile>Knapparna Tillämpa, Avbryt och Test</h2><p>Klicka på <b>Tillämpa</b> när du har ändrat klart inställningarna. </p><p>Klicka på <b>Avbryt</b> om du vill återgå till de ursprungliga inställningarna. </p> <p>Klicka på <b>Test</b> för att ansluta till NETGEARs webbplats. Om anslutningen fungerar är inställningarna korrekta och du kan klicka på <b>Logga ut</b> för att avsluta dessa sidor och börja surfa på <b>nätet.</b></p><p>Om anslutningen inte fungerar:</p><ul><li>Gå igenom inställningarna och kontrollera att du har valt rätt alternativ och skrivit in allt korrekt.</li><li>Kontakta din internetleverantör för att bekräfta att du har rätt konfigureringsuppgifter. </li><li>Läs avsnittet Felsökning i <i>installationshandboken för enheten</i>.</li><li>På <i>resurs-cd:n för enheten</i> läser du <i>felsökningsguiden</i> eller avsnittet Felsökning i <i>referenshandboken</i>.</li><li>Kontakta NETGEARs tekniska support.</li></ul> </div></body>";
var hlp_hpptpc="<body bgcolor=#0099cc><div class=Section1><P><font size=4><B>Hjälp</B></font></P><p>På skärmen Grundläggande inställningar kan du konfigurera, uppgradera och kontrollera status för din trådlösa NETGEAR Cable/DSL-router.</p> <p>Klicka på en post i kolumnen längst till vänster. De aktuella inställningarna eller informationen för det området visas i mittenkolumnen. <p>Användbar information som relaterar till de valda inställningsfönstren visas i den här kolumnen. Om du använder Internet Explorer kan du klicka på en post i mittenkolumnen för att gå direkt till det relaterade hjälpavsnittet. I annat fall bläddrar du ned tills du hittar det. <hr><a name=bsetting></a><P><font size=4><B>Hjälp för grundläggande inställningar</B></font></P><p><b>Obs!</b> Om du konfigurerar routern för första gången kanske standardinställningarna fungerar för dig utan ändringar.<a name=question></a><p><b>Kräver internetanslutningen inloggning?</b> <p>Välj det här alternativet utifrån vilken typ av konto du har hos din internetleverantör. Om du måste ange inloggningsuppgifter varje gång du ansluter till internet eller om du har ett PPPoE/PPTP/L2TP-konto hos din internetleverantör klickar du på <b>Ja</b>. Annars klickar du på <b>Nej</b>. </p><p><b>Obs!  </b>Om du har installerat PPP-programvara, t.ex. WinPoET (från Earthlink) eller Enternet (från PacBell), har du PPPoE. Välj <b>Ja</b>. När du har valt Ja och konfigurerat routern behöver du inte köra PPP-programmet på datorn för att ansluta till internet. </p><a name=isp></a><h2 class=helpfile>Internetleverantör</h2><p>Välj den tjänst som din internetleverantör tillhandahåller. <b>PPPoE</b> är vanligast. <b>PPTP</b> används i Österrike och andra europeiska länder. <b>L2TP</b> används i Ryssland, Israel och är inte vanligt i andra länder.</p><a name=login></a><h2 class=helpfile>Logga in </h2><p>Det här är oftast namnet du använder i din e-postadress. Om ditt huvud-e-postkonto är JerAB@ISP.com skriver du alltså JerAB i det här fältet. </p><p>Vissa internetleverantörer (som Mindspring, Earthlink och T-DSL) kräver att du använder din fullständiga e-postadress vid inloggning. Om din internetleverantör kräver att du anger din fullständiga e-postadress skriver du den i fältet <b>Inloggning (Login)</b>. </p><a name=password></a><h2 class=helpfile>Lösenord</h2><p>Skriv lösenordet som du använder för att logga in hos din internetleverantör. </p><a name=conn_mode></a><h2 class=helpfile>Anslutningsläge</h2><p>Ange anslutningsläget till antingen Uppringning på begäran, Alltid på eller Manuell anslutning.<br>Med standardinställningen, Uppringning på begäran, upprättas en PPPoE-/PPTP-/L2TP-anslutning automatiskt när det förekommer utgående trafik mot internet, och anslutningen kopplas ned automatiskt efter värdet för Inaktivitetstidsgräns. När anslutningsläget är Alltid på upprättas PPPoE/PPTP/L2TP-anslutningen automatiskt när datorn startas, och anslutningen bryts inte vid inaktivitet. Om anslutningen av någon anledning kopplas ned kommer routern fortsätta att försöka återupprätta den. Om du väljer Manuell anslutning måste du gå till skärmen Routerstatus och klicka på knappen Anslut för att ansluta till internet. En manuell anslutning kan inte bli inaktiv, och du måste klicka på knappen Koppla från på skärmen Routerstatus om du vill koppla ned anslutningen.</p><a name=idletime></a><h2 class=helpfile>Inaktivitetstidsgräns</h2><p>En internetanslutning med inaktivitetstidsgräns avbryts efter den angivna tiden.<p>Om värdet är noll (0) kommer anslutningen att hållas levande, så fort anslutningen kopplas ned kommer den att upprättas igen.</p><a name=myip></a><h2 class=helpfile>Min IP-adress</h2><p>Om du har fått en fast IP-adress av din internetleverantör, till exempel 10.0.0.140, anger du den här. I annat fall lämnar du det här fältet tomt. Du kan då tilldelas en IP-adress automatiskt när du ansluter.</p><a name=serverip></a><h2 class=helpfile>Serverns IP-adress</h2><p>Om din internetleverantör gav dig IP-adressen till deras server, till exempel 10.0.0.138, anger du den här. Om din ISP har givit dig namnet på servern, t.ex. vpn.corbina.net, kan du ange namnet här.</p><h2 class=helpfile>IP-adress för gateway</h2><p>Om du har en fast (eller statisk) IP-adress som <b>Min IP-adress</b> bör din ISP ha tillhandahållit en gateway-IP-adress. Du måste ange gateway-IP-adressen här. Om du använder en DHCP-klient för att hämta <b>Min IP-adress</b>, eller om din internetleverantör kräver att du lämnar fältet Min IP-adress tomt, behöver du inte ange någon gateway-IP-adress. </p><a name=id></a><h2 class=helpfile>Anslutnings-ID/namn</h2><p>Fältet <b>ID/namn</b> ska normalt lämnas tomt. Men om du har fått den här uppgiften av din internetleverantör anger du anslutnings-ID:t här.</p><a name=DNSaddress></a><h2 class=helpfile>DNS-adress (Domain Name Server) </h2><p>DNS-servern används till att söka upp webbsideadresser baserat på deras namn. </p><p>Om din internetleverantör har gett dig en eller två DNS-adresser väljer du <b>Använd de här DNS-servrarna</b> och skriver in den primära och sekundära adressen. </p><p>Annars väljer du <b>Hämta automatiskt från ISP</b>. </p><p><b>Obs!  </b>Om du får felmeddelanden om att adressen inte kan hittas när du går till en webbplats, är det troligt att dina DNS-servrar inte är rätt konfigurerade. Kontakta din internetleverantör och be om rätt DNS-serveradresser. </p><h2 class=helpfile><a name=localaddress></a>Routerns MAC-adress </h2><p>Varje dator eller router i nätverket har en unik 48-bitars lokal Ethernet-adress. Den kallas också för datorns MAC-adress (Media Access Control).</p><p>Vanligtvis väljer du <b>Använd standardadress</b>.</p><p>Om din internetleverantör kräver MAC-autentisering väljer du antingen <b>Använd datorns MAC-adress</b>, så att routern använder MAC-adressen till den dator du använder nu, eller <b>Använd den här MAC-adressen</b> och skriver in den MAC-adress som din internetleverantör förväntar sig manuellt.</p> <p>MAC-adressens format är XX:XX:XX:XX:XX:XX. Om du väljer <b>Använd den här MAC-adressen</b> och anger en MAC-adress ska du inte välja <b>Använd den här datorns MAC-adress</b>, eftersom din post då skrivs över.</p><h2 class=helpfile><a name=buttons>  </a>Knapparna Tillämpa, Avbryt och Test</h2><p>Klicka på <b>Tillämpa</b> (Apply) när du har ändrat klart inställningarna. </p><p>Klicka på <b>Avbryt (Cancel)</b> om du vill återgå till de tidigare inställningarna. </p><p>Klicka på <b>Test</b> för att ansluta till NETGEARs webbplats. Om anslutningen fungerar är inställningarna korrekta och du kan klicka på <b>Logga ut</b> för att avsluta dessa skärmar och börja surfa på nätet.</p><p>Om anslutningen inte fungerar: </p><ul><li>Gå igenom inställningarna och kontrollera att du har valt rätt alternativ och skrivit in allt korrekt. </li><li>Kontakta din internetleverantör för att bekräfta att du har rätt konfigureringsuppgifter. </li><li>Läs avsnittet Felsökning i enhetens <i>installationshandbok</i>.</li><li>Kontakta NETGEARs tekniska support.</li></ul> </div></body>";
var hlp_hsstatus_w="<body bgcolor=#0099cc ><P><font size=4><B>Hjälp för routerstatus</B></font></P>    <p> (Router Status Help) På skärmen routerstatus (Router Status) kan du kontrollera routerns inställningar och statistik.  Den här skärmen visar alla aktuella inställningar. Om något behöver ändras måste du göra det på den relevanta skärmen.<p><b>Maskinvaruversion</b>: Routerns modell.<a name=firv></a> <p><b> Version av fast programvara (Firmware Version)</b>: Detta är den aktuella programvara som routern använder. Den ändras om du uppgraderar din router.<p><b>Version av användargränssnittsspråk</b>: Den lokaliserade versionen av användargränssnittet.<a name=internet_port></a><p><b>Internet- port</b>: Detta är de aktuella inställningarna som du angett i installationsguiden Setup Wizard eller på skärmen grundläggande inställningar (Basic Settings).<ul><a name=wanmac></a><li>MAC-adress. Routerns fysiska adress, som den visas från Internet.<a name=wanip></a><li>IP-adress. Den aktuella Internet-IP-adressen Om den tilldelats dynamiskt och ingen Internet-anslutning finns, kommer fältet att vara tomt eller visa 0.0.0.0.<a name=wansubnet></a><li>IP-subnätmask (IP Subnet Mask). Subnätmasken som är associerad med Internet-IP-adressen.<a name=wangtw></a><li>Standard-gateway (Default Gateway). Aktuell Internet-gateway. Om den tilldelats dynamiskt och ingen Internet-anslutning finns, kommer fältet att vara tomt eller visa 0.0.0.0.<a name=wandns></a><li>DNS-server (Domain Name Server). Visar aktuell DNS-adress.<a name=wandhcp></a><li>DHCP. Indikerar antingen <b>Klient</b> (Client) (IP-adressen erhålls dynamiskt) eller <b>ingen</b>(None).</ul><a name=lan_port></a> <p><b>LAN- port</b>. Detta är de aktuella inställningar som de visas på skärmen IP-konfiguration för LAN ( LAN IP Setup). <ul><a name=lanmac></a> <li>MAC-adress. Routerns fysiska adress som den visas i LAN-nätverket.<a name=lanip></a><li>IP-adress. Routerns LAN-IP-adress.<a name=lansubnet></a><li> IP-subnätmask (IP Subnet Mask). Subnätmasken som är associerad med LAN-IP-adressen.<a name=landhcp></a><li>DHCP. Indikerar om routern fungerar som DHCP-server för enheter i LAN-nätverket.</ul><a name=wireless_port></a><p><b>Trådlös  port (Wireless Port)</b>: Detta är de aktuella inställningarna som visas på skärmen Trådlösa anslutningar (Wireless Settings).<ul><a name=wlssid></a><li>Namn (SSID) (Name, SSID). Routerns SSID.<a name=wlregion></a><li>Region. Platsen (land).<a name=wlchannel></a><li>Kanal (Channel). Den kanal som används.";
var hlp_hw_cip="<body><div class=Section1><h1 class='helpfile'>IP Over ATM Help</h1><p>The Setup Wizard has detected IP Over ATM using the RFC1577 protocol.</p><a name='InternetIP'></a><h2 class='helpfile'>Internet IP Address</h2><p>If you have a fixed (or static IP)address, your ISP will have provided you with the required information. Typethe IP Address and Subnet Mask. A Default Gateway IP address is not needed in a RFC1577 environment.</p><p>For example:</p><ul><li>IP Address: 24.218.156.183<li>Subnet Mask: 255.255.255.0</li></ul><a name='DNSaddress'></a><h2 class='helpfile'>DNS Address</h2><p>The DNS server is used to look up siteaddresses based on their names.</p><p>If your ISP gave you two DNSaddresses, type in the primary andsecondary addresses. Otherwise, enter the primary address, and leave the secondary blank.</p><p> <b>Note:</b> If you get 'Address not found' errorswhen you go to a Web site, it is likely that your DNS servers aren't set upproperly. You should contact your ISP to get DNS server addresses.</p><a name=buttons></a><h2 class='helpfile'>Apply, Cancel and Test</h2><p>Click <b>Apply</b> when you finishchanging the settings.</p><p>Click Cancel to return to the originalsettings.</p><p>Click <b>Test</b> to connect to theNETGEAR Web site. If you connect successfully, your settings work and you mayclick <b>Logout</b> to exit these pages and... enjoy surfing the <b>'net!</b> </p><p>If you don't connect successfully,</p><ul><li>Go through the settings and make sureyou've selected the correct options and typed everything correctly.<li>Contact yourISP to verify the configuration information.<li>Read the Troubleshooting section in the <i>WNR2000 Installation Guide.</i> <li>On the <i>WNR2000 Resource</i> CD, read the <i>Troubleshooting Guide</i> or the Troubleshootingsection in the <i>Reference Manual.</i> <li>Contact NETGEAR Technical Support.</ul></div></body>";
var hlp_hw_pppoa="<body><div class=Section1><h1 class='helpfile'>PPPoA Help</h1><h2 class='helpfile'><a name='login'></a>Login</h2><p>This is usually the name thatyou use in your e-mail address. For example, if your main mail account isJerAB@ISP.com, then put JerAB in this box.</p><p>Some ISPs (like Mindspring, Earthlink, and T-DSL) require that you use your full e-mail address when you log in. If your ISP requires your full e-mail address, then type it in the Login box.</p><a name='password'></a><h2 class='helpfile'>Password</h2><p>Type the password that you use to log in to your ISP.</p><a name='buttons'></a><h2 class='helpfile'>Apply, Cancel and Test Buttons</h2><p>Click <b>Apply</b> when youfinish changing the settings.</p><p>Click <b>Cancel</b> to returnto the original settings.</p><p>Click <b>Test</b> to connect tothe NETGEAR Web site. If you connect successfully, your settings work and youmay click <b>Logout</b> to exit these pages and... enjoy surfing the <b>'net!</b> </p><p>If you don't connect successfully,</p><ul><li>Go through the settings and make sure you've selected the correct options and typed everything correctly.</li><li>Contact your ISP to verify the configuration information.</li><li>Read the Troubleshooting section in the <i>Device Installation Guide.</i> </li><li>On the <i>Device Resource</i> CD, read the <i>Troubleshooting Guide</i> or the Troubleshooting section in the <i>Reference Guide.</i> </li><li>Contact NETGEAR Technical Support.</li></ul></div></body>";
var hlp_hw_pppoe="<body><div class=Section1><h1 class='helpfile'>PPPoE Help</h1><a name='login'></a><h2 class='helpfile'>Login</h2><p>This is usually the name thatyou use in your e-mail address. For example, if your main mail account isJerAB@ISP.com, then put JerAB in this box.</p><p>Some ISPs (like Mindspring, Earthlink, and T-DSL) require that you use your full e-mail address when you log in. If your ISP requires your full e-mail address, then type it in the Login box.</p><a name='password'></a><h2 class='helpfile'>Password</h2><p>Type the password that you useto log in to your ISP.</p><a name='buttons'></a><h2 class='helpfile'>Apply, Cancel and Test Buttons</h2><p>Click <b>Apply</b> when youfinish changing the settings.</p><p>Click <b>Cancel</b> to returnto the original settings.</p><p>Click <b>Test</b> to connect tothe NETGEAR Web site. If you connect successfully, your settings work and youmay click <b>Logout</b> to exit these pages and... enjoy surfing the <b>'net!</b> </p><p>If you don't connect successfully,</p><ul><li>Go through the settings and make sure you've selected the correct options and typed everything correctly.</li><li>Contact your ISP to verify the configuration information.</li><li>Read the Troubleshooting section in the <i>Device Installation Guide.</i> </li><li>On the <i>Device Resource</i> CD, read the <i>Troubleshooting Guide</i> or the Troubleshooting section in the <i>Reference Guide.</i> </li><li>Contact NETGEAR Technical Support.</li></ul></div></body>";
