var hlp_hBKS_service_add="<body bgcolor=#0099cc ><P><font size=4><B>Hjälp för att installera blockeringstjänst</B></font></P><p> (Block Services Setup Help) Med den här funktionen kan du blockera Internet-åtkomst för specifika användare i ditt lokala nätverk baserat på deras IP-adresser. Dessutom kan du förhindra att vissa Internet-tjänster används helt och hållet.<p><hr> <p><b>Så här lägger du till/redigerar en tjänst:</b></p><ol><li>Välj typ av tjänst i listrutan eller välj <b>Användardefinierad</b>(User Defined) om typen du vill ha inte finns i listan.<li>Om du väljer<b> </b>användardefinierad måste du även välja protokoll och ange namnet och intervallet för portnumren som tjänsten använder. För kända tjänster fylls dessa fält i automatiskt.<li>Ange IP-adressalternativet för att avgöra vilka datorer som är blockerade. (Du får mer information om detta längre fram i det här avsnittet).<li>Klicka på <b>Lägg till/godkänn</b> (Add/Accept) om du vill spara ändringarna.</ol><a name=ip></a><p><b>Filtrera tjänster för(Filter Services For)</b>. Detta avgör vilka datorer som kommer att blockeras.<ul><li>Bara den här IP-adressen (Only This IP Address). Endast en (1) dator kommer att blockeras. Skriv in IP-adressen för datorn som ska blockeras.<li>IP-adressintervall (IP Address Range). En grupp datorer som avgörs efter IP-adress kommer att blockeras. Ange början och slut av IP-adressintervallet för de datorer som ska blockeras.<li>Alla IP-adresser (All IP Addresses). Alla datorer kommer att blockeras.</ul><hr> <p><b>Så här sparar och avbryter du ändringar:</b></p><p>Klicka på <b>Lägg till/godkänn</b> (Add/Accept) när du är klar för att uppdatera tabellen Blockera tjänster (Block Services). <br> Klicka på <b>avbryt</b> (Cancel) om du vill återgå till de tidigare inställningarna.</p></body>";
var hlp_h_qos_tuobovideo="<body bgcolor=#0099cc ><P><font size=4><B>FastLane</B></font></P><P>Första gången du sätter på videoläge ska du ange den bandbredd du vill reservera och konfigurera knappen för FastLane. Med andra ord ska du fylla i alla fält på den här sidan och klicka på <B>Tillämpa </B> så att dina ändringar ska börja gälla.<B>FastLane-status:  </B>I det här fältet visas om FastLane är på eller av.<B>Aktivera FastLane:</B>FastLane är avstängt som standard, och knappen på frontpanelen fungerar som en WPS-knapp (Wi-Fi Protected Setup). Du aktiverar FastLane genom att markera den här kryssrutan.<B>Bandbredd reserverad för betrodda IP-adresser</B>Ange procentandel för bandbredden på den trådlösa routern för att reservera när du ansluter från en betrodd IP-adress. Det förhindrar att andra utnyttjar din bandbredd. När du ansluter till routern från den betrodda IP-adressen har du garanterad bandbredd för videoströmningsprogram.&nbsp;Det finns 4 alternativ: 50 %, 60 %, 70 % och 80 %.<B>Knapp:</B>Du kan konfigurera knappen på frontpanelen så att den fungerar på två sätt: (1) WPS (standard); (2) FastLane. Välj alternativknappen för det alternativ du önskar.</P></body>";
var hlp_h_gd_basic="<body bgColor=#0099cc><P><font size=4><B>Hjälp för grundläggande inställningar i NETGEAR Downloader</B></font></p><HR><a name=gd_down_speed></a><P><B>Maximal hämtningshastighet (0 betyder utan gräns)</B></P><p>Den här inställningen begränsar den maximala hämtningshastigheten för HTTP/FTP/BT (i kB/sek). Standardinställningen är 0 (0 betyder utan gräns på hämtningshastighet).</p><a name=gd_up_speed></a><p><B>Maximal överföringshastighet (0 betyder utan gräns)  </B></p><p>Den här inställningen begränsar den maximala överföringshastigheten för HTTP/FTP/BT (i kB/sek). Standardinställningen är 0 (0 betyder utan gräns på överföringshastighet).</P><a name=gd_task_num></a><P><B> Största uppgift som kan hämtas  </B><P>Med den här inställningen i NETGEAR Downloader anges den största uppgiften som kan hämtas med den trådlösa routern. Standardinställningen är baserad på CPUns bearbetningskapacitet och DRAM-storlek för den trådlösa routern.<a name=gd_upload></a><P><B> Tillåt systemets automatiska hantering av NETGEAR Downloader  </B><P>Med det här alternativet tillåts systemets hantering av NETGEAR Downloader. När kryssrutan är markerad tas alla slutförda hämtningsuppgifter (i listan) bort så att de inte upptar utrymme vid kommande överföringar. Om kryssrutan är avmarkerad (standardinställning) görs inget i systemet när hämtningsuppgifterna är slutförda. I det här fallet delas de hämtade filerna med övriga klienter.</P></body>";
var hlp_h_GDH01="<body bgcolor=#0099cc><p><font size=4><B>NETGEAR Downloader</B></font></p><p><b>NETGEAR Downloader</b> går att använda med hämtningsprotokollen för HTTP, FTP, BT och eDonkey. Med NETGEAR Downloader kan du använda en <b>NETGEAR-router</b> till att hämta filer från internet och spara dem på en USB-lagringsenhet utan att ha datorn på.</p><hr><a name=green_path></a><b>Spara som sökväg </b>: Välj en plats där du vill spara hämtade filer.</p></body>";
var hlp_h_GDH02="<p>Med <b>FTP-/HTTP-hämtning</b> kan användaren hämta filer från internet via FTP-/HTTP-protokoll.</p><hr><p><a name=http_url></a><b>FTP-/HTTP-hämtningslänk:  </b>Det här är en internetadress och visar URL-adressen för filen du vill hämta från internet. Formatet är ftp:// eller http://.<br><a name=http_name></a><b>Användarnamn (tillval):  </b>Det här fältet är inte obligatoriskt. Ange serverns användarnamn här om servern kräver det. Maxlängden för användarnamnet är 32 tecken.<br><a name=http_password></a><b>Lösenord (tillval):  </b>Det här fältet är inte obligatoriskt. Ange serverns lösenord här om servern kräver det. Maxlängden för lösenordet är 32 tecken.<br><b>Lägg till:  </b>Klicka på \"Lägg till\" för att lägga till en ny hämtad uppgift.<br><b>Återställ:  </b>Klicka på \"Återställ\" för att återställa allt angivet innehåll.</p><hr><p><a name=http_table></a><b>Hämtning av informationstabell</b></p><p><b>Pausa:  </b>Klicka på knappen \"Pausa\" för att pausa en uppgift som hämtas.<br><b>Återuppta:  </b>Klicka på knappen \"Återuppta\" för att återuppta en pausad uppgift.<br><b>Ta bort:  </b>Klicka på knappen \"Ta bort\" för att ta bort en befintlig uppgift.</p><hr><p><a name=http_table></a><b>Hämtade filer</b></p><p><b>Ta bort historik:  </b>Klicka på knappen \"Ta bort historik\" för att ta bort alla slutförda hämtade uppgifter.</p>";
var hlp_h_download=hlp_h_GDH01+hlp_h_GDH02;
var hlp_h_ap_setting="<body bgColor=#0099cc><P><font size=4><B>Hjälp för trådlöst kopplingspunktsläge</B></font></P><HR><P><a name=enable_ap></a><B>Aktivera kopplingspunktsläget</B></P><P>I aktiverat kopplingspunktsläge kan enheten agera som en brygga för datalänkskiktet där den fortfarande har en IP-adress för enhetskonfiguration.</P><P><a name=dynamic_ip></a><B>Hämta dynamiskt från befintlig router</B></P><P>Enheten hämtar automatiskt en IP-adress från DHCP-servern</P><P><a name=fixed_ip></a><B>Använd fast IP-adress</B></P><P>Använd det här alternativet om du vill konfigurera IP-adressen, subnätmasken, IP-adressen för gateway eller DNS-serverns IP-adress manuellt.</P></body>";
var hlp_h_USB_media="<BODY bgcolor=#0099cc><P><font size=4><B>Hjälp för medieserver (inställningar)</B></font></P> <P> Du kan använda din router som en ReadyDLNA-medieserver som tillhandahåller media i DLNA-kompatibel form till DLNA- och UPnP AV-kompatibla mediespelare. Då kan du visa videor, filmer och bilder från kompatibla mediespelare som Xbox360, PlayStation och NETGEAR:s Digital Entertainer Live.</P><P>Du kan också aktivera iTunes Media Server och spela musik på din USB-lagringsenhet via iTunes och Apple Remote.</P><B><P> Aktivera DNLA Media Server </P></B><P> Markera kryssrutan för att aktivera routern så att den agerar som ReadyDLNA-medieserver. </P><B><P> Aktivera iTunes Media Server (endast musik) </P></B><P> Markera kryssrutan för att via iTunes och Apple Remote spela musik på en USB-lagringsenhet som är ansluten till routern. När du ansluter USB-enheten till routerns USB-port, kan du se musikbiblioteket som finns på USB-enheten i iTunes-appen på din Mac- eller Windowsdator. iTunes Media Server har stöd för flera filformat, bland annat MP3, AAC, FLAC, WAV och WMA.</P><B><P> Skriv in lösenordet som finns i Remote-appen</P></B><P> Apple Remote är en app för iPhone- och iPad-enheter. Den kan styra hur musik på USB-enheten spelas på Airplay-enheter. När du försöker att lägga till ett nytt bibliotek i Apple Remote-appen visas ett fyrsiffrigt lösenord. Skriv in lösenordet i fältet och klicka på knappen Tillåt fjärrkontroll. Då visar Apple Remote-appen musikbiblioteket på USB-enheten som är ansluten till routerns USB-port. </P><B><P> Medieserver/enhetsnamn</P></B><P> Det här är medieservernamnet som används både för DNLA-medieservern och iTunes-medieservern. Medieservernamnet är detsamma som enhetsnamnet. Standardnamnet är routerns modellnummer. Du ändrar namnet genom att klicka på länken Klicka här för att ändra enhetens namn och skriva in det nya namnet.</P><p><b>Innehållssökning</b><ul><li><b>Uppdatera databasen automatiskt  </b>Med det här alternativet söker du efter mediefiler automatiskt när nya filer läggs till på ReadyShare USB-lagringen. Det går bara att söka efter filer i delade mappar som har konfigurerats som \"Alla – inget lösenord\".</li><li>Du kan även klicka på <b>Sök mediafiler igen</b> om du vill ta bort den aktuella databasen och utföra en fullständig sökning omedelbart.</li></ul></p></BODY>";
var hlp_h_access_control="<body bgcolor=#0099cc><p><font size=4><B>Hjälp för åtkomstkontroll</B></font></p><p>Med hjälp av åtkomstkontrollen kan du tillåta eller blockera datorer eller elektronikprodukter från att få åtkomst till ditt nätverk. När en enhet är blockerad kan den endast hämta en IP-adress från din router. Den kan inte kommunicera med andra enheter och den kan inte heller anslutas till Internet.<p><A name=enable_acc_control></A><p><b>Aktivera åtkomstkontrollen:</b><p>Markera kryssrutan <b>Aktivera åtkomstkontroll</b>. När du markerar den här kryssrutan väljer du att tillåta eller blockera datorer eller elektronikprodukter från att få åtkomst till ditt nätverk. Innan du kan ange en åtkomstregel och använda knapparna Tillåt och Blockera måste du först markera den här kryssrutan. När den här kryssrutan är avmarkerad kan alla enheter anslutas, även de som är med i blockeringslistan.<p><A name=access_rule></A><p>Alternativknapparna för <b>åtkomstregler</b>. Välj den alternativknapp för åtkomstregeln som du vill ska gälla för nya enheter som försöker ansluta till ditt nätverk. Åtkomstregeln påverkar inte enheter som tidigare varit blockerade eller tillåtna. Det här gäller endast för enheter som i framtiden ansluts till ditt nätverk efter att du tillämpat de här inställningarna.<p>Som standard väljs \"Tillåt anslutning för alla nya enheter\", så om du eller din familj köper en ny enhet, kan den få åtkomst till ditt nätverk utan att MAC-adressen konfigureras på den här sidan.<p>NETGEAR rekommenderar att det här alternativet hålls markerat. Om du ändrar det här till \"Blockera anslutning för alla nya enheter\" kan inte din nya enhet få åtkomst till nätverket förrän du specifikt lägger till MAC-adressen i behörighetslistan. Anta att en ny dator har både trådlösa anslutningar och Ethernet-nätverksanslutningar. Eftersom det finns en egen MAC-adress för varje anslutning måste du specifikt lägga till båda MAC-adresserna i behörighetslistan.<p>Knapparna <b>Tillåt</b> och <b>Blockera</b>. Om du vill tillåta eller blockera åtkomst för en specifik enhet, markerar du rätt kryssruta och ändrar sedan statusen genom att klicka på knappen Tillåt eller Blockera.<p>Klicka på <b>Tillämpa</b> när du har ändrat klart inställningarna.<p>Klicka på <b>Avbryt</b> om du vill återgå till de tidigare inställningarna.</body>";
var hlp_h_openvpn="<body bgcolor=#0099cc><P><font size=4><B>Hjälp för VPN-tjänsten</B></font></P><p>Med VPN-tjänsten kan du på ett säkert sätt få åtkomst till ditt hemnätverk via internet när du inte är hemma. När du är utomlands kan du dessutom använda VPN-tjänsten till att besöka webbplatser som har en geografisk begränsning och inte är tillgängliga utanför hemlandet. När du ska använda VPN-tjänsten måste du identifiera din router via internet. Det kan du göra på två sätt. Vi rekommenderar att du använder dynamisk DNS. Det andra sättet är att identifiera din router via dess offentliga internetadress, och det är bättre att ha statiska IP-adressinställningar för routerns internetanslutning. Se till att du antingen har aktiverat dynamisk DNS eller att du har statiska IP-adressinställningar för din internetanslutning.</p><p>Så här installerar du VPN-klienten på dina enheter: </p><p>När du ska använda VPN-tjänsten måste du installera VPN-klientprogrammet på de enheter där du vill skapa en VPN-anslutning till routern. Följ stegen här när du utför installationen. I korthet så behöver du hämta VPN-klientprogrammet för din enhets system, installera det på enheten och konfigurera VPN-inställningar (installera konfigurationsfiler och eventuellt ändra några inställningar på klientenheten).</p><p>Tjänsttyp: Du kan använda protokollen TCP och UDP till att överföra VPN-paket.</p> <p>Tjänstport: Det här är den VPN-serverport som en VPN-klient ansluter till. Standardvärdet är 12974.</p><p>Klienter använder denna VPN-anslutning för åtkomst till: Det finns tre alternativ, \"Auto\", \"Endast hemnätverket\" och \"Alla adresser på internet och i hemnätverket\".Om du väljer \"Endast hemnätverket\" kan VPN-klienter endast komma åt hemnätverket via VPN-tjänsten. Om du vill få åtkomst till webbplatser eller tjänster med en geografisk begränsning när du befinner dig utomlands måste du välja alternativet \"Alla adresser på internet och i hemnätverket\". Om du väljer det här alternativet har VPN-klienten dessutom åtkomst till webbplatser och tjänster utan geografisk begränsning. För webbplatser och tjänster du normalt används över internet (t.ex. offentliga nätverk utan geografisk begränsning) är anslutningen långsammare via VPN-tjänsten än om du inte skulle använda VPN. Om du väljer alternativet \"Auto\" görs en smart analys så att VPN-tjänsten endast används när den behövs (dvs. endast för webbplatser eller tjänster som inte är tillgängliga utan VPN-tjänsten), men det här ska endast ses som en bästa gissning och det går inte att garantera att rätt beslut fattas.</p></body>";
var hlp_h_ipv6 ="<body bgcolor=#0099cc><P><font size=4><B>Hjälp för IPv6</B></font></P><p>På sidorna om IPv6 hittar du information om hur du konfigurerar och kontrollerar status för din IPv6-internetanslutning.<p><b>Internetanslutningstyp</b><p>Välj den IPv6-anslutningstyp du vill använda, vilket din internetleverantör förser dig med. Om din internetleverantör tillhandahåller någon specifik IPv6-anslutning kan du välja 6to4-tunnel. Om du inte är säker på IPv6-anslutningen kan du välja Automatisk avkänning och låta routern avgöra rätt typ åt dig.<p>Om din internetleverantör uttryckligen anger att din IPv6-anslutning inte är Autokonfiguration, DHCP, PPPoE eller Fast IP, eller om internetleverantören anger att den är av typen IPv6-autokonfiguration, kan du välja Passthrough.<p>Standardinställningen är Avaktiverad, vilket stänger av IPv6-funktionen.<p><b>Så här sparar eller avbryter du ändringarna eller visar aktuell IPv6-status</b><p>Klicka på <b>Tillämpa (Apply)</b> om du vill spara de nya inställningarna för routern.<br>Klicka på <b>Avbryt (Cancel)</b> om du vill ignorera ändringar som du inte har sparat.<br>Klicka på <b>Statusuppdatering (Status refresh)</b> om du vill uppdatera sidan och se information om den aktuella IPv6-anslutningen.</body>";
var hlp_h_vlan_iptv_setting = "<body bgcolor=#0099cc><P><font size=4><B>VLAN/IPTV-hjälp</B></font></P><p>En del internetleverantörer kräver routrar för att skicka och ta emot virtuella LAN-paket för internetanslutning. Det här kravet är vanligt för fiberanslutning.</p><p>En del IPTV:er fungerar inte bakom en trådlös routers NAT-brandvägg (network address translation). Du kan skapa ett nätverk genom att brygga IPTV-porten till internetporten utan NAT.</p><p name=vlan id=vlan></p><p><b>VLAN-inställning</b><p><ol><li> Markera kryssrutan Aktivera VLAN-etikett.</li><li>Klicka på knappen Redigera.</li><li>Ändra VLAN-ID och prioritetsinställningarna och portarna som tillhör gruppen.</li>Den här informationen får du från din ISP.<br>   <li>Klicka på knappen Lägg till.</li></ol><p>VLAN-gruppen läggs till.</p>Använd ett gruppnamn som är lätt att komma ihåg.</p><p name=iptv id=iptv></p><p><b>IPTV-inställning</b><p><ol><li>1. Avmarkera kryssrutan Aktivera VLAN-etikett.</li><li>Klicka på knappen Lägg till.</li></ol><p>De tillhörande portarna bryggas. Paket mellan bryggade portar behandlas inte via NAT eller brandvägg.</p></p></body>";
var hlp_h_fbwifi="<body bgColor=#0099cc><P><font size=4><B>Facebook Wi-Fi-hjälp</B></font></P><P>Med Facebook Wi-Fi kan kunder checka in hos deltagande företag på Facebook och få gratis Wi-Fi . Facebook Wi-Fi fungerar endast med det trådlösa gästnätverket.</P><P><b>Aktivera Facebook Wi-Fi</b> aktiverar Facebook Wi-Fi-funktionen för den här enheten. <BR>Klicka på <b>Tillämpa</b> om du vill spara de nya inställningarna för routern.<BR>Klicka på <b>Avbryt</b> om du vill ignorera ändringar som du inte har sparat.<BR>Klicka på Konfigurera för att anpassa välkomstsidan där andra personer kan checka in och se vad du vill dela.</BR></P></body>";
var hlp_h_port_range ="<p>Fältet Internt portintervall måste överensstämma med fältet Externt portintervall i följande hänseenden:</p> <ul><li>Båda fälten måste ha samma antal portintervaller </li><li>Varje portintervall i fältet Internt portintervall måste ha samma antal portar som motsvarande uppsättning i fältet Externt portintervall. </li></ul><p>Om du exempelvis anger 30–50, 78, 100–102 i fältet Externt portintervall är 40–60, 99, 200–202 en möjlig giltig inställning för fältet Internt portintervall eftersom det uppfyller båda kriterierna. Däremot är 40–50, 200–202 en ogiltig inställning för fältet Internt portintervall av två skäl:</p> <ul><li>Har inte samma antal portintervall (fältet Externt portintervall har tre intervall, och det ogiltiga exemplet har två intervall)</li> <li>Varje portintervallsfält har inte samma antal portar som motsvarande uppsättning i fältet Externt portintervall (den första uppsättningen i det ogiltiga exemplet på fältet Internt portintervall har endast tio portar, medan fältet Externt portintervall har 20 portar).</li></ul>";
var hlp_h_portforward = hlp_h_portforward_1 + hlp_h_port_range + hlp_h_portforward_2;
var hlp_h_led_control_setting ="<body bgcolor=#0099cc><p><font size=4><B>Hjälp för LED-kontrollinställningar</B></font></p><HR><p>På sidan LED-kontrollinställningar kan du aktivera eller avaktivera de blinkande indikatorlamporna för internet, LAN, trådlös anslutning och lagringsgränssnittet när datatrafik upptäcks. Du kan också välja om du vill stänga av alla lampor utom indikatorlampan för ström.</p></body>";
var hlp_h_readyshare_cloud ="<BODY><P><font size=4><B>ReadyCLOUD-hjälp</B></font></P><p>Med ReadyCLOUD får du fjärråtkomst via internet till en USB-lagringsenhet som är ansluten till routerns USB-port. För att använda ReadyCLOUD måste du ha ett ReadyCLOUD-konto. Saknar du ReadyCLOUD-konto kan du<a class='linktype' target='_blank' href='http://readycloud.netgear.com/clien/index.html#page=access'>klicka här</a> och sedan på <b>Logga in > Skapa konto</b>. </p><p><b>Konfigurera ReadyCLOUD</b></p><p><ol><li>Anslut en USB-lagringsenhet till routerns USB-port.</li><li>Ange ditt användarnamn och lösenord för ReadyCLOUD i fälten nedan och klicka på <b>Registrera</b>. Routern och USB-enheten registreras då för ReadyCLOUD.</li><li> Gå till <a class='linktype' target='_blank' href='http://readycloud.netgear.com'>http://readycloud.netgear.com</a>, klicka på Logga in, ange ditt användarnamn och lösenord för ReadyCLOUD, och klicka på knappen <b>Logga in</b>.</li></ol></p><p>      Du kan också via ReadyCLOUD-appen skapa en skyddad anslutning mellan din dator eller mobila enhet och routerns USB-lagringsenhet.<br>      <a class='linktype' target='_blank' href='http://readycloud.netgear.com/client/cloud_download.html'>Klicka här</a> för att hämta ReadyCLOUD-appen.</p><p><a name=readyshare_enable></a><b>Användarnamn och lösenord</b></p><p>Det här är det ReadyCLOUD-konto du skapade på NETGEARs webbplats i steg 1.<br/> Routern med USB-lagringen visas först när du registrerat den. Internetanslutningen mellan routern och ReadyCLOUD-servern hålls aktiv tills du avregistrerar den.<br/> Du kan även registrera routern med ett annat konto när du avregistrerat den från ett tidigare konto.<br/></p></BODY>";
var hlp_h_apcli_bridge ="<body bgcolor=#0099cc><p><font size=4><B>Hjälp för Trådlös brygga</B></font></p><HR><p>Du kan använda routern i bryggläge till att ansluta flera enheter med den högre 802.11ac-hastigheten.<br>Aktivera bryggläge: Du kan aktivera eller avaktivera bryggläge.<br>Klicka på knappen Ange inställningar för trådlöst bryggläge för att ange inställningarna för den andra routern som den här routern kommer att ansluta till.<br>1. Du kan välja det trådlösa nätverkets frekvens (2,4 GHz eller 5 GHz). För 802.11ac-läge väljer du 5 GHz.<br>2. I fältet Namn (SSID) anger du det trådlösa nätverkets namn (SSID).<br>3. I avsnittet Säkerhetsalternativ markerar du en alternativknapp.<br>4. Om du uppmanas om det anger du lösenordsfrasen (WiFi-lösenordet som du använder till att ansluta trådlöst till den andra routern).<br>5. Klicka på knappen <b>Tillämpa</b>.<br>Du måste också välja IP-adressinställningar för den här bryggan, antingen \"Hämta dynamiskt från befintlig router\" eller \"Använd fast IP-adress (rekommenderas inte)\".<br>Klicka på Tillämpa på sidan Trådlös brygga så börjar ändringarna gälla.</p></body>";
